(1, 'privacy_policy', '<h3><strong>Privacy Policy</strong></h3><h3>&nbsp;</h3><p><strong>1. Introduction</strong></p><p>Garg Dental (“we”, “our”, “us”) is committed to safeguarding your privacy and protecting your personal information. This privacy policy explains how we collect, use, disclose, and protect the information you provide when you use our website, services, or interact with us. We comply fully with the Consumer Protection Act, 2075, the Electronic Commerce Act, 2081, and all applicable data protection laws of Nepal.</p><p>&nbsp;</p><p><strong>2. Information we collect</strong></p><p>Depending on how you interact with us, we may collect the following types of personal information:</p><ul><li><strong>Identity information:</strong> Name, age, gender, and contact details (address, phone number, email).</li><li><strong>Account information:</strong> Username, password, order history, saved preferences.</li><li><strong>Payment information:</strong> Payment method, transaction details, partial card details (we do not store full card numbers).</li><li><strong>Medical-related information:</strong> When applicable, details about your prescriptions, dental or medical device needs, or other health-related information strictly required to process your order.</li><li><strong>Device &amp; usage data:</strong> IP address, browser type, device type, operating system, referring URLs, and website usage patterns.</li><li><strong>Cookies &amp; tracking data:</strong> To enhance site functionality, remember your preferences, and analyze website performance.</li><li><strong>Customer support interactions:</strong> Any communications, feedback, reviews, or complaints you submit.</li></ul><p>&nbsp;</p><p><strong>3. How we use your information</strong></p><p>We use your information for legitimate business purposes, including to:</p><ul><li>Process, confirm, and deliver your orders.</li><li>Verify your identity and prevent fraud.</li><li>Communicate with you about orders, services, offers, and updates.</li><li>Respond to your queries, complaints, or feedback.</li><li>Provide you with relevant product information, reminders, or health &amp; safety notices.</li><li>Improve our website, services, and customer experience.</li><li>Comply with legal obligations and cooperate with regulatory authorities when required.</li></ul><p>&nbsp;</p><p><strong>4. Cookies and similar technologies</strong></p><p>We use cookies and other tracking technologies to:</p><ul><li>Remember your login and shopping preferences.</li><li>Analyze website traffic and usage patterns.</li><li>Personalize your experience on our site.</li><li>Improve our marketing and advertising effectiveness.</li></ul><p>You may modify your browser settings to refuse cookies; however, this may limit some features of our website.</p><p>&nbsp;</p><p><strong>5. Sharing your information</strong></p><p>We only share your personal information when necessary and in accordance with the Electronic Commerce Act, 2081. We may share it:</p><ul><li>With authorized third-party service providers who help us operate our website, process payments, or deliver products.</li><li>With payment gateways and banks to complete your transactions securely.</li><li>With logistics partners and delivery agents for order fulfillment.</li><li>With government authorities or regulators if legally required to do so.</li><li>With our professional advisors, auditors, or insurers where necessary.</li><li>With other parties with your explicit consent.</li></ul><p>All third parties are required to maintain confidentiality and use your data solely for the agreed purpose.</p><p>&nbsp;</p><p><strong>6. How we protect your information</strong></p><p>We implement reasonable and appropriate technical, administrative, and physical safeguards to protect your information from unauthorized access, misuse, alteration, or loss. These measures include:</p><ul><li>Secure servers and encrypted connections.</li><li>Access controls and authentication for authorized staff.</li><li>Regular monitoring and updates to our security systems.</li><li>Staff training and strict confidentiality obligations.</li></ul><p>However, no method of transmission over the Internet or electronic storage is 100% secure. We do our best to protect your data but cannot guarantee absolute security.</p><p>&nbsp;</p><p><strong>7. How long we keep your information</strong></p><p>We retain your personal data only for as long as necessary to:</p><ul><li>Fulfill the purposes described in this policy.</li><li>Comply with legal, regulatory, or tax requirements.</li><li>Resolve disputes and enforce our agreements.</li></ul><p>When your information is no longer needed, we securely delete or anonymize it.</p><p>&nbsp;</p><p><strong>8. Your rights</strong></p><p>In line with the Consumer Protection Act and the Electronic Commerce Act, you have the right to:</p><ul><li>Access, review, or correct your personal information.</li><li>Request deletion of your personal data, unless we are legally required to retain it.</li><li>Withdraw your consent for optional processing.</li><li>Object to certain uses of your information, where applicable.</li><li>File a complaint if you believe your privacy rights have been violated.</li></ul><p>To exercise these rights, please contact us at the details below.</p><p>&nbsp;</p><p><strong>9. Confidentiality and privacy of medical information</strong></p><p>We understand the sensitive nature of any health-related data you share with us. Such information will be:</p><ul><li>Kept strictly confidential.</li><li>Used only for fulfilling your orders or providing relevant services.</li><li>Not disclosed to any unauthorized parties.</li><li>Shared only with involved healthcare professionals, authorized intermediaries, or government authorities when legally required.</li></ul><p>We will never sell or misuse your health information for marketing without your explicit consent.</p><p>&nbsp;</p><p><strong>10. Third-party links</strong></p><p>Our website may contain links to third-party websites. This privacy policy does not apply to external sites, and we are not responsible for their privacy practices. We encourage you to read their privacy policies before sharing any information.</p><p>&nbsp;</p><p><strong>11. Changes to this policy</strong></p><p>We may update this privacy policy from time to time to reflect changes in legal requirements or our practices. Any updates will be posted on this page with the updated effective date. Please review this policy periodically to stay informed.</p><p>&nbsp;</p><p><strong>12. Governing law</strong></p><p>This privacy policy is governed by the laws of Nepal, including the Electronic Commerce Act, 2081 and the Consumer Protection Act, 2075.</p><p>&nbsp;</p><p><strong>13. Contact us</strong></p><p>If you have any questions about this privacy policy or wish to exercise your rights, please contact:</p><p>📞 Customer support: [Insert phone number]<br>📧 Email: [Insert email address]<br>🏢 Registered office: [Insert full office address]</p><p>Garg Dental — committed to protecting your privacy and ensuring safe, compliant, and transparent use of your data.</p>', NULL, '2025-07-31 12:09:44'),
(2, 'return_refund_policy', '<h3><strong>Return &amp; Refund Policies</strong></h3><h3>&nbsp;</h3><p><i><strong>1. Purpose</strong></i></p><p><i>This Refund &amp; Return Policy sets forth the clear terms and conditions under which Garg Dental (“we”, “our”, “us”) accepts product returns and issues refunds for purchases made through our e-commerce platform. We fully comply with the Consumer Protection Act, 2075 (2018), the Electronic Commerce Act, 2081, and all applicable e-commerce guidelines of Nepal.</i></p><p>&nbsp;</p><p><strong>2. General Statement</strong></p><p>Due to the sensitive nature of dental equipment, medical appliances, and health-related products, we maintain strict standards for returns and refunds to ensure the safety, hygiene, and integrity of all items provided to our valued customers.</p><p>&nbsp;</p><p><strong>3. Eligibility for Returns &amp; Refunds</strong></p><p>You may request a return or refund if:</p><ul><li>The product is defective, damaged during transit, or materially different from what was described in your order.</li><li>You file a valid return request within seven (7) days of delivery.</li><li>You provide valid proof of purchase (e.g., invoice or official order confirmation).</li><li>The product is in the same condition as it was delivered, unused (unless proven defective), and in its original packaging with all seals and protective films intact.<br><br>&nbsp;</li></ul><p><strong>4. Defective Products</strong></p><p>If a product is proven to have a manufacturing defect:</p><ul><li>You are legally entitled under the Consumer Protection Act, 2075 to a repair, replacement, or full refund, depending on the nature of the defect.</li><li>Defects must be reported within seven (7) days of delivery, with clear photo or video evidence.</li><li>We reserve the right to inspect and verify any claimed defect before approving a return, replacement, or refund.</li><li>If the defect is confirmed to be a manufacturer’s fault, Garg Dental will cover all related shipping and replacement costs.</li><li>Defects caused by misuse, mishandling, installation errors, or failure to follow product instructions will not qualify for return or refund.<br><br>&nbsp;</li></ul><p><strong>5. Equipment Under Warranty</strong></p><p>For equipment under a valid warranty:</p><ul><li>If a defect arises during the warranty period, the product will be repaired at no extra cost, provided the warranty terms have not been violated.</li><li>A replacement will only be offered if the item is not repairable under valid warranty conditions.</li><li>Warranty claims must comply with the warranty terms provided at the time of purchase.<br><br>&nbsp;</li></ul><p><strong>6. Return Conditions</strong></p><p>To be eligible for a return or refund:</p><ul><li>Items must be returned in the same condition as they were delivered, without any signs of use (unless proven defective).</li><li>Protective films, seals, and sterilized covers must be intact.</li><li>Original packaging, manuals, accessories, warranty cards, and any complimentary items must be included.</li><li>The product must be free of scratches, dents, or other damage (except verified delivery damage).</li><li>All serial numbers, barcodes, and labels must remain unaltered.</li><li>The outer box must be undamaged, with no stains, tears, or markings.<br><br>&nbsp;</li></ul><p><strong>7. Non-Returnable Items</strong></p><p>Returns will not be accepted if:</p><ul><li>The product has been used, installed, or modified, except where a defect is proven.</li><li>Sterilized covers, seals, or protective films have been removed.</li><li>The product is a consumable or a sterilized item that has been opened.</li><li>The defect or damage is caused by misuse, mishandling, or installation errors.</li><li>The return request is made after the seven (7) day window.<br><br>&nbsp;</li></ul><p><strong>8. Return &amp; Refund Process</strong></p><p>→ Initiate a Request</p><p>→ Contact our customer support team within seven (7) days of delivery:</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\" +977-1-4536276, 4528239\">+977-1-4536276, 4528239</a></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong><a href=\"info@gargdental.com, support@gargdental.com\"><strong>info@gargdental.com, support@gargdental.com</strong></a></p><p>→ &nbsp;Provide Evidence</p><p>→ Submit clear photos and/or videos showing the defect or damage, along with proof of purchase.</p><p>→ Inspection:&nbsp;</p><p><i>Our quality assurance team will inspect the product and verify the claim within seven (7) working days.</i></p><p>→ Approval or Rejection:</p><p><i>You will receive written confirmation of our decision.</i></p><p>&nbsp;</p><p>→ Refund or Replacement</p><ul><li>If approved for a refund, it will be issued via your original payment method.</li><li>If approved for a replacement, the new product will be shipped at no extra cost if a defect is verified.<br><br>&nbsp;</li></ul><p>→ Return Shipping Costs</p><ul><li>For verified defects, Garg Dental covers all return and replacement shipping costs.</li><li>For non-defective returns (if permitted), the customer bears all return shipping costs.<br><br>&nbsp;</li></ul><p><strong>9. Legal Compliance</strong></p><p>This Refund &amp; Return Policy is governed by the Consumer Protection Act, 2075, the Electronic Commerce Act, 2081, and all other applicable laws and regulations of Nepal. Garg Dental is committed to fair, lawful, and transparent transactions.</p><p>&nbsp;</p><p><strong>10. Contact Us</strong></p><p>For any return, exchange, or refund request, please contact:</p><p><strong>Customer &nbsp;Support:</strong> <a href=\" +977-1-4536276, 4528239\">+977-1-4536276, 4528239</a></p><p><strong>Email:</strong> <a href=\"info@gargdental.com, support@gargdental.com\">info@gargdental.com, support@gargdental.com</a></p><p><strong>Registered Office: </strong>B.O.127 Gairidhara, Kathmandu, Nepal</p><p><strong>Maps: </strong><a href=\"https://maps.app.goo.gl/UgGR91pi98BHkryL8\"><strong>https://maps.app.goo.gl/UgGR91pi98BHkryL8</strong></a></p><p>&nbsp;</p><p>&nbsp;</p><blockquote><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<i><strong>Garg Dental — committed to safe, fair, and transparent service.</strong></i></p></blockquote><p>&nbsp;</p><p><strong>By purchasing through our platform, you acknowledge and agree to the terms of this Refund &amp; Return Policy.</strong></p>', NULL, '2025-07-31 12:07:56'),
(3, 'medical_certifications', '<h2><strong>Medical Certifications</strong></h2><p>At <strong>Garg Dental</strong>, we only deal in medical and dental equipment that meet recognized national and international certification standards. We work with manufacturers and importers who follow strict regulatory compliance, ensuring that the products we deliver are safe, reliable, and approved for clinical use.</p>', NULL, '2025-07-07 18:06:48'),
(4, 'business_registration', '<h2><strong>LEGAL INFORMATION</strong></h2><figure class=\"table\"><table><thead><tr><th><strong>Company Name</strong></th><th>Garg Dental Pvt. Ltd.</th></tr></thead><tbody><tr><td><strong>Registration Number</strong></td><td>12656/056/57</td></tr><tr><td><strong>PAN/VAT Number</strong></td><td>300217054</td></tr><tr><td><strong>Registered Office</strong></td><td>B.O.127 Gairidhara, Kathmandu, Nepal</td></tr><tr><td><strong>Date of Incorporation</strong></td><td>March 15 2010</td></tr></tbody></table></figure><p>&nbsp;</p>', NULL, '2025-07-31 12:06:47'),
(5, 'about_company', '<h2><strong>Company Information</strong></h2><p>&nbsp;</p><p><strong>Garg Dental Pvt. Ltd. (Nepal)</strong> is Nepal’s trusted partner in advanced dental solutions. Established in 2002 and headquartered in Kathmandu, we are an <strong>authorized importer and distributor</strong> of high-quality dental equipment, instruments, and consumables.</p><p>For over two decades, we have proudly supported dental professionals and institutions across Nepal — providing them with reliable products that enable exceptional patient care. Our diverse portfolio covers every major area of modern dentistry, ensuring that practitioners have access to the latest innovations and trusted global brands.</p><p>With a dedicated team of over 50 skilled professionals, Garg Dental is committed to setting the standard for dental supply and marketing services in Nepal. Our focus is on <strong>authenticity, quality, and service excellence</strong>, and we take pride in delivering products that meet rigorous international standards.</p><p>At Garg Dental, we believe in building lasting partnerships with our clients, suppliers, and stakeholders. By consistently bringing world-class dental solutions to Nepal’s healthcare sector, we help dental practices grow and thrive in a rapidly evolving industry.</p><p><br>&nbsp;</p>', NULL, '2025-07-30 14:24:49'),
