(11, 'terms_conditions', '<p><strong>Terms and Conditions</strong></p><p><i>These Terms and Conditions (\"Terms\") govern the use of the website, services, and transactions provided by <strong>Garg Dental Pvt. Ltd.</strong> (\"we\", \"our\", or \"us\") through our e-commerce platform and physical operations in Nepal. By accessing or using our website or purchasing from us, you agree to be bound by these Terms. If you do not agree, please refrain from using our services.</i></p><p>&nbsp;</p><h3>1. <strong>General Information</strong></h3><p>Garg Dental Pvt. Ltd. is a legally registered company in Nepal operating under the following details:</p><figure class=\"table\"><table><thead><tr><th><strong>Company Name</strong></th><th>Garg Dental Pvt. Ltd.</th></tr></thead><tbody><tr><td><strong>Registration Number</strong></td><td>12656/056/57</td></tr><tr><td><strong>PAN/VAT Number</strong></td><td>300217054</td></tr><tr><td><strong>Registered Office</strong></td><td>B.O.127 Gairidhara, Kathmandu, Nepal</td></tr><tr><td><strong>Date of Incorporation</strong></td><td>March 15 2010</td></tr></tbody></table></figure><p>&nbsp;</p><h3>2. <strong>Eligibility to Use the Site</strong></h3><p>By using this site, you represent and warrant that:</p><p>You are at least 18 years old or are accessing the website under the supervision of a legal guardian.</p><p>You have the legal capacity to enter into a binding agreement.</p><p>&nbsp;</p><h3>3. <strong>Product Information and Medical Use Disclaimer</strong></h3><p>All products listed on our website are intended for professional dental use by licensed practitioners or authorized institutions.</p><p>Information provided is for general educational and product awareness purposes and should not be used as a substitute for professional medical advice.</p><p>&nbsp;</p><h3>4. <strong>Ordering and Payment</strong></h3><p>Orders placed on our website are subject to availability, confirmation, and acceptance.</p><p>We reserve the right to cancel or refuse any order for any reason.</p><p>All payments must be made through authorized channels. We do not store full credit/debit card details.</p><p>&nbsp;</p><h3>5. <strong>Pricing and Taxation</strong></h3><p>All prices listed are inclusive of applicable VAT as per Nepalese law unless stated otherwise.</p><p>Garg Dental reserves the right to change pricing at any time without prior notice.</p><p>&nbsp;</p><h3>6. <strong>Shipping and Delivery</strong></h3><p>Products are delivered within the estimated delivery time as per the shipping policy.</p><p>Delivery timelines are indicative and may vary due to unforeseen circumstances.</p><p>Garg Dental is not liable for delays caused by courier agencies or force majeure.</p><p>&nbsp;</p><h3>7. <strong>Returns and Refunds</strong></h3><p>Returns and refunds are governed by our official <strong>Refund &amp; Return Policy</strong>, which includes but is not limited to:</p><p>Products must be returned within 7 days in unused condition, with all original packaging intact.</p><p>Refunds are issued only after inspection and approval.</p><p>Defective items verified by our team will be replaced or refunded at our cost.</p><p>Some products (e.g., opened consumables, sterilized goods) are non-returnable.</p><p>&nbsp;</p><h3>8. <strong>Warranty Terms</strong></h3><p>Products that come with a manufacturer’s warranty are eligible for repair or replacement as per warranty terms.</p><p>Warranty does not cover misuse, damage due to mishandling, or installation errors.</p><p>&nbsp;</p><h3>9. <strong>Intellectual Property</strong></h3><p>All content including images, text, trademarks, logos, product descriptions, and videos on this website are the intellectual property of Garg Dental or its licensors.</p><p>You may not reproduce, copy, distribute, or commercially exploit any content without prior written permission.</p><p>&nbsp;</p><h3>10. <strong>Privacy and Data Protection</strong></h3><p>Our <strong>Privacy Policy</strong> outlines how we collect, store, and protect your data, including:</p><p>Use of cookies and tracking tools.</p><p>Compliance with the Electronic Commerce Act, 2081 and Consumer Protection Act, 2075.</p><p>Confidential handling of personal and medical data.</p><p>&nbsp;</p><h3>11. <strong>Medical Certification &amp; Legal Compliance</strong></h3><p>All medical products meet the import, safety, and quality standards established by the Ministry of Health, Nepal.</p><p>Garg Dental operates in compliance with relevant healthcare, commerce, and e-commerce regulations.</p><p>&nbsp;</p><h3>12. <strong>Limitation of Liability</strong></h3><p>To the fullest extent permitted by law, Garg Dental shall not be liable for:</p><p>Any indirect, incidental, or consequential damages arising from use of our services or products.</p><p>Product misuse, installation errors, or failure to follow manufacturer instructions.</p><p>&nbsp;</p><h3>13. <strong>User Responsibilities</strong></h3><p>You agree to provide accurate and updated information.</p><p>You agree not to misuse the website for fraudulent, harmful, or unlawful activities.</p><p>You are solely responsible for maintaining the confidentiality of your account.</p><p>&nbsp;</p><h3>14. <strong>Termination and Suspension</strong></h3><p>Garg Dental may suspend or terminate your access to the site without notice if:</p><p>You breach these Terms.</p><p>Required by law enforcement or regulatory authority.</p><p>&nbsp;</p><h3>15. <strong>Governing Law and Jurisdiction</strong></h3><p>These Terms shall be governed by and construed in accordance with the laws of Nepal. Any disputes shall fall under the exclusive jurisdiction of the courts of Kathmandu.</p><p>&nbsp;</p><h3>16. <strong>Changes to Terms</strong></h3><p>We reserve the right to update or modify these Terms at any time. Changes will be posted on this page with a revised effective date. Continued use of our site constitutes acceptance of such changes.</p><p>&nbsp;</p><h3>17. <strong>Contact Information</strong></h3><p>For questions or concerns related to these Terms and Conditions, please contact: +977-1-4536276, 4528239<br>📧 Email: support@gargdental.com<br>🏢 Registered Office: B.O.127 Gairidhara, Kathmandu, Nepal</p><p>&nbsp;</p><p>&nbsp;</p>', NULL, '2025-07-22 13:24:48'),
(12, 'about_us', '<h4><strong>Garg Dental Pvt. Ltd. (Nepal)</strong> is Nepal’s trusted partner in advanced dental solutions. Established in 2002 and headquartered in Kathmandu, we are an&nbsp;<strong>authorized importer and distributor</strong> of high-quality dental equipment, instruments, and consumables.</h4><h4>&nbsp;</h4><h4>For over two decades, we have proudly supported dental professionals and institutions across Nepal — providing them with reliable products that enable exceptional patient care. Our diverse portfolio covers every major area of modern dentistry, ensuring that practitioners have access to the latest innovations and trusted global brands.</h4><h4>&nbsp;</h4><h4>With a dedicated team of over 50 skilled professionals, Garg Dental is committed to setting the standard for dental supply and marketing services in Nepal. Our focus is on&nbsp;<strong>authenticity, quality, and service excellence</strong>, and we take pride in delivering products that meet rigorous international standards.</h4><h4>&nbsp;</h4><h4>At Garg Dental, we believe in building lasting partnerships with our clients, suppliers, and stakeholders. By consistently bringing world-class dental solutions to Nepal’s healthcare sector, we help dental practices grow and thrive in a rapidly evolving industry.</h4><h4>&nbsp;</h4><h4>&nbsp;</h4><h4><strong>Partner with us to shape the future of dentistry in Nepal.</strong><br><i>Explore our products or connect with our team to learn how Garg Dental can support your practice.</i></h4><h4>&nbsp;</h4>', '2025-07-17 12:59:01', '2025-07-31 17:11:55'),
