(336, 'P00288', NULL, 'Chamundi Dental Unit', 'chamundi-dental-unit-P00288', '<p>It is designed for efficient and comfortable patient treatment. It features a microprocessor-based, electrically operated chair with a right-side rotatable arm for easy access. The chair is ergonomically designed with a contoured backrest and seat, and a comfortable headrest. It includes a ceramic spittoon with an auto-water connection and a high and low vacuum motorized suction system.&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Category</strong></th><th><strong>Specifications</strong></th></tr></thead><tbody><tr><td><strong>Design</strong></td><td>- Electrical Actuator for up/down movement, backrest &amp; seat rest - Ergonomically designed hand rest for operator’s convenience</td></tr><tr><td><strong>Modular Delivery System</strong></td><td>- Airotor points with tubing &amp; nut fitting - 3-way syringe - SS Instrument Tray - Supreme Micro motor 35,000 rpm with digital speed display - X-Ray viewer - Supreme Optic Scaler with five scaling tips</td></tr><tr><td><strong>Assistant Side Chair Controls</strong></td><td>- High &amp; Low vacuum suction cannulas with individual filters, removable tubing - Beecool LED Cordless light cure unit - 3-way Syringe</td></tr><tr><td><strong>Motor Specification</strong></td><td>- Supreme Micro motor 35,000 rpm with digital display of speed</td></tr><tr><td><strong>LED Operating Light</strong></td><td>- Maia LED (OEM, Faro, Italy) with multi-surface reflector (35,000 lux) - Mounted on base with sturdy arm - Monitor mounting arm</td></tr><tr><td><strong>Advanced Suction System</strong></td><td>- High and Low vacuum motorized non-stop CRS suction - Suction power of 350 Ltr/min - Auto drain &amp; Auto flush system</td></tr></tbody></table></figure>', NULL, NULL, 71, '3', 0.00, 675000.00, 675000.00, 0, 0, 42, NULL, 0, 0, NULL, NULL, '2025-07-24-68820a2c65945.png', 'chamundi_dental_chair_mount_unit.pdf', 1, '2025-07-23 15:49:46', '2025-07-24 16:10:48'),
(337, 'P00289', NULL, 'Meenakshi Dental Unit', 'meenakshi-dental-unit-P00289', '<p><strong>Meenakshi Dental Chair Mount Unit</strong></p><p><strong>Body Contoured Electrically operated dental chair equipped with state-of-art microprocessor based chair control system.</strong></p><ul><li>Soft key switches for chair operation.</li><li>Two customizable programmes, zeroposition and gargle position</li><li>Articulated Headrest with thickly cushioned rexine.</li><li>Swivelling arm rest for easy patient access.</li></ul><p><strong>LED (EDI, Faro,taly) Operating light having multi surface refilector with capacity of 30000lux.</strong></p><ul><li>On /0ff and intensity control by non-touch sensor with 3 directional movements.</li><li>Light itted on well balanced arm for operator\'s convenience.</li></ul><p><strong>Easily cleanable chair side round glass spittoon with auto water connection for spittoon and tumbler. Moveable towards chest of the patient</strong></p><p><strong>High and Low vacuum motorised non-stop CRS suction.</strong></p><ul><li>Suction power of 350 Ltr / min.</li><li>Auto drain &amp; Auto filush system.</li></ul><p><strong>Assistant side Chair controls.</strong></p><ul><li>High &amp; Low vacuum suction cannulas</li><li>3-way syringe</li></ul><p><strong>Modular delivery Hanging system</strong></p><ul><li>Airotor points with tubing &amp; nut fitting-2 Nos</li><li>Supreme Micro motor 35.000rpm with digital display of speed</li><li>Supreme Non-optic scaler with five scaling tips</li><li>3-Way syringe</li><li>Bee cool Turbo ll light cure</li><li>SS Instrument Tray</li><li>X-Ray viewer</li></ul><p><strong>Mutifunction Foot Control</strong></p><ul><li>Joystick function for chair movement</li><li>Switch for airotor and micromotor operation.</li></ul><p><strong>EURO Dental operator\'s stool moving on five castors mounted with base with five ams and a ring, chromium plated</strong></p><ul><li>Lever operated Pneumatic piston for up down movement</li><li>Euro moulded back rest with adjustable height</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Electrically Operable</strong></td><td>Fully motorized operation for smooth chair adjustments.</td></tr><tr><td><strong>Seamless Seat Upholstery</strong></td><td>Single-piece cushion for comfort, hygiene, and easy cleaning.</td></tr><tr><td><strong>Ceramic Spittoon and Tumbler</strong></td><td>Made of high-quality ceramic for durability and ease of maintenance.</td></tr><tr><td><strong>LED Light</strong></td><td>Energy-efficient LED light with strong illumination and low heat.</td></tr></tbody></table></figure>', '<ul><li>Dental chair with Dr Stool</li><li>Ceramic Spitton &amp; Tumbler</li><li>LED light</li><li>Instrument&nbsp;Tray</li><li>Foot control</li><li>Two Threeway Syringe</li><li>Provision for three Airotor &amp; a Micromotor</li><li>X-Ray Viewer</li><li>Saliva Ejector</li></ul>', '<ul><li>Manufacturer/Importer &nbsp;warranty &nbsp;of 1 year as applicable for this product</li><li><strong>Warranty is covered on spare parts only.</strong></li><li>Service and &nbsp;Warranty &nbsp;are handled by the manufacturer/importer directly for this product</li><li><strong>Dentalkart</strong> will <strong>not be liable to replace</strong> the Products and the<strong> liability to replace</strong> any such Product <strong>is that of the Manufacturer/Importer</strong></li><li>Dentalkart and the Buyer acknowledge that the<strong> Products purchased/used</strong> are a subject matter of original Manufacturer/Importer €™s &nbsp;warranties &nbsp;only</li><li>Any or all claims in relation to returns and replacement shall be made to the concerned Manufacturer/Importer only and<strong> Dentalkart may assist the customer</strong> in <strong>registering a request to get the Product replaced or serviced. &nbsp;</strong></li><li>The <strong>Buyer acknowledges that the Products once sold</strong> <strong>will not be exchanged</strong> or <strong>taken back</strong> unless <strong>the seal of the package or the Product is intact or not altered in any manner</strong> or<strong> is not tampered</strong> as the case may be.</li></ul>', 71, '3', 0.00, 575000.00, 575000.00, 0, 0, 42, NULL, 0, 0, NULL, NULL, '2025-07-23-6880bb88b9ec5.png', 'meenakshidentalchairmountunit_standard1.pdf', 1, '2025-07-23 16:23:00', '2025-07-24 11:24:39'),
(338, 'P00290', NULL, 'Mookambika Dental Unit', 'mookambika-dental-unit-P00290', '<p>Confident mookambika&nbsp;Dental chair is an electric operated chair used for patient handling in Dentistry.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Key Specification</strong></th><th><strong>Description</strong></th></tr></thead><tbody><tr><td><strong>Electrically Operable</strong></td><td>Chair operation is fully motorized for ease of use and precision positioning.</td></tr><tr><td><strong>Seamless Seat Upholstery</strong></td><td>One-piece, high-quality seat covering for enhanced comfort and easy cleaning.</td></tr><tr><td><strong>Ceramic Spittoon and Tumbler</strong></td><td>Durable ceramic material ensures hygiene and easy maintenance.</td></tr><tr><td><strong>LED Light</strong></td><td>High-efficiency LED operating light with adjustable intensity for optimal visibility.</td></tr></tbody></table></figure>', '<ul><li>Dental chair with Dr Stool</li><li>Ceramic Spitton &amp; Tumbler</li><li>Halogen light</li><li>Foot control</li><li>Provision for three Airotor &amp; a Micromotor</li><li>Saliva Ejector</li><li>Airotor points with tubing &amp; nut fitting – 2 Nos</li><li>Supreme Micro motor 35,000rpm with digital display of speed</li><li>Supreme Non optic scaler with five scaling tips</li><li>3-way syringe</li><li>SS Instrument Tray</li><li>X -Ray viewer</li><li>High &amp; Low vacuum suction cannulas</li><li>Beecool cord light cure unit</li><li>3-way syringe</li><li>Modular Delivery Hanging system</li><li>Side Chair Console</li></ul>', NULL, 71, '3', 0.00, 465000.00, 465000.00, 0, 0, 42, NULL, 0, 0, NULL, NULL, '2025-07-24-6881c41777a80.png', 'mookambikadentalchairmountunit1.pdf', 1, '2025-07-23 16:53:21', '2025-07-31 15:44:18'),
(339, 'P00291', NULL, '3DS V5', '3ds-v5-P00291', '<ul><li>Runyes 3DS V5 - Advanced Intraoral Scanner for Modern Dentistry.</li><li>Runyes 3DS V5 is an innovative intraoral scanner that sets new standards in digital dentistry.</li><li>Designed to provide exceptional precision, efficiency and comfort, it combines advanced 3D scanning technology with a lightweight, slim design and quiet operation.</li><li>It is the ideal tool for dentists who want to improve the quality of their services, optimize workflow and provide the highest level of patient experience.</li></ul>', '<figure class=\"table\"><table><tbody><tr><td>Scanner Dimensions</td><td>245 x 41 x 57 mm</td></tr><tr><td>Scanner Weight</td><td>160 g (without cable)&nbsp;</td></tr><tr><td>Scanning Accuracy</td><td>up to 10 microns</td></tr><tr><td>Depth of View</td><td>0-25mm</td></tr><tr><td>Frames per second</td><td>20</td></tr><tr><td>Field of View</td><td>16x14 mm</td></tr><tr><td>Imaging Method</td><td>Continuous 3D Video Capture</td></tr><tr><td>Light Source</td><td>LED</td></tr><tr><td>True Color</td><td>YES</td></tr><tr><td>Output Format</td><td>&nbsp;PLY, STL, OBJ</td></tr></tbody></table></figure>', NULL, NULL, 83, '3', 0.00, 550000.00, 550000.00, 0, 0, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-6881c1f4666ca.png', NULL, 1, '2025-07-24 11:02:40', '2025-07-31 16:24:05'),
(340, 'P00292', NULL, 'RUNYES INTRA ORAL SCANNER DESKTOP CART', 'runyes-intra-oral-scanner-desktop-cart-P00292', '<p>The Runyes Intraoral Scanner Desktop Cart provides a stable and mobile platform for the Runyes intraoral scanner and accompanying computer, enhancing convenience and organization during dental procedures. It typically includes a touchscreen monitor, a built-in computer, and ample space for the scanner and other accessories, often featuring a durable, easy-to-clean surface.&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Feature</strong></th><th><strong>Description</strong></th></tr></thead><tbody><tr><td><strong>Mobility</strong></td><td>The cart allows for easy movement of the scanner and associated equipment between operatories or within the same room.</td></tr><tr><td><strong>Organization</strong></td><td>It provides a dedicated space for the scanner, computer, and other necessary tools, promoting a tidy and efficient workspace.</td></tr><tr><td><strong>Ergonomics</strong></td><td>Designed with adjustable height and angles to optimize ergonomics for the dental professional during scanning.</td></tr><tr><td><strong>Integration</strong></td><td>Some carts are specifically designed to integrate with the Runyes scanner and its software, offering a seamless workflow.</td></tr><tr><td><strong>Durability</strong></td><td>Made from robust materials suitable for a dental environment, ensuring long-term use.</td></tr><tr><td><strong>Touchscreen Monitor</strong></td><td>Many carts come with a touchscreen monitor, allowing for intuitive control and interaction with the scanner\'s software.</td></tr><tr><td><strong>Built-in Computer</strong></td><td>Some carts include a built-in computer, minimizing the need for separate workstations and streamlining the setup.</td></tr></tbody></table></figure>', NULL, NULL, 83, '3', 0.00, 65000.00, 65000.00, 0, 0, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-6881cb386aff6.png', NULL, 1, '2025-07-24 11:42:12', '2025-07-31 16:24:06'),
(341, 'P00293', NULL, 'RUNYES INTRA ORAL SCANNER LAPTOP CART', 'runyes-intra-oral-scanner-laptop-cart-P00293', '<p>The Runyes Intraoral Scanner is a digital dentistry tool used to capture 3D images of a patient\'s teeth and gums. It\'s designed for ease of use with a lightweight, ergonomic handpiece and autoclavable scanner heads. The system also includes a laptop cart to hold the computer and other accessories, facilitating a mobile and organized scanning experience.&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Feature</strong></th><th><strong>Description</strong></th></tr></thead><tbody><tr><td><strong>Mobile Workstation</strong></td><td>The cart provides a dedicated space for the laptop, making the scanning process mobile and organized.</td></tr><tr><td><strong>Secure Storage</strong></td><td>It typically includes compartments or shelves to securely store the scanner, cables, and other accessories.</td></tr><tr><td><strong>Easy Maneuverability</strong></td><td>The cart is designed to be easily moved around the dental office, allowing for scanning in different locations.</td></tr></tbody></table></figure>', NULL, NULL, 83, '3', 0.00, 65000.00, 65000.00, 0, 0, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-6881cc28a7018.png', NULL, 1, '2025-07-24 11:46:12', '2025-08-10 13:03:11'),
(342, 'P00294', NULL, 'RUYNES INTRAORAL SCANNER ALL IN ONE CART', 'ruynes-intraoral-scanner-all-in-one-cart-P00294', '<p>The Runyes Intraoral Scanner All-in-One Cart is a mobile workstation designed for use with the Runyes 3D Intraoral Scanner. It typically includes the scanner, a high-performance computer (often with an Intel i7 processor, NVIDIA GeForce graphics card, and SSD storage), and a touchscreen monitor, all integrated into a single, rolling cart. This setup provides a convenient and organized way to utilize the intraoral scanner in a clinical setting.&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Component / Benefit</strong></th><th><strong>Description</strong></th></tr></thead><tbody><tr><td><strong>Runyes 3D Intraoral Scanner</strong></td><td>Core scanning device with powder-free operation, real-color scanning, multi-angle image capture, and autoclavable scanner head for infection control.</td></tr><tr><td><strong>High-Performance Computer</strong></td><td>Includes Intel i7 processor, NVIDIA GeForce graphics (e.g., 1660), and 1TB+ SSD, essential for real-time scan data processing.</td></tr><tr><td><strong>Touchscreen Monitor</strong></td><td>Integrated touchscreen allows intuitive interaction with scanning software and real-time scan data.</td></tr><tr><td><strong>Mobile Cart</strong></td><td>Ergonomically designed cart with easy maneuverability for convenient positioning within the operatory.</td></tr><tr><td><strong>Streamlined Workflow</strong></td><td>Integrated setup reduces need for separate devices and cables, simplifying the scanning process.</td></tr><tr><td><strong>Improved Organization</strong></td><td>Keeps all equipment in one place, reducing clutter and increasing operational efficiency.</td></tr><tr><td><strong>Enhanced Mobility</strong></td><td>Rolling cart allows the entire system to move easily between operatories or treatment rooms.</td></tr><tr><td><strong>Optimized Performance</strong></td><td>High-performance PC ensures fast and efficient scan data processing.</td></tr><tr><td><strong>Real-time Visualization</strong></td><td>Touchscreen monitor enables instant review and analysis of 3D scan data.</td></tr></tbody></table></figure>', NULL, NULL, 83, '3', 0.00, 850000.00, 850000.00, 0, 0, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-6881cd4209f9d.png', NULL, 1, '2025-07-24 11:50:54', '2025-07-31 16:24:06'),
(343, 'P00295', NULL, 'RUNYES AUTOCLAVE STEAM STERLIZER (MODEL: SEA-16L-N-LED)', 'runyes-autoclave-steam-sterlizer-model-sea-16l-n-led-P00295', '<p>The Runyes Autoclave Steam Sterilizer, model SEA-16L-N-LED, is a 16-liter, Class N, front-loading autoclave designed for sterilizing dental instruments. It features a microprocessor-controlled dry cycle, a double door safety locking system, and both 121°C and 134°C sterilization cycles. The device includes a digital display, two storage tanks, and sensors for water level and quality, enhancing its functionality and safety.&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Feature</strong></th><th><strong>Description</strong></th></tr></thead><tbody><tr><td><strong>Class N</strong></td><td>Suitable for sterilizing non-porous, unwrapped solid instruments.</td></tr><tr><td><strong>16-Liter Capacity</strong></td><td>Chamber volume for sterilizing items is 16 liters.</td></tr><tr><td><strong>Front Loading</strong></td><td>Autoclave is loaded from the front for convenience.</td></tr><tr><td><strong>Microprocessor Control</strong></td><td>Ensures precise, automated control of the sterilization process.</td></tr><tr><td><strong>Double Door Safety Lock</strong></td><td>Prevents door from opening until pressure is fully released for user safety.</td></tr><tr><td><strong>Dual Temperature Cycles</strong></td><td>Offers cycles at 121°C and 134°C to suit different sterilization requirements.</td></tr><tr><td><strong>Digital Display</strong></td><td>Shows date, time, and real-time sterilization data and curves.</td></tr><tr><td><strong>Water Level Sensors</strong></td><td>Alerts when to refill or drain clean/waste water tanks.</td></tr><tr><td><strong>Water Quality Sensor</strong></td><td>Monitors distilled water quality to help prevent equipment malfunction.</td></tr></tbody></table></figure>', NULL, NULL, 97, '3', 0.00, 95000.00, 95000.00, 1, 2, 88, NULL, 0, 1, NULL, NULL, '2025-07-24-6881de4393752.png', NULL, 1, '2025-07-24 13:03:27', '2025-08-10 13:12:22'),
(344, 'P00296', NULL, 'RUNYES AUTOCLAVE STEAM STERLIZER (MODEL: SEA-23L-B-LED)', 'runyes-autoclave-steam-sterlizer-model-sea-23l-b-led-P00296', '<p>The Runyes Feng 23L Class B Autoclave, crafted by Ningbo Runyes Medical Instrument Co. Ltd., is a testament to innovative design and uncompromised quality in medical sterilization equipment. This European Class B autoclave is designed for dental and medical settings, offering efficient, reliable, and safe sterilization of instruments. Its 23-liter capacity and advanced features position it as a top choice for clinics and hospitals.</p><p><strong>B+ Cycle Sterilization</strong>: Incorporates a Prion Cycle (B+ cycle) for thorough sterilization, ensuring the highest level of safety and cleanliness.</p><p><strong>Double Door Lock System</strong>: Features a robust double door locking mechanism, enhancing safety by preventing accidental openings or incorrect operations.</p><p><strong>Efficient Steam Generator Cleaning</strong>: Includes a cleaning program for the steam generator, improving the longevity and efficiency of the autoclave.</p><p><strong>Innovative Water System</strong>: Equipped with a water filter in the chamber to prevent blockage and a cooling condenser in the waste-water tank to protect the tank from heat deformation.</p><p><strong>USB Data Storage</strong>: Offers USB functionality to store and retrieve over 2000 sterilization cycles, enhancing record-keeping and compliance.</p><p><strong>Multiple Sterilization Options</strong>: Provides sterilization for a wide range of instruments, whether wrapped or unwrapped, solid, hollow, porous, or non-porous.</p><p><strong>Advanced Sensors and Interface:</strong> Features multiple sensors for precise monitoring of pressure and temperature, along with a user-friendly operation interface.</p>', '<figure class=\"table\"><table><tbody><tr><td>Automation Grade</td><td>Fully Automatic</td></tr><tr><td>Memory</td><td>8 GB</td></tr><tr><td>Chamber Volume</td><td>23 Litre</td></tr><tr><td>Type of Sterilizer</td><td>European B Type</td></tr><tr><td>No. of Trays</td><td>3 Tray</td></tr><tr><td>Brand</td><td>Runyes</td></tr><tr><td>Display</td><td>LED Display</td></tr><tr><td>Product Type</td><td>Steam Sterilizer</td></tr><tr><td>Size</td><td>250 mm x 450 mm</td></tr></tbody></table></figure>', NULL, NULL, 97, '3', 0.00, 200000.00, 200000.00, 3, 3, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-68825da690110.png', NULL, 1, '2025-07-24 22:06:58', '2025-07-24 22:06:58'),
(345, 'P00297', NULL, 'RUNYES AUTOCLAVE STEAM STERLIZER (MODEL: SEA-45L-D TOUCH SCREEN)', 'runyes-autoclave-steam-sterlizer-model-sea-45l-d-touch-screen-P00297', '<p>Bridging the gap between affordability, reliability and aesthetics, this award winning design will surely catch your eye. With a full touchscreen interface, you will have controls at the tip of your fingers. Autoclave with confidence, dignity and poise.</p><p>Australia TGA approved. Designed in accordance with Australian Standard AS/NZ 4815 and European Classifications.</p><p>European Class B with 3-time pre-vacuum preceding vacuum drying Intended for the sterilisation of unwrapped, wrapped, hollow and solid instruments.</p><p><strong>TOUCH SCREEN</strong></p><p>1. Touchable screen makes it easy for operation.</p><p>2.User-friendly operation interface with elegant design.</p><p><strong>SUITABLE FOR DIFFERENT TYPES INSTRUMENTS</strong></p><p>Surgical instruments, dental intruments, glass wares, injectionunits and other objects of compression resistance and hot steam resistance.</p><p><strong>BIG CAPACITY OPEN TANK</strong></p><p>1.Open tank, easy-to-clean.</p><p>2.Bult-in water quality sensor monitors water quality, reduces machine failure rate, and prolongs machine life time.</p><p><strong>TWO TYPES OF RECORD (DUAL RECORDING)</strong></p><p>1. USB Master controller stores 2,000 fresh cycles; the data can be downloaded via USB. You can check and print all the records with a computer.</p><p>2. Micro-Printer(Optional) Prints cycle data when the cycle ends.</p><p><strong>DOUBLE LOCK SYSTEM -MECHANICAL LOCK WITH AIR LOCK SYSTEM</strong></p><p>Double lock system makes the autoclave safer, and prevents potential safety hazards</p><p><strong>SIX LAYERS\' NEW STRUCTURE CHAMBER, CREATING NEW CHAMBER STRUCTURE</strong></p><p>1. The chamber adopts six layers\' structure, using the special shaping finish drawing technology, dusting and polishing. It has strong pressure-bearing properties, and pass 60000 times fatigue life testing, the outer layer adopts the fine micropore foaming technique.</p><p>2. As the tray rack can rolates to 90 degrees, 5 trays can be used for placing instruments.</p><p><strong>TWO CONDENSERS</strong></p><p>Faster cooling; prolongs life time.</p><p><strong>SAFETY VALVE</strong></p><p>Releases pressure overload, and restores idle chamber pressure when the chamber is over-pressured.</p><p><strong>AIR FILTER&nbsp;</strong></p><p>Filter airborne impurilties into the chamber to prevent contamination</p>', '<figure class=\"table\"><table><tbody><tr><td>Model</td><td>SEA-45L-D</td></tr><tr><td>Voltage</td><td>AC 110V/60Hzor 220V/50Hz±10%</td></tr><tr><td>Rated power</td><td>3300W</td></tr><tr><td>Rated current</td><td>10A</td></tr><tr><td>Volume (L)</td><td>23 L</td></tr><tr><td>Chamber size (MM)</td><td>Φ319×620</td></tr><tr><td>&nbsp;Sterilization temperature</td><td>121℃ / 134℃</td></tr><tr><td>Sterilizing pressure</td><td>1.1 bar / 2.1 bar</td></tr><tr><td>Packing size (CM)</td><td>53.5*65.0*50.5</td></tr><tr><td>N.W(KG)</td><td>92</td></tr></tbody></table></figure>', NULL, NULL, 97, '3', 0.00, 396000.00, 396000.00, 4, 4, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-68825f4580f9e.png', NULL, 1, '2025-07-24 22:13:53', '2025-07-24 22:13:53'),
(346, 'P00298', NULL, 'RUNYES LUBRICATION MACHINE (MODEL: LUB-120)', 'runyes-lubrication-machine-model-lub-120-P00298', '<p>The Runyes LUB-120 Handpiece Lubricating Unit is an essential device for dental practices, designed to automate the maintenance of dental handpieces. This unit ensures thorough cleaning and lubrication, which are crucial for the optimal functioning and longevity of dental instruments. With its straightforward operation, safety features, and cost-effectiveness, the LUB-120 is a valuable tool for maintaining dental handpieces, resulting in enhanced durability and performance.</p>', '<figure class=\"table\"><table><tbody><tr><td>Voltage</td><td>100V ~ 240V ~; 50/60</td></tr><tr><td>Automation Grade</td><td>Automatic</td></tr><tr><td>Type</td><td>Oil Lubrication System</td></tr><tr><td>I Deal In</td><td>New Only</td></tr><tr><td>Rated voltage</td><td>100V ~ 240V ~; 50/60</td></tr><tr><td>Handpieces</td><td>3 high speed handpiece (Coupling) &amp; 1 low speed handpiece (Motor</td></tr><tr><td>Working pressure</td><td>0.4 ~ 0.6MPa (4.0 ~ 6.0kgf/ cm2 ) (60 ~ 80pcs)</td></tr><tr><td>Oil drum capacity</td><td><br>300ml</td></tr><tr><td>Size (mm)</td><td>310 x 270 x 350</td></tr></tbody></table></figure>', NULL, NULL, 96, '3', 0.00, 65000.00, 65000.00, 4, 4, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-6882626875a21.png', NULL, 1, '2025-07-24 22:27:16', '2025-07-24 22:27:16'),
(347, 'P00299', NULL, 'RUNYES LUBRICATION MACHINE (MODEL: LUB-90)', 'runyes-lubrication-machine-model-lub-90-P00299', '<p>It is designed to clean and lubricate the handpiece2. 3 handpiece can be cleaned and lubricated at the same time3. The Care 3 Plus swing pinion can clean and lubricate the handpiece efficiently in different angles4. You can press the Air Button to clean the rest oil after cleaning and lubrication5. You can fill the oil in different mode, such as short, medium and long mode, according different kinds of handpiece6. The oil mist filter cotton can prevent the spread of oil mist to the minium degree.</p>', '<figure class=\"table\"><table><tbody><tr><td>Number of mobile phones Handpiece</td><td>3</td></tr><tr><td>Working MPa of the gas source</td><td>0.3-0.6</td></tr><tr><td>Power supply V/Hz</td><td>20/50</td></tr><tr><td>Gas consumption L/min</td><td>60</td></tr><tr><td>Weight Kg</td><td>7.2</td></tr><tr><td>External dimensions</td><td>282X300X370mm</td></tr><tr><td>Tank cavity capacity ml</td><td>350</td></tr></tbody></table></figure>', NULL, NULL, 96, '3', 0.00, 65000.00, 65000.00, 1, 1, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-6882642fcda6b.png', NULL, 1, '2025-07-24 22:34:51', '2025-08-10 13:41:49'),
(348, 'P00300', NULL, 'RUNYES SEAL 120 SEALING MACHINE WITH RACK', 'runyes-seal-120-sealing-machine-with-rack-P00300', '<p>The RUNYES SEAL 120 is a sealing machine, likely designed for medical or dental sterilization pouches. It features a durable construction, user-friendly operation, and versatile sealing capabilities for various bag types. The \"with rack\" aspect likely refers to a stand or holder for the machine, potentially for stability or organization during use.&nbsp;</p>', '<figure class=\"table\"><table><tbody><tr><td>Model</td><td>SEAL 120</td></tr><tr><td>Manufacturer</td><td>Runyes, China</td></tr><tr><td>Integrated tape cutter</td><td>is</td></tr><tr><td>Integrated packaging tape roll holder</td><td>is</td></tr><tr><td>Paper/polypropylene laminate orientation</td><td>Polypropylene film up</td></tr><tr><td>Seam width</td><td>12 mm</td></tr><tr><td>Maximum seam length</td><td>300 mm</td></tr><tr><td>Automatic activation of the melting process</td><td>is</td></tr><tr><td>Sound signal of the fusing process</td><td>is</td></tr><tr><td>Outside</td><td>Metal and plastic</td></tr><tr><td>Power supply voltage</td><td>220 - 230 V / 50 Hz</td></tr><tr><td>Power</td><td>500 W</td></tr><tr><td>Weight</td><td>4.8 kg</td></tr><tr><td>(width) x (depth) x (height)</td><td>430 x 380 x 185 mm</td></tr></tbody></table></figure>', '<ul><li>Selling Units- Single item</li><li>Single gross weight- 6.000 KG</li><li>Single package size- 53X25X25 cm</li></ul>', NULL, 96, '3', 0.00, 31500.00, 31500.00, 5, 5, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-688265dabe3ba.png', NULL, 1, '2025-07-24 22:41:58', '2025-07-24 22:41:58'),
(349, 'P00301', NULL, 'RUNYES SMALL STEAM STERLIZERS (MODEL: STE5L)', 'runyes-small-steam-sterlizers-model-ste5l-P00301', '<p>The <strong>Runyes Rapiclave 5L</strong> is a next-generation fast-cycle autoclave specially designed for implant sterilization and rapid turnaround in busy clinical environments. Its compact size, Class B performance, and 10-minute sterilization cycle make it ideal for single-chair setups, mobile practices, and surgical operatories. Equipped with advanced features like a 3-pulse vacuum, customizable LCD touch control, and intelligent programs, Rapiclave 5L ensures efficient, safe, and repeatable sterilization with minimal downtime.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Model</strong></td><td>STE 5L</td></tr><tr><td><strong>Chamber Volume</strong></td><td>5L</td></tr><tr><td><strong>Chamber Size</strong></td><td>192 × 96 × 300 mm</td></tr><tr><td><strong>Overall Dimensions</strong></td><td>500 × 310 × 320 mm</td></tr><tr><td><strong>Chamber Shape</strong></td><td>Square</td></tr><tr><td><strong>Sterilization Class</strong></td><td>Class B</td></tr><tr><td><strong>Power Supply</strong></td><td>AC220V/50Hz</td></tr><tr><td><strong>Input Power</strong></td><td>1800VA</td></tr><tr><td><strong>Water Tank Capacity</strong></td><td>1L</td></tr><tr><td><strong>Water Consumption/Cycle</strong></td><td>200 ml</td></tr><tr><td><strong>Minimum Water Supply</strong></td><td>250 ml</td></tr><tr><td><strong>Ambient Temperature Range</strong></td><td>5°C – 40°C</td></tr><tr><td><strong>Relative Humidity Limit</strong></td><td>≤ 85%</td></tr><tr><td><strong>Net Weight</strong></td><td>26 kg</td></tr><tr><td><strong>Gross Weight</strong></td><td>30 kg</td></tr><tr><td><strong>Initial Default Temp.</strong></td><td>140°C</td></tr><tr><td><strong>Max Vacuum Level</strong></td><td>≤ –0.92 kPa</td></tr><tr><td><strong>Sterilization Pressure</strong></td><td>–0.1/0.3 MPa</td></tr></tbody></table></figure>', NULL, NULL, 97, '3', 0.00, 275000.00, 275000.00, 3, 3, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-688268bcbcf83.png', NULL, 1, '2025-07-24 22:54:16', '2025-07-24 22:54:16');
