(350, 'P00302', NULL, 'RUNYES ULTRASONIC CLEANER (MODEL: CLEAN-02)', 'runyes-ultrasonic-cleaner-model-clean-02-P00302', '<p>Vibration cleaner is made by Runyes for cleaning the medical or dental or ophthalmic or other surgical instruments. Special for cleaning instruments with complicated shape,with lots of cracks, and glabrous and weak instruments and also can be used to clean small medical instrument, pinhead, false teeth and so on. 2. Friendly and clear operation plate with digital display makes it easy to operate. 3. Time control system is convenient for you to control the working time, which will improveefficiency clearly. 4. Rinse time can be set from 2 to 30 min,rinse temperature can also be set from 20℃ ~ 80℃ .Power is automatically cut off when is lack of water.</p>', '<figure class=\"table\"><table><tbody><tr><td>Basin Capacity:</td><td>6L</td></tr><tr><td>Maximum Length Allowed:</td><td>34.0 cm</td></tr><tr><td>Digital Timer:</td><td>6 phases timer</td></tr><tr><td>Temperature Setting:</td><td>3 groups temperature option</td></tr><tr><td>Ultrasonic Frequency:</td><td>35000 Hz</td></tr><tr><td>Power Supply:</td><td>300W (AC 220~240V, 50/60 Hz)</td></tr><tr><td>Basin Size:</td><td>32.3 x 20.5 x 9.9 cm</td></tr><tr><td>Product Size:</td><td>51.5 x 30.5 x 24.0 cm</td></tr><tr><td>Net Weight:</td><td>7.5 Kg</td></tr></tbody></table></figure>', NULL, NULL, 99, '2', 0.00, 48000.00, 48000.00, 1, 1, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-68826b0199391.png', NULL, 1, '2025-07-24 23:03:57', '2025-08-16 13:19:01'),
(351, 'P00303', NULL, 'RUNYES WATER DISTILLER', 'runyes-water-distiller-P00303', '<p>The Water Distiller is an essential device for dental and medical practices, designed to provide the purest form of water. Utilizing a single-cycle process, it transforms tap water into distilled water through demineralization and purification. With the ability to produce 1 liter of distilled water per hour, it is an efficient solution for practices requiring high-purity water.</p>', '<p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td>Capacity</td><td>Suitable&nbsp;</td></tr><tr><td>Certified</td><td>CE certified product</td></tr><tr><td>Design</td><td>Light weight &amp; compact design</td></tr><tr><td colspan=\"2\">Suitable for both medical &amp; home use</td></tr></tbody></table></figure>', NULL, NULL, 98, '3', 0.00, 18000.00, 18000.00, 3, 3, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-68826ccee417c.png', NULL, 1, '2025-07-24 23:11:38', '2025-08-16 13:19:01'),
(352, 'P00304', NULL, 'RUNYES COLOR SHADE DETECTOR', 'runyes-color-shade-detector-P00304', '<p>The Runyes Color Shade Detector is a dental instrument used to accurately determine the color of teeth. It utilizes a seven-point detection fiber optic head and multiple algorithms to capture color information and restore the true tooth color. The device aims to provide precise and reliable color matching for dental restorations.&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Feature</strong></th><th><strong>Description</strong></th></tr></thead><tbody><tr><td><strong>High Accuracy</strong></td><td>Seven-point detection design ensures comprehensive coverage of the tooth surface, capturing more color information and minimizing errors.</td></tr><tr><td><strong>Accurate Color Restoration</strong></td><td>Utilizes multiple algorithms to restore the true color of the tooth for precise shade matching.</td></tr><tr><td><strong>Standardized Lighting</strong></td><td>Unique LED standardized white light technology enables consistent color comparison under any lighting conditions.</td></tr><tr><td><strong>User-Friendly Interface</strong></td><td>Simple operation with a two-color panel display for easy-to-read results.</td></tr><tr><td><strong>Portability</strong></td><td>Lightweight and easy to handle, making it convenient to carry and use.</td></tr><tr><td><strong>Long Battery Life</strong></td><td>Equipped with a durable battery that supports extended use.</td></tr><tr><td><strong>Wireless Operation</strong></td><td>Some models (e.g., Runyes S3) offer wireless functionality for greater flexibility.</td></tr><tr><td><strong>How it Works</strong></td><td>Detects and compares tooth color using LED lighting and color detection algorithms for accurate shade identification.</td></tr></tbody></table></figure>', NULL, NULL, 296, '3', 0.00, 65000.00, 65000.00, 5, 5, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-68826dd5bd8d6.png', NULL, 1, '2025-07-24 23:16:01', '2025-08-05 10:15:49'),
(353, 'P00305', NULL, 'RUNYES DENTAL IOPA AC WALL MOUNTED X-RAY UNIT (MODEL: RAY 68(W))', 'runyes-dental-iopa-ac-wall-mounted-x-ray-unit-model-ray-68w-P00305', '<p>The Wall Mounted X-ray AC Ray-68 (W) 2.0-800mm sounds like a dental X-ray unit designed for efficient and safe imaging in a dental office setting. Here\'s a breakdown of the key features based on information found online:</p><ul><li><strong>Wall Mounted:</strong> This unit is designed to be mounted on a wall, saving valuable floor space in the dental office.</li><li><strong>AC Ray-68 (W):</strong> This likely refers to the specific model name or series of the X-ray unit from a particular manufacturer.</li><li><strong>2.0:</strong> This might indicate the focal spot size of the X-ray tube, which can affect image sharpness. A smaller focal spot size generally leads to sharper images.</li><li><strong>800mm:</strong> This most likely refers to the maximum arm length of the X-ray unit. This allows for flexibility in positioning the X-ray head for different types of dental X-rays.</li></ul><p>Here are some additional details you might find helpful:</p><ul><li><strong>Features:</strong><ul><li>Easy to use and maintain</li><li>Precise time control</li><li>Digital display</li><li>Safe operation with minimal radiation leakage</li><li>Ability to capture clear and detailed dental images</li></ul></li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Power Voltage</strong></td><td>AC 220V</td></tr><tr><td><strong>Frequency</strong></td><td>50/60Hz</td></tr><tr><td><strong>Maximum Power</strong></td><td>1100VA</td></tr><tr><td><strong>Current</strong></td><td>5A</td></tr><tr><td><strong>Fuse</strong></td><td>10A</td></tr><tr><td><strong>X-Tube</strong></td><td>Canon D-045</td></tr><tr><td><strong>Ray Focal Spot</strong></td><td>0.4mm</td></tr><tr><td><strong>Bulb Tube Voltage</strong></td><td>65KV ± 10%</td></tr><tr><td><strong>Anode Current</strong></td><td>7mA ± 20%</td></tr><tr><td><strong>Anode Angle</strong></td><td>12.5°</td></tr><tr><td><strong>Duty Cycle</strong></td><td>1/30</td></tr><tr><td><strong>Half Value Layer</strong></td><td>65Kv</td></tr><tr><td><strong>Inherent Filtration</strong></td><td>≥ 2.1mm Al</td></tr><tr><td><strong>Leakage Radiation</strong></td><td>1 meter ≤ 0.14 mGy/h</td></tr><tr><td><strong>Time of Exposure</strong></td><td>0.01 – 2.0s</td></tr></tbody></table></figure>', NULL, NULL, 109, '3', 0.00, 160000.00, 160000.00, 2, 2, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-6882701be8f9e.png', NULL, 1, '2025-07-24 23:25:43', '2025-07-25 10:02:32'),
(354, 'P00306', NULL, 'RUNYES DENTAL IOPA AC X-RAY UNIT (MODEL: RAY 68(M) - B STOOL)', 'runyes-dental-iopa-ac-x-ray-unit-model-ray-68m-b-stool-P00306', '<p>The RUNYES DENTAL IOPA AC X-RAY UNIT (Model: RAY 68(M) - B STOOL) is a dental X-ray machine that utilizes AC power and is designed for intraoral (IOPA) radiography. It features a focal spot size of 0.8mm and offers exposure times ranging from 0.06 to 2.0 seconds. The \"B STOOL\" likely refers to a stool or base for the unit, indicating it\'s a floor-mounted model.&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Type</strong></td><td>Intraoral X-ray</td></tr><tr><td><strong>Application</strong></td><td>Captures detailed images of individual teeth and surrounding bone structures</td></tr><tr><td><strong>Power Source</strong></td><td>AC Power (Alternating Current)</td></tr><tr><td><strong>Focal Spot Size</strong></td><td>0.8 mm – Ensures high-resolution imaging</td></tr><tr><td><strong>Exposure Time Range</strong></td><td>0.06 to 2.0 seconds – Adjustable based on diagnostic requirements</td></tr><tr><td><strong>Mounting Type</strong></td><td>\"B STOOL\" – Floor-mounted design with base support</td></tr><tr><td><strong>Tube Voltage</strong></td><td>Typically 60–70 kV (Please confirm exact value from model specs)</td></tr><tr><td><strong>Tube Current</strong></td><td>Typically around 7–10 mA (Depends on specific model)</td></tr><tr><td><strong>Control Panel</strong></td><td>User-friendly digital interface (varies by model)</td></tr><tr><td><strong>Arm Type</strong></td><td>Foldable/Extendable arm for flexible positioning</td></tr><tr><td><strong>Exposure Modes</strong></td><td>Pre-programmed settings for adult, child, bitewing, periapical, etc.</td></tr><tr><td><strong>Compatibility</strong></td><td>Works with both digital sensors and traditional film</td></tr></tbody></table></figure>', NULL, NULL, 109, '3', 0.00, 156000.00, 156000.00, 2, 2, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-6882729a83f16.png', NULL, 1, '2025-07-24 23:36:22', '2025-07-25 10:02:09'),
(355, 'P00307', NULL, 'RUNYES DENTAL IOPA PORTABLE DC X-RAY UNIT (MODEL: RAY 98 (P)', 'runyes-dental-iopa-portable-dc-x-ray-unit-model-ray-98-p-P00307', '<p>1.A true high frequency chair side x-ray machine, ensures less radiation for the patient &amp; operator with high resolution images.<br>2.The circuit components imported from South Korea adopt high frequency closed-loop control; lmaging will not be affected even if the battery power is low.<br>3.Adopt Canon micro focus tube with focus 0.4mm,anode angle of 125<br>4.Less exposure time only about 0.4S, which is 5-8 time shorter than ordinary portable x-ray, less radiation dose,and avoid hand shake causing the blurry image<br>5.Light in weight,only 1.7 kgs. Compact &amp; single handed operational device<br>6.Wide digital display for easy operation<br>7.150 shots in a complete charge<br>8.Produced by reliable company, quality assurance;</p>', '<figure class=\"table\"><table><tbody><tr><td>Tube Voltage:</td><td>70kV+10%</td></tr><tr><td>Tube Current:</td><td>2mA+20%</td></tr><tr><td>Input Voltage:</td><td>100V-240V</td></tr><tr><td>Frequency:</td><td>50Hz-60Hz</td></tr><tr><td>X-Tube:</td><td>Canon (Toshlba)</td></tr><tr><td>Anode Angle:</td><td>12.5</td></tr><tr><td>Focus:</td><td>0.4mm</td></tr><tr><td>Exposure Time Range:</td><td>0.04s -2.0s</td></tr><tr><td>Leak Emissivity:</td><td>1 meter 0.25mGy/h</td></tr><tr><td>Machine Weight:</td><td>1.7kg</td></tr><tr><td>Relative Humidity:</td><td>30%RH-75%RH</td></tr></tbody></table></figure>', NULL, NULL, 110, '3', 0.00, 135000.00, 135000.00, 1, 1, 88, NULL, 0, 0, NULL, NULL, '2025-07-24-688275997d827.png', NULL, 1, '2025-07-24 23:49:09', '2025-07-25 10:02:49'),
(356, 'P00308', NULL, 'Woodpecker i-Scan', 'woodpecker-i-scan-P00308', '<p><strong>Woodpecker&nbsp;i-Scan</strong> system offers a comprehensive set of features and capabilities that are crucial for efficient and accurate dental imaging and diagnosis. Key aspects of the system include its powerful processing capability, high-resolution touchscreen, advanced algorithms, compact design, and flexible imaging plates. These features collectively contribute to the system\'s reliability, versatility, and convenience. The system\'s powerful processing capability, with its 8-core CPU, FPGA coprocessor, and advanced process technology, ensures smooth and efficient image processing. This capability is essential for dentists to obtain clear and detailed diagnostic images, enabling them to make accurate assessments and diagnoses. The high-resolution touchscreen of the i-Scan system allows for easy and precise interaction, enhancing the user experience and facilitating efficient image viewing and analysis. With its intuitive interface, dentists can navigate through the system\'s functions and perform tasks with ease.</p><p>The system\'s advanced algorithms, including the one-click ultra-clear algorithm and multi-level structure image algorithm framework, are designed to enhance image quality and provide intelligent optimization. These algorithms ensure that fine details are preserved, image clarity is improved, and diagnostic information is maximized. The compact and flexible design of the i-Scan system makes it highly suitable for dental clinics, as it requires minimal space and can be conveniently placed beside the dental chair. This proximity allows for immediate access to imaging capabilities, optimizing workflow and patient care.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Power Adapter Input</strong></td><td>100–240V, 50/60Hz</td></tr><tr><td><strong>Power Adapter Output</strong></td><td>DC 15V, 3.2A</td></tr><tr><td><strong>IP Imaging Plate Models</strong></td><td>Sizes 0, 1, 2, 3</td></tr><tr><td><strong>Threshold Contrast</strong></td><td>4 holes: 1.0 mm, 1.5 mm, 2.0 mm, 2.5 mm can all be distinguished</td></tr><tr><td><strong>Image Uniformity</strong></td><td>&lt; 2%</td></tr><tr><td><strong>Device Weight</strong></td><td>4.5 kg</td></tr><tr><td><strong>Plate Thickness</strong></td><td>0.4 mm (Very thin sheets)</td></tr><tr><td><strong>Plate Formats (Sizes)</strong></td><td>21 x 32 mm, 23 x 39 mm, 30 x 40 mm, 26 x 53 mm</td></tr><tr><td><strong>Image Resolution</strong></td><td>1280 x 800</td></tr><tr><td><strong>Touch Screen Monitor</strong></td><td>800 x 1280 px</td></tr></tbody></table></figure>', NULL, NULL, 112, '3', 0.00, 350000.00, 350000.00, 3, 3, 105, NULL, 0, 0, NULL, NULL, '2025-07-27-6885d866b6cb2.png', NULL, 1, '2025-07-25 11:12:05', '2025-07-27 13:27:30'),
(357, 'P00309', NULL, 'Woodpecker LX16 Plus Dental Diode Laser', 'woodpecker-lx16-plus-dental-diode-laser-P00309', '<p><strong>Woodpecker LX16 Plus Diode Laser | VSDent</strong></p><p>A&nbsp;new generation of lasers with three wavelengths (blue, red, and infrared). It is the ideal instrument for all the therapies adopted in dentistry. The touch screen, high-performance lithium battery, and autoclavable quick-attaching fibre tips make it a simple, reliable, and sterile product.</p><p><strong>Applications:</strong></p><ul><li>Dental soft tissue surgery</li><li>Endodontic sterilisation</li><li>Periodontal sterilisation</li><li>Peri-implantitis</li><li>Low-intensity laser therapy</li><li>Oral ulcers and teeth whitening</li></ul><p><strong>Features:</strong></p><ul><li>Sophisticated technology that mitigates bleeding during the operation and maximally minimises the postoperative swelling reduces the patient\'s pain, thereby accelerating the recovery</li><li>5200 mAh battery that lasts for a week on a single charge</li><li>Ergonomically designed handpiece with an on/off button and removable handpiece cover that is autoclavable</li><li>Autoclavable fibre tips with quick connection</li><li>With an intuitive touchscreen, selecting the desired treatment is easier than ever before, and the included mini-guide assists the user in executing the treatment</li><li>UK power plug</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Technical Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Power Adapter Input</strong></td><td>100–240 Vac, 50/60 Hz, 2.5 A</td></tr><tr><td><strong>Emission Mode</strong></td><td>CW (Continuous Wave), Chopped 1 Hz to 20 kHz</td></tr><tr><td><strong>Aiming Beam</strong></td><td>650 ± 20 nm / Pmax &lt; 5 mW</td></tr><tr><td><strong>Rechargeable Battery</strong></td><td>11.1V / 2600mAh × 2 (57.7Wh)</td></tr><tr><td><strong>Charging Time</strong></td><td>Approx. 4 hours (5 hours for initial charge)</td></tr></tbody></table></figure>', '<ul><li>6 x Fibre optical kit (3 tips each)</li><li>1 x Desensitisation tip</li><li>1 x Whitening tip</li><li>3 x Biostimulation tip</li><li>1 x Handpiece with 2 autoclavable covers&nbsp;</li><li>1 x Foot pedal</li><li>3 x Goggles laser protection</li></ul>', '<ul><li>24-month warranty&nbsp;</li></ul>', 86, '3', 0.00, 596000.00, 596000.00, 4, 4, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-68831d357c5ba.png', NULL, 1, '2025-07-25 11:44:17', '2025-07-25 11:44:17'),
(358, 'P00310', NULL, 'Woodpecker LX16 Dental Diode Laser', 'woodpecker-lx16-dental-diode-laser-P00310', '<p>The <strong>Woodpecker LX16 Dental Diode Laser</strong> is a state-of-the-art instrument designed to elevate dental procedures with cutting-edge technology. it offers a host of advantages that enhance both patient experience and clinical efficiency.</p><p>This advanced diode laser stands out for its ability to perform procedures with minimal invasiveness, leading to virtually no bleeding, reduced swelling, and less post-operative pain. This feature accelerates recovery, ensuring patients experience a higher level of comfort.</p><p>The device boasts a user-friendly interface, featuring a 5-inch full-view capacitive touch panel with an intuitive flat UI design. This streamlined interface simplifies navigation, making it easy for dental professionals to integrate into their practice seamlessly.</p><p>The LX16 delivers impressive performance with a 16 Watts laser output at a wavelength of 976nm, enabling precision and accuracy in various procedures. Additionally, it offers an additional 200mw laser output at 650nm, expanding its utility to cover over 20 different laser applications.</p><p>Hygiene and durability are prioritized with autoclavable fiber optical tips and a stainless-steel handpiece cover. The inclusion of a large-capacity lithium battery ensures uninterrupted use, providing convenience and reliability.</p><p>Furthermore, the LX16 comes equipped with a range of specialized handpieces, including the Bio Simulation Handpiece, TMJ Therapy Handpiece, Teeth Whitening Handpiece, and Laser Protective Glasses. This comprehensive set of accessories further extends the versatility of the device, allowing dental professionals to address a wide array of clinical needs.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Laser Type</strong></td><td>Dental Diode Laser</td></tr><tr><td><strong>Laser Power Output</strong></td><td>16 Watts (976 nm)</td></tr><tr><td><strong>Additional Laser Output</strong></td><td>200 mW (650 nm)</td></tr><tr><td><strong>Touch Panel</strong></td><td>5-inch Full View Capacitive Touch Panel</td></tr><tr><td><strong>Handpiece Cover Material</strong></td><td>Stainless Steel</td></tr><tr><td><strong>Battery Capacity</strong></td><td>Large Capacity Lithium Battery</td></tr><tr><td><strong>Applications Covered</strong></td><td>20+ Laser Applications</td></tr></tbody></table></figure>', '<ul><li>1 x Main Unit<br>Fiber optical tips<br>TMJ Therapy Tips<br>Whitening Tip<br>Biostimulation Tips<br>Laser Protective Glasses</li></ul>', NULL, 86, '3', 0.00, 500000.00, 500000.00, 1, 1, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-688320fc54100.png', NULL, 1, '2025-07-25 12:00:24', '2025-07-25 12:00:24'),
(359, 'P00311', NULL, 'Woodpecker Ai-Pex Apex Locator with Pulp Tester', 'woodpecker-ai-pex-apex-locator-with-pulp-tester-P00311', '<p><strong>Woodpecker Ai-Pex Apex Locator with Pulp Tester&nbsp;</strong>with LCD touch screen is a diagnostic endodontic equipment used for precise determination of working length of various types of root canals during root canal treatment. This device provide added benefit of determination of pulp vitality with inbuilt pulp tester.</p><p>This device is suitable for various complex root canals and is unaffected by blood and residual pulp. Whether the root canal is dry or wet, it can automatically and precisely determine the position of the apical foramen.</p><p>It is clinically recommended to make measurements to the 0.0 position and then manually subtract 0.5∼1 mm to obtain the final working length. When the length indicator bar reaches a digital number below 1.5, the machine intermittently emits low-frequency beeps. The closer the tip is to the apical foramen, the quicker the sound is. When the tip reaches the aipc stop,the machine emits a continuous-frequency beep.The sound level can be deducted as you wish.</p><p><strong>Ai-Pex </strong>can be connected to an Endo Motor (which support Apex Locator) to allows real-time observation of the position of the file in the root canal during operation and activates many automatic function.&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Working Time</strong></td><td>5 hr 20 min</td></tr><tr><td><strong>Charging Time</strong></td><td>3 hours</td></tr><tr><td><strong>Battery</strong></td><td>3.7V / 2000mAh</td></tr><tr><td><strong>Input</strong></td><td>~100V–240V, 50Hz/60Hz, 0.4A</td></tr><tr><td><strong>Power Consumption</strong></td><td>0.5W</td></tr><tr><td><strong>Screen</strong></td><td>3.8-Inch LCD Screen</td></tr><tr><td><strong>Operating Temperature</strong></td><td>-5°C to +40°C</td></tr><tr><td><strong>Relative Humidity</strong></td><td>30% – 75%</td></tr><tr><td><strong>Atmospheric Pressure</strong></td><td>70 kPa – 106 kPa</td></tr></tbody></table></figure>', '<ul><li>1 x Ai-Pex Main Unit</li><li>1 x Measuring Wire</li><li>4 x File Clips</li><li>5 x Hooks</li><li>2 x Touch Probes</li><li>2 x Pulp Tester Probes</li><li>1 x Adapter</li><li>1 x Tester</li><li>1 x Power Lead</li></ul>', '<ul><li>Manufacturer/Importer&nbsp;warranty of 1 Year&nbsp;as applicable for this product.</li><li>Service and&nbsp;Warranty&nbsp;are handled by the manufacturer/importer directly for this product</li><li><strong>Dentalkart</strong>&nbsp;will&nbsp;<strong>not be liable to replace</strong>&nbsp;the Products and the<strong>&nbsp;liability to replace</strong>&nbsp;any such Product&nbsp;<strong>is that of the Manufacturer/Importer</strong></li><li>Dentalkart and the Buyer acknowledge that the<strong> Products purchased/used</strong>&nbsp;a subject matter of original Manufacturer/Importer’s&nbsp;warranties&nbsp;only</li><li>Any or all claims concerning returns and replacement shall be made to the concerned Manufacturer/Importer only. Dentalkart<strong>&nbsp;may assist the customer</strong>&nbsp;in&nbsp;<strong>registering a request to get the Product replaced or serviced.</strong></li><li>The&nbsp;<strong>Buyer acknowledges that the Products once sold</strong>&nbsp;<strong>will not be exchanged</strong>&nbsp;or&nbsp;<strong>taken back</strong>&nbsp;unless&nbsp;<strong>the seal of the package or the Product is intact or not altered in any manner</strong>&nbsp;or<strong>&nbsp;is not tampered</strong> with as the case may be.</li></ul>', 76, '3', 0.00, 58000.00, 58000.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-688323fa3c157.png', NULL, 1, '2025-07-25 12:13:10', '2025-07-25 12:13:10'),
(360, 'P00312', NULL, 'Woodpecker Minipex Apex locator', 'woodpecker-minipex-apex-locator-P00312', '<p><strong>Minipex Apex locator </strong>is designed to be small and lightweight for easy handling, but it packs a powerful performance. It features a 100% automatic digital calibration, ensuring that the measurement accuracy remains consistent without any decrease. Despite its compact size, the Apex Locator maintains stability and reliability during clinical use. It has been tested with clinical data fitting, demonstrating a high measurement accuracy of up to 97.71%. The updated chip in the Apex Locator enables real-time response and improved sensitivity, providing precise measurements during endodontic procedures. An innovative algorithm is employed to ensure intelligent anti-interference, minimizing the impact of external factors on measurement accuracy. The device is equipped with a 2.4\" LCD screen that offers a clear interface, allowing users to quickly and easily view the measurement results. The display uses various colors and segment indicators to show the trace of the touch probe in the root canal, aiding in visualization. The Apex Locator\'s screen is designed with soft colors and light distribution to avoid glare and provide a comfortable viewing experience for the dentist or endodontist.</p><p><strong>Please Note:</strong> Accuracy in readings for apex locators is claimed to be 97.7% accurate. Readings may vary from the conventional method of working length determination (radiographic method) &amp; may fluctuate in cases where the precautions (recommended in the user manual) are not followed</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Weight</strong></td><td>71g</td></tr><tr><td><strong>Dimensions</strong></td><td>70mm × 62mm × 20mm</td></tr><tr><td><strong>Battery</strong></td><td>3.7V / mAh (capacity not specified)</td></tr><tr><td><strong>Power Consumption</strong></td><td>≤ 0.5W</td></tr><tr><td><strong>Adapter Input</strong></td><td>~100V–240V, 50Hz/60Hz</td></tr><tr><td><strong>Screen</strong></td><td>Segment Digital Tube</td></tr><tr><td><strong>Operating Temperature</strong></td><td>+5°C to +40°C</td></tr><tr><td><strong>Relative Humidity</strong></td><td>30% – 75%</td></tr><tr><td><strong>Atmospheric Pressure</strong></td><td>70 kPa – 106 kPa</td></tr></tbody></table></figure>', '<ul><li>1 Unit Minipex Apex Locator</li><li>2 x File clips</li><li>1 x Lip hooks</li><li>2 x Touch probe</li><li>1 x Adapter</li><li>1 x Stand Holder</li><li>Instruction Manual</li></ul>', '<ul><li>anufacturer/Importer warranty of 1 year as applicable for this product, 5 year warranty on PCB (Power Circuit Board)</li><li>Service and&nbsp;Warranty&nbsp;are handled by the manufacturer/importer directly for this product<strong> (Currently&nbsp;OnSpot Services only available in Delhi/NCR )</strong></li><li><strong>Dentalkart</strong> will <strong>not be liable to replace</strong> the Products and the<strong> liability to replace</strong> any such Product <strong>is that of the Manufacturer/Importer</strong></li><li>Dentalkart and the Buyer acknowledge that the<strong> Products purchased/used</strong> are a subject matter of original Manufacturer/Importer’s&nbsp;warranties&nbsp;only</li><li>Any or all claims in relation to returns and replacement shall be made to the concerned Manufacturer/Importer only and<strong> Dentalkart may assist the customer</strong> in <strong>registering a request to get the Product replaced or serviced.&nbsp;</strong></li><li>The <strong>Buyer acknowledges that the Products once sold</strong> <strong>will not be exchanged</strong> or <strong>taken back</strong> unless <strong>the seal of the package or the Product is intact or not altered in any manner</strong> or<strong> is not tampered</strong> as the case may be.</li></ul>', 76, '3', 0.00, 22000.00, 22000.00, 3, 3, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-68832682f23e3.png', NULL, 1, '2025-07-25 12:23:59', '2025-07-25 12:23:59'),
(361, 'P00313', NULL, 'Woodpecker Apex Locator Woodpex III', 'woodpecker-apex-locator-woodpex-iii-P00313', '<p>The <strong>Apex Locator Woodpex III L</strong> is an endodontic treatment by accurately measures the length of the apical teeth. The device offers several features and specifications that contribute to its effectiveness and ease of use The<strong> Apex Locator Woodpex III L </strong>is is equipped with a clear and bright LCD screen, providing a clear image and displaying the trajectory of the file in different colors, ensuring easy visualization. It utilizes advanced multiple-frequency network impedance measurement technology, along with automatic calibration, to ensure precise and accurate measurements.<br>One of the notable features of the <strong>Apex Locator Woodpex III L</strong>&nbsp;is the ability to autoclave its accessories, such as the measuring wire, file clip, and lip hook, under high temperature and pressure. This feature effectively prevents cross-infection and enhances the device\'s hygiene.<br><br>The device operates on a rechargeable battery, eliminating the need for frequent battery replacements. This ensures convenience and uninterrupted use during dental procedures. The main unit of the<strong> Apex Locator Woodpex III L</strong>&nbsp;features various indicators, including power and sound indicators, a length measurement indicator, and a power on/off button. The main accessories include the measuring wire, file clip, lip hook, measuring file, battery tester, and emulsion of enlarging apex.</p><p>The intended use of the Woodpex III includes the measurement of various dental conditions such as pulpitis, pulp necrosis, periapical periodontitis, tooth length before restoration of post crown, as well as tooth length of transplantation and retransplantation.</p><p><strong>Please Note:&nbsp;Accuracy in readings for apex locators is claimed to be 97.7% accurate. Readings may vary from the conventional method&nbsp;of&nbsp;working length determination&nbsp;(radiographic method)&nbsp;&amp; may&nbsp;fluctuate in cases where the precautions (recommended in user manual) are not followed</strong></p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Battery</strong></td><td>3.7V / 750mAh</td></tr><tr><td><strong>Adapter</strong></td><td>100V – 240V, 50Hz/60Hz</td></tr><tr><td><strong>Power Consumption</strong></td><td>50.5W</td></tr><tr><td><strong>Screen</strong></td><td>4.5\" LCD</td></tr><tr><td><strong>Buzzer Alert</strong></td><td>Alerts when the endo file is less than 2mm from the apex</td></tr><tr><td><strong>Operating Temperature</strong></td><td>+5°C to +40°C</td></tr><tr><td><strong>Relative Humidity</strong></td><td>Up to 80% (noted as 580% — corrected)</td></tr><tr><td><strong>Atmospheric Pressure</strong></td><td>50 kPa – 106 kPa</td></tr><tr><td><strong>Main Unit Net Weight</strong></td><td>336g</td></tr><tr><td><strong>Main Unit Gross Weight</strong></td><td>360g</td></tr><tr><td><strong>Dimensions</strong></td><td>195mm × 137mm × 123mm</td></tr></tbody></table></figure>', '<ul><li>1 X Main Unit</li><li>1 X Measuring Wire</li><li>2 X File Clip</li><li>2 X Lip Hook</li><li>2 X Measuring File</li><li>1 X Adapter</li><li>1 X Tester</li><li>1 X Battery</li><li>1 X Instruction Manual</li><li>1 X Qualified Certificate</li><li>1 X Warranty Card</li><li>1 X Packing List</li></ul>', NULL, 76, '3', 0.00, 28000.00, 28000.00, 3, 3, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-688334a0a1769.png', NULL, 1, '2025-07-25 13:24:12', '2025-07-25 13:29:18'),
(362, 'P00314', NULL, 'Woodpecker Woodpex X Apex Locator', 'woodpecker-woodpex-x-apex-locator-P00314', '<p>The Woodpecker Woodpex X Apex Locator is a state-of-the-art dental device designed to accurately determine the working length of root canals during endodontic procedures. Manufactured by Woodpecker in China, this device offers enhanced precision and user-friendly features, making it an essential tool for dental professionals.</p><p>KEY FEATURES:<br>High Measurement Accuracy: The Woodpex X provides a measurement accuracy of 0.1 millimeters with an error margin of less than 2%, ensuring reliable results in various clinical conditions, including dry, wet, bloody, or infected canals.<br>Advanced Multi-Frequency Measurement Technology: Utilizes innovative multi-frequency measurement algorithms to deliver precise readings, even in challenging environments.<br>Automatic Calibration: Features an auto-calibration system that ensures consistent accuracy without manual adjustments.<br>Clear LCD Display: Equipped with a 3.8-inch color LCD screen that provides clear and detailed visualizations of the root canal\'s apical area, enhancing the practitioner\'s ability to monitor procedures effectively.<br>Sound Recognition System: Incorporates an audible alert system with adjustable volume, offering two sound modes to notify users as the file approaches the apex, thereby improving procedural safety.<br>Ergonomic and Lightweight Design: Designed for comfort and ease of use, the compact form factor (123 x 67 x 74 mm) and lightweight build (approximately 240 grams) make it convenient for extended use.<br>Long Battery Life: Powered by a rechargeable 3.7V/2000mAh lithium battery, the device supports up to 7 hours of continuous operation after a full 3-hour charge, ensuring it meets the demands of busy dental practices.<br>Comprehensive Accessories: The Woodpex X comes with essential accessories, including a measuring cable, two apex locator probes, two pulp tester probes, four file clips, and five lip clips, facilitating a wide range of endodontic procedures.<br>Certifications: The Woodpex X Apex Locator holds several international certifications, including CE (Europe), ISO, and FDA (USA), attesting to its compliance with global quality and safety standards.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Brand</strong></td><td>Woodpecker</td></tr><tr><td><strong>Model</strong></td><td>Woodpex X</td></tr><tr><td><strong>Country of Manufacture</strong></td><td>China</td></tr><tr><td><strong>Display</strong></td><td>3.8-inch Color LCD</td></tr><tr><td><strong>Measurement Accuracy</strong></td><td>0.1 mm</td></tr><tr><td><strong>Error Margin</strong></td><td>Less than 2%</td></tr><tr><td><strong>Battery</strong></td><td>3.7V / 2000mAh Rechargeable Lithium Battery</td></tr><tr><td><strong>Dimensions</strong></td><td>123 × 67 × 74 mm</td></tr><tr><td><strong>Weight</strong></td><td>Approximately 240 grams</td></tr><tr><td><strong>Warranty</strong></td><td>12 Months</td></tr><tr><td><strong>After-Sales Service</strong></td><td>10 Years</td></tr></tbody></table></figure>', '<ul><li>1 x Woodpex X Apex Locator</li><li>1 x Measuring Cable</li><li>2 x Apex Locator Probes</li><li>4 x File Clips</li><li>5 x Lip Clips</li><li>1 x Rechargeable Battery (3.7V)</li><li>1 x User Manual<br>&nbsp;</li></ul>', NULL, 76, '3', 0.00, 42000.00, 42000.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-688338639e6ec.png', NULL, 1, '2025-07-25 13:40:15', '2025-07-25 13:40:15'),
(363, 'P00315', NULL, 'Woodpecker ILED Plus Curing Light (1 Sec Curing Time)', 'woodpecker-iled-plus-curing-light-1-sec-curing-time-P00315', '<p><strong>ILED Plus Curing Light (1 Sec Curing Time)</strong> Wide Spectrum Curing Light has undergone significant upgrades to enhance its performance in dental applications. It offers two modes, with a maximum light intensity of 2300mw/cm2, allowing for the rapid curing of 2 mm resin in just 1 second. This makes it particularly well-suited for orthodontic brackets, porcelain veneers, and post-core adhesives.</p><p>One of the key improvements is the extended wide spectrum emission wavelength range, spanning from 385nm to 515nm. The additional wave band of 385nm to 420nm is especially beneficial for curing resin materials containing new-style photoinitiators like TPO. This includes popular restoration materials such as Tetric N-Ceram Bulk Fill, Amelogen Plus, and ENA Hri.</p><p>By incorporating this wave band, the curing light can effectively reduce the risk of resin shedding and incomplete curing. Moreover, the iLed Plus utilizes unique Woodpecker technology, which focuses the light output and reduces the light angle by 55.87%. This concentrated energy allows for higher curing efficiency, ensuring optimal performance during dental procedures.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Dimensions</strong></td><td>25mm × 25mm × 240mm</td></tr><tr><td><strong>Net Weight</strong></td><td>278g</td></tr><tr><td><strong>Power Input</strong></td><td>100V to 240V, 50Hz/60Hz</td></tr><tr><td><strong>Wavelength</strong></td><td>385nm – 515nm</td></tr><tr><td><strong>Light Intensity</strong></td><td>1000 mW/cm² – 2500 mW/cm²</td></tr></tbody></table></figure>', '<ul><li>1 x Light cure unit</li><li>1 x Charger</li><li>1 x Charger cord</li><li>1 x Instruction manual</li></ul>', NULL, 79, '3', 0.00, 10000.00, 10000.00, 5, 5, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-68834f28c05b0.png', NULL, 1, '2025-07-25 15:17:24', '2025-07-25 15:17:24'),
(364, 'P00316', NULL, 'Woodpecker LED-B Curing Light', 'woodpecker-led-b-curing-light-P00316', '<p><strong>Woodpecker LED-B Curing Light | QUDENT</strong></p><p>An ergonomically designed, lightweight cordless curing light with 4 different time settings. It also features an automatic sleep mode which turns the unit off if it is left unused for 3 minutes. Its lithium battery has a capacity of 2200mAh, for a duration of 70 minutes of use per charge.</p><p><strong>Features:</strong></p><ul><li>Ergonomically designed</li><li>Lightweight</li><li>Cordless sealed handpiece</li><li>4 time settings: 5, 10, 15 and 20 secs</li><li>Automatic sleep mode</li><li>Low standby power consumption with 70 days\' standby time</li><li>Large capacity battery. A full charge can be used for more than 500 times continuously under 10s the working time mode.</li><li>Full charging time: 4-6 hours</li><li>Constant light intensity</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Light Source</strong></td><td>Blue Light Wave (420nm – 480nm)</td></tr><tr><td><strong>Light Output</strong></td><td>&gt; 1000 mW/cm²</td></tr><tr><td><strong>Penetration</strong></td><td>55/3 mm</td></tr><tr><td><strong>Dimensions</strong></td><td>W31mm × D34mm × H195mm</td></tr><tr><td><strong>Handpiece Weight</strong></td><td>144g</td></tr></tbody></table></figure>', NULL, NULL, 79, '3', 0.00, 8750.00, 8750.00, 4, 4, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-6883522d15694.png', NULL, 1, '2025-07-25 15:30:17', '2025-07-25 15:30:17'),
(365, 'P00317', NULL, 'Woodpecker i-LED 2 Curing Light', 'woodpecker-i-led-2-curing-light-P00317', '<p><strong>i-LED II Curing Light by Woodpecker | VSDent</strong></p><p>Experience upgraded focused light output with a magnetic point cure lens. Featuring 3 versatile modes, intensity up to 3000 mW/cm², and a 1-second curing capability. The wide-spectrum design ensures precise and efficient performance for all your dental needs.</p><p><strong>Features:</strong></p><ul><li>Three working modes: Turbo Power, High Power and Standard Power</li><li>Time setting:&nbsp;<ul><li>Turbo Power: 1S, 3S</li><li>High Power: 3S, 5S</li><li>Standard Power: 5S, 10S, 15S, 20S</li></ul></li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Size</strong></td><td>25mm × 25mm × 240mm</td></tr><tr><td><strong>Net Weight</strong></td><td>278g</td></tr><tr><td><strong>Applied Parts</strong></td><td>Top of Main Unit, Point Cure Lens</td></tr><tr><td><strong>Duty Cycle</strong></td><td>20 sec ON / 20 sec OFF</td></tr><tr><td><strong>Light Source</strong></td><td>10W High Power Blue Light LED</td></tr><tr><td><strong>Wavelength</strong></td><td>385nm – 515nm</td></tr><tr><td><strong>Light Intensity</strong></td><td>1000 – 3000 mW/cm²</td></tr><tr><td><strong>Battery Model</strong></td><td>18500</td></tr><tr><td><strong>Battery Capacity</strong></td><td>2000mAh</td></tr><tr><td><strong>Battery Protections</strong></td><td>Over-voltage, Over-current, Short-circuit Protection</td></tr><tr><td><strong>Adapter (Charger) Input</strong></td><td>100–240V~, 50/60Hz, 0.4A Max</td></tr><tr><td><strong>Adapter (Charger) Output</strong></td><td>5.0V, 1A</td></tr></tbody></table></figure>', NULL, NULL, 79, '3', 0.00, 23750.00, 23750.00, 3, 3, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-688354de4f1ba.png', NULL, 1, '2025-07-25 15:41:46', '2025-07-25 15:41:46'),
(366, 'P00318', NULL, 'Woodpecker Mini S Light Cure LED', 'woodpecker-mini-s-light-cure-led-P00318', '<p>The <strong>MiniS curing light</strong> is a compact and ergonomic dental instrument designed for tooth restoration procedures. It utilizes ray radiation to quickly solidify light-sensitive resin with its high-power blue light. With its user-friendly features and efficient performance, the MiniS curing light is a valuable tool for dental professionals.</p><p>One of the notable features of the MiniS curing light is its ability to provide consistent solidification regardless of the remaining power. This ensures reliable and effective performance throughout dental procedures. The device can be used continuously for over 300 times with a full charge in the 10-second working time mode, offering convenience and efficiency.&nbsp; The MiniS curing light incorporates a 3W high-power blue light LED, which is suitable for resin solidification in dental applications. It has a wavelength range that matches popular dental resin types, ensuring compatibility and optimal results. The light intensity is carefully calibrated for effective solidification, ensuring reliable and durable restorations.</p><p>Operating the MiniS curing light is simple, with a button for turning it on/off and setting the desired solidification time. During operation, the device emits blue light, and a countdown timer indicates the remaining solidification time. Dentists have the flexibility to interrupt the process at any time by pressing the button, allowing for precise control and adjustments during dental procedures. The MiniS curing light\'s compact and ergonomic design makes it comfortable to hold and operate for extended periods. It is a reliable and efficient tool that assists dental professionals in delivering high-quality dental restorations while enhancing the overall treatment experience for patients.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Net Weight</strong></td><td>105g</td></tr><tr><td><strong>Dimensions</strong></td><td>230mm × 26mm × 30mm</td></tr><tr><td><strong>Power Input</strong></td><td>AC 100V–240V, 50Hz/60Hz</td></tr><tr><td><strong>Power Output</strong></td><td>DC 4.2V / 1A</td></tr><tr><td><strong>Light Output</strong></td><td>1000 mW/cm² – 1200 mW/cm²</td></tr><tr><td><strong>Wavelength</strong></td><td>420nm – 480nm</td></tr><tr><td><strong>Battery</strong></td><td>3.7V / 1400mAh</td></tr><tr><td><strong>Battery Model</strong></td><td>ICR 18490</td></tr><tr><td><strong>Light Intensity</strong></td><td>1000 mW/cm² – 1200 mW/cm²</td></tr><tr><td><strong>Effective Light Area</strong></td><td>50mm²</td></tr></tbody></table></figure>', '<ul><li>1 x LED curing light</li><li>1 x Guide rod tip</li><li>1 x Light slides</li><li>1 x Power adapter</li><li>1 x Lithium battery</li><li>1 x Operating manual</li><li>1 x Guarantee card</li></ul>', NULL, 79, '3', 0.00, 4200.00, 4200.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-68835a6f9c406.png', NULL, 1, '2025-07-25 16:05:31', '2025-07-25 16:05:31'),
(367, 'P00319', NULL, 'Woodpecker O Light 1 second Curing Light', 'woodpecker-o-light-1-second-curing-light-P00319', '<p><strong>Woodpecker O-Light 1-Second Curing Light</strong> Unit by&nbsp;Woodpecker is a trusted and widely accepted tool used by dentists worldwide. It offers high precision and intensity focused light for the efficient polymerization of resin materials containing new style photo-initiators like TPO. With a maximum light intensity exceeding 2300mw/cm², it can cure 2mm of resin in just 1 second, ensuring quick and effective solidification. The device maintains a constant current output, preventing light intensity from weakening as the battery is consumed. Its light hood, made of carefully selected materials, protects against blue-ray injury, prioritizing safety. The 5W high-power blue light LED guarantees consistent light intensity output. The Woodpecker O-Light features two modes: high mode with a light intensity range of 2300-2500 mw/cm², suitable for orthodontics, porcelain veneer, and post-core restoration; and standard mode with a range of 1000-1200 mw/cm², ideal for general curing. The unit offers strong penetration of light, enabling curing without distance limitations. Its front connector can rotate 360°, facilitating access to previously hard-to-reach areas, including posterior teeth. In summary, the Woodpecker O-Light is a reliable, flexible, and efficient curing light unit highly regarded by dental professionals worldwide.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Size</strong></td><td>268.8mm × 26.1mm × 31.8mm</td></tr><tr><td><strong>Net Weight</strong></td><td>259g</td></tr><tr><td><strong>Class</strong></td><td>Class I</td></tr><tr><td><strong>Adapter Input</strong></td><td>AC 100–240V, 50Hz/60Hz</td></tr><tr><td><strong>Adapter Output</strong></td><td>DC 5V, 1A</td></tr><tr><td><strong>Built-in Fuse</strong></td><td>T1A 250V</td></tr><tr><td><strong>Battery Model</strong></td><td>ICR18490</td></tr><tr><td><strong>Battery Capacity</strong></td><td>1400mAh</td></tr><tr><td><strong>Light Source Wavelength</strong></td><td>420nm – 490nm</td></tr><tr><td><strong>Light Source</strong></td><td>5W High Power Blue Light LED</td></tr></tbody></table></figure>', '<ul><li>1 x&nbsp; Main Unit of the LED</li><li>1 x Light Hood</li><li>1 x Adapter&nbsp;</li><li>1 x Pedestal Charger</li><li>1 x Instruction Manual</li></ul>', NULL, 79, '3', 0.00, 12500.00, 12500.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-68835ca70fb01.png', NULL, 1, '2025-07-25 16:14:59', '2025-07-25 16:14:59'),
(368, 'P00320', NULL, 'Woodpecker O-Star Wide-Spectrum Curing Light', 'woodpecker-o-star-wide-spectrum-curing-light-P00320', '<p>O-Star Woodpecker cordless curing light with an elegant design and the most advanced technology to harden dental resin.</p><p><strong>Small BUT POWERFUL</strong></p><ul><li>Full-metal body, ergonomically-streamlined design. Without tiredness from long-time holding. 108g main unit. Anti-shock and durable.&nbsp;</li></ul><p><strong>7 Modes to fully meet a variety of clinical needs.&nbsp;</strong></p><ul><li><strong>MODES:</strong>Normal mode, High mode, Turbo Mode, Ortho Mode, Soft Mode, Pulse Mode&nbsp;and Check mode.</li></ul><p><strong>Uniform beam, strong penetrability</strong></p><ul><li><strong>More focused light output</strong>thanks to light angle of only 15.8°. Ensuring good deep curing effect. The light intensity of Curing light will be reduced when the curing distance increases. Compared to other Curing Lights, O-STAR undergoes&nbsp;<strong>less light loss.&nbsp;LIGHT INTENSITY UP TO 30000MW/Cm2</strong></li></ul><p><strong>CHARGING BASE WITH BUILT-IN LIGHT METER</strong></p><ul><li>There is a light meter built in the charging base. Accurate light intensity is required for efficient polymerization of the resin, bringing you and your patients the best treatment experience.&nbsp;</li></ul><p><strong>360° ROTATABLE HEAD&nbsp;</strong></p><ul><li>Meeting various clinical needs. Easy to illuminate all angles in the mouth. The low-profile head can easily reach the posterior teeth. The patient only needs to open the mouth slightly and enjoy comfortable treatment.&nbsp;</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Size of Main Unit</strong></td><td>23mm × 23mm × 204mm</td></tr><tr><td><strong>Net Weight of Main Unit</strong></td><td>108g</td></tr><tr><td><strong>Applied Parts</strong></td><td>Top of Main Unit, Point Cure Lens</td></tr><tr><td><strong>Duty Cycle</strong></td><td>20 sec ON / 20 sec OFF</td></tr><tr><td><strong>Battery Type</strong></td><td>Rechargeable Lithium Battery</td></tr><tr><td><strong>Battery Model</strong></td><td>18500</td></tr><tr><td><strong>Battery Capacity</strong></td><td>2000mAh</td></tr><tr><td><strong>Battery Protections</strong></td><td>Over-voltage, Over-current, Short Circuit Protection</td></tr><tr><td><strong>Adapter (Charger) Input</strong></td><td>100–240V~, 50/60Hz, 0.4A Max</td></tr><tr><td><strong>Adapter (Charger) Output</strong></td><td>5.0V, 1A</td></tr><tr><td><strong>Adapter Compliance</strong></td><td>IEC 60601-1 and IEC 60601-1-2</td></tr></tbody></table></figure>', '<ul><li>1 x Maint unit</li><li>1 x Top of main unit</li><li>1 x Light hood</li><li>1 x Adapter</li><li>1 x Charging base</li><li>1 x Point cure lens</li><li>100 x Disposable sleeve</li><li>1 x Qualified certificate</li><li>1 x Instruction manual</li><li>1 x Warranty card</li></ul>', NULL, 79, '3', 0.00, 54720.00, 54720.00, 4, 4, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-68835f88a5f10.png', NULL, 1, '2025-07-25 16:27:16', '2025-07-25 16:27:16');
INSERT INTO `products` (`id`, `product_code`, `parent_id`, `product_name`, `slug`, `product_description`, `key_specifications`, `packaging`, `warranty`, `category_id`, `delivery_target_days`, `discount`, `actual_price`, `sell_price`, `available_quantity`, `stock_quantity`, `brand_id`, `product_location`, `has_variations`, `flash_sale`, `weekly_offer`, `special_offer`, `main_image`, `product_catalogue`, `status`, `created_at`, `updated_at`) VALUES
(369, 'P00321', NULL, 'Woodpecker LED-Q Built-in Wired Led Curing Light Cure Lamp for Dental Chair Unit', 'woodpecker-led-q-built-in-wired-led-curing-light-cure-lamp-for-dental-chair-unit-P00321', '<p>This high-performance dental curing light is <strong>FDA and CE0197 certified</strong>, ensuring safety and international quality standards. Designed for seamless integration with your dental unit, the device features a <strong>sealed structure</strong> and a powerful <strong>3W high-intensity blue light LED</strong> for rapid and efficient curing. Its <strong>360-degree rotatable head</strong> enhances accessibility in all areas of the oral cavity, while the <strong>ergonomically engineered handpiece</strong> provides superior grip and operator comfort. With advanced optics, this curing light can <strong>harden composite resin up to 4mm depth in just 10 seconds</strong>, delivering reliability and speed for all restorative procedures. Ideal for modern dental practices focused on efficiency and precision.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Time Setting</strong></td><td>10s, 20s, 30s</td></tr><tr><td><strong>Working Mode</strong></td><td>Full</td></tr><tr><td><strong>Power Input</strong></td><td>100V to 240V, 50Hz/60Hz, 0.4A Max</td></tr><tr><td><strong>Light Intensity</strong></td><td>1000 mW/cm² ~ 1200 mW/cm²</td></tr><tr><td><strong>Wavelength</strong></td><td>420nm – 480nm</td></tr><tr><td><strong>Illumination Range</strong></td><td>Diameter 8mm</td></tr><tr><td><strong>Net Weight</strong></td><td>4.5 oz (127g)</td></tr><tr><td><strong>Dimensions</strong></td><td>9.8” × 1” × 1” (248mm × 26mm × 26.5mm)</td></tr></tbody></table></figure>', NULL, NULL, 79, '3', 0.00, 6900.00, 6900.00, 4, 4, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-688362ec59572.png', NULL, 1, '2025-07-25 16:41:44', '2025-07-25 16:41:44'),
(370, 'P00322', NULL, 'Woodpecker Mini Ray Portable X-Ray Machine', 'woodpecker-mini-ray-portable-x-ray-machine-P00322', '<p><strong>Woodpecker Mini Ray Portable X-Ray Machine</strong> is an advanced X-ray imaging device designed for optimal safety and efficiency. Complying with international standards, it ensures double radiation protection, with minimal leakage from the body surface, thanks to 99.9% pure lead shielding in the oil tank and beam limiter. Its versatile capabilities include a 50k tube wattage, 2mA tube current, and 140W output power, catering to diverse clinical needs. Powered by a long-lasting 1800ml x 35 lithium battery, it offers 506 shots on a full charge and a rapid 2-hour full charge time. Equipped with a USA angle sensor, it provides real-time display and calibration options for shooting angles, ensuring accurate X-ray images. The device is user-friendly, featuring a 2.8\" HD digital screen, intuitive interface, and compact design for easy one-hand operation. With upgraded protection mechanisms, including a fast screen lock and automatic exposure cancellation, Mini Ray stands out as a durable, dependable, and high-performance high-frequency DC X-ray machine, setting new standards in the field.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Model</strong></td><td>Mini Ray</td></tr><tr><td><strong>Power Adapter Input</strong></td><td>~100–240V, 50/60Hz, 800mA</td></tr><tr><td><strong>Internal Power Supply</strong></td><td>DC 10.8V</td></tr><tr><td><strong>Type of Radiation</strong></td><td>X-ray</td></tr><tr><td><strong>Dimensions</strong></td><td>338mm × 112mm × 247mm</td></tr><tr><td><strong>Tube Voltage</strong></td><td>70kV</td></tr><tr><td><strong>Tube Current</strong></td><td>2mA</td></tr><tr><td><strong>Battery Capacity</strong></td><td>2500mAh (3S)</td></tr><tr><td><strong>Weight</strong></td><td>2.2Kg</td></tr><tr><td><strong>Atmospheric Pressure</strong></td><td>70kPa – 106kPa</td></tr><tr><td><strong>Maximum Electric Power</strong></td><td>0.14kW (70kV, 2mA)</td></tr><tr><td><strong>Nominal Electric Power</strong></td><td>0.14kW (70kV, 2mA, 0.1s)</td></tr></tbody></table></figure>', '<ul><li>1 x Mini Ray Portable X-Ray Machine</li><li>1 x Power Adapter &amp; Cable</li><li>1 x User Manual</li></ul>', NULL, 110, '3', 0.00, 110000.00, 110000.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-688365100eadb.png', NULL, 1, '2025-07-25 16:50:52', '2025-07-25 16:50:52'),
(371, 'P00323', NULL, 'Woodpecker Endo 3 Ultrasonic Endo Activator', 'woodpecker-endo-3-ultrasonic-endo-activator-P00323', '<p><strong>Woodpecker Endo 3 Ultrasonic Endo Activator</strong></p><p>Woodpecker Endo 3 Ultrasonic Endo Activator, an intelligent wireless handpiece designed for efficient irrigation activation in root canal&nbsp;procedures. This upgraded device replaces the Endo 1, offering enhanced features for optimal performance. The Endo 3 utilizes high-frequency ultrasonic vibrations generated by an oscillating circuit and transmitted through the ultrasonic transducer. These vibrations, generated by the inverse piezoelectric effect, induce resonance in the tip. By deepening into the root canal, the ultrasonic waves create carious effects, driving the irrigation solution and producing ultrasonic flow and cavitation. This effectively irrigates stains and debris within the root canal, promoting thorough debridement and disinfection. Endo 3 featuring three power modes (E1, E2, and E3), &amp;&nbsp;allows precise adjustment of power levels from low to high according to the specific treatment requirements. Additionally, it offers three operational modes: shutdown, hot standby (for power and time adjustments), and irrigation mode. This&nbsp;device incorporates four-time modes, allowing for customizable activation durations of 10, 15, 20 seconds, or 10 minutes. With a larger LCD screen, dentists can easily observe and monitor the device settings during procedures.&nbsp;Experience efficient and effective irrigation activation with the Endo 3 Ultrasonic Endo Activator—the advanced solution for optimal root canal treatment outcomes.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Tip E71</strong></td><td>Smooth tip, 30#, 4.2% taper, 18mm</td></tr><tr><td><strong>Tip E72</strong></td><td>Smooth tip, 30#, 3.6% taper, 21mm</td></tr><tr><td><strong>Tip E73</strong></td><td>Smooth tip, 25#, 3.1% taper, 18mm</td></tr><tr><td><strong>Tip E74</strong></td><td>Smooth tip, 25#, 3.3% taper, 21mm</td></tr><tr><td><strong>Dimensions</strong></td><td>173.8mm × 25.8mm × 35.8mm</td></tr><tr><td><strong>Net Weight</strong></td><td>78g</td></tr><tr><td><strong>Battery Type</strong></td><td>Rechargeable Lithium Battery</td></tr><tr><td><strong>Battery Model</strong></td><td>14500</td></tr><tr><td><strong>Battery Voltage</strong></td><td>3.6V</td></tr><tr><td><strong>Battery Capacity</strong></td><td>750mAh</td></tr><tr><td><strong>Power Adapter Input</strong></td><td>100V–240V, 50Hz/60Hz, 0.4A Max</td></tr><tr><td><strong>Power Adapter Output</strong></td><td>DC 5V / 1A</td></tr><tr><td><strong>Built-in Fuse</strong></td><td>T1AL 250V</td></tr><tr><td><strong>Tip Vibration Frequency</strong></td><td>40KHz ± 10KHz</td></tr><tr><td><strong>Relative Humidity</strong></td><td>30% – 75%</td></tr><tr><td><strong>Atmospheric Pressure</strong></td><td>70kPa – 106kPa</td></tr></tbody></table></figure>', '<ul><li>1 x Main Unit</li><li>1 x Power Adaptor</li><li>1 x Pedestal Charger</li><li>2 x Scaling Tip E96</li><li>2 x Scaling Tip E99</li><li>1 x Scaling Tip E70</li><li>10 x Scaling Tip E71</li><li>3 x Silicone Sleeves</li><li>1 x Torque Wrench</li><li>1 x Disposable Isolation Sleeve</li><li>1 x Instruction Manual</li><li>1 x Qualified Certification</li><li>1 x Packing List</li></ul>', NULL, 75, '3', 0.00, 34000.00, 34000.00, 3, 3, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-688369782ffcb.png', NULL, 1, '2025-07-25 17:09:40', '2025-07-27 10:00:06'),
(372, 'P00324', NULL, 'Woodpecker Endopace Brushless Endomotor', 'woodpecker-endopace-brushless-endomotor-P00324', '<p><strong>Woodpecker Endomotor Endopace</strong></p><p>Woodpecker Endo Pace is t he ultimate cordless endo motor for efficient and precise endodontic treatment. Designed specifically for root canal procedures, it combines advanced features to optimize your workflow. The Woodpecker Endo Pace seamlessly integrates with a matched Apex locator, providing real-time monitoring of the&nbsp;file tip\'s position within the canal. This enables enhanced control and safety during treatment, while automatic&nbsp;functions like Apical Slow Down prevent overextension. Powered by an efficient brushless motor, the Endo Pace operates silently and boasts a&nbsp;longer service life. Its cordless design offers unmatched portability, allowing freedom of movement without the restrictions of cords. With a 360° rotating contra angle, the device provides&nbsp;exceptional access and maneuverability, ensuring thorough cleaning and shaping of the canal system. Experience the power of precision and efficiency in endodontic treatment with the Woodpecker Endo Pace—a reliable companion for successful root canal therapy.</p><p><strong>Contra- Indications:</strong></p><ul><li>The doctor with a pacemaker is disabled.</li><li>Patients with cardiac pacemakers (or other electrical equipment) are warned not to use small appliances (such as Electric razors, hair dryers, etc.) patients are disabled.</li><li>Hemophilia patients are banned.</li><li>Use with caution in patients with heart disease, pregnant women, and young children</li></ul>', '<figure class=\"table\"><table><tbody><tr><td><strong>Specification</strong></td><td><strong>Details</strong></td></tr><tr><td><strong>Battery (in Handpiece)</strong></td><td>Lithium Battery: 3.6V / 850mAh</td></tr><tr><td><strong>Power Adapter Input</strong></td><td>100V–240V, 50Hz/60Hz, 0.4A Max</td></tr><tr><td><strong>Power Adapter Output</strong></td><td>DC 5V / 1A</td></tr><tr><td><strong>Rotation Speed</strong></td><td>100 – 1500 rpm</td></tr><tr><td><strong>Torque</strong></td><td>0.4 – 4.2 Ncm (Max 4 Ncm)</td></tr><tr><td><strong>Weight</strong></td><td>106g</td></tr><tr><td><strong>Handpiece Dimensions</strong></td><td>9.7mm × 8mm × 6mm</td></tr><tr><td><strong>Head Height</strong></td><td>9.7mm</td></tr><tr><td><strong>Head Diameter</strong></td><td>8mm</td></tr><tr><td><strong>Neck Diameter</strong></td><td>6mm</td></tr></tbody></table></figure>', '<ul><li>1 x Motor Handpiece</li><li>1 x Contra Angle</li><li>1 x Base</li><li>1 x Power Adapter</li><li>1 x USB Wire</li><li>1 x Nozzle</li><li>1 x Instruction Manual</li></ul>', NULL, 77, '3', 0.00, 45600.00, 45600.00, 1, 1, 105, NULL, 0, 0, NULL, NULL, '2025-07-25-68836e36c3d13.png', NULL, 1, '2025-07-25 17:29:54', '2025-07-25 17:29:54'),
(373, 'P00325', NULL, 'Endomotor Woodpecker Endo Radar With Apex Locator', 'endomotor-woodpecker-endo-radar-with-apex-locator-P00325', '<p>The Endoradar by Woodpecker is an endomotor with a built-in apex locator, which saves space as well as time while performing root canal therapy. The endomotor and apex locator functions can be used separately or together, by the click of a button (En-Ap), as per the choice of the dentist. This device can be a great asset to your endodontic practice as it eliminates the need for individual devices for working length determination and root canal shaping. EndoRadar features a cordless endodontic handpiece while having a USB cable as well. The handpiece also has a wireless, intelligent charging mode that does not require the use of an adapter. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p><strong>Endomotor Mode:</strong><br><strong>The Endomotor Mode has 3 reciprocating features and 8 free programs for custom settings. Three auto reverse modes are present which can be cyclically changed by pressing on the \"AUTO REV\" button. When using the reciprocating mode, the operator can choose between three reciprocating angles. The speed and torque can be adjusted based on the operator\'s choice and the settings can be saved by clicking on the \"MEMO\" button. The accuracy and speed of the reversal mode, reduces the risk of instrument separation during biomechanical preparation.</strong></p><p><strong>Apex Locator Mode:</strong><br><strong>The Apex Locator Mode can be used individually by clicking on the \"En-Ap\" button. After the file clip, measuring wire and lip hook are installed the standard protocol can be followed using a K file to accurately measure the working length of the root canal.</strong></p><p><strong>Combined Mode:</strong><br><strong>By pressing on the \"En-Ap\" button the operator can choose to enter the dual mode including both the endomotor and the apex locator.&nbsp;</strong><br><strong>Long press on the \"SET\" button allows the operator to change the parameter settings of the dual mode and can exit by pressing the same button.</strong><br><strong>The components of the apex locator are installed and the handpiece is connected via the USB cable.</strong><br><strong>The proper contact of the circuit can be tested by short circuiting the lip hook with the installed NiTi rotary file.&nbsp;</strong><br><strong>During root canal preparation, the apex locator shows the location of the file inside the canal in real time.</strong></p>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Control Interface</strong></td><td>Full Touching Button</td></tr><tr><td><strong>Compatibility</strong></td><td>Compatible with reciprocating function</td></tr><tr><td><strong>Handpiece Type</strong></td><td>Mini 1:1 Contra-angle handpiece</td></tr><tr><td><strong>Torque Range</strong></td><td>0.6 – 4.0 Ncm</td></tr><tr><td><strong>Speed Range (RPM)</strong></td><td>200 – 650 RPM</td></tr><tr><td><strong>Memory Programs</strong></td><td>8 sets of programmable memory</td></tr><tr><td><strong>Apex Locator Integration</strong></td><td>Yes, built-in apex locator</td></tr></tbody></table></figure>', '<ul><li>Main unit( containing Apex Locator)</li><li>Handpiece.</li><li>Contra Angle.</li><li>Power Adaptor.</li><li>USB Wire.</li><li>Measuring Wire.</li><li>File Clip.</li><li>Lip Hook.</li><li>Touch Probe.</li></ul>', NULL, 78, '3', 0.00, 85000.00, 85000.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-07-27-6885ac3da191f.png', NULL, 1, '2025-07-27 10:19:05', '2025-07-27 10:23:04'),
(374, 'P00326', NULL, 'Woodpecker Endo Radar Pro', 'woodpecker-endo-radar-pro-P00326', '<p><strong>Woodpecker Endo Radar Pro</strong><br><strong>Brushless Endo Motor With Apex Locator</strong></p><p>New generation desk-type Brushless Endo Motor, Bring you a new experience in root canal treatment</p><p>The Endoradar by Woodpecker is an endomotor with a built-in apex locator, which saves space as well as time while performing root canal therapy. The endomotor and apex locator functions can be used separately or together, by the click of a button (En-Ap), as per the choice of the dentist. This device can be a great asset to your endodontic practice as it eliminates the need for individual devices for working length determination and root canal shaping. EndoRadar features a cordless endodontic handpiece while having a USB cable as well. The handpiece also has a wireless, intelligent charging mode that does not require the use of an adapter.New generation desk-type Brushless Endo Motor, Bring you a new experience in root canal treatment</p><p><strong>Endo Radar Pro</strong></p><ul><li>&nbsp;A smaller handpiece: 2mm less in diameter and 7mm less in circumference</li><li>&nbsp;A wider speed range: 100rpm ~ 2500rpm</li><li>Other built-in file system: 33 built-in file systems</li><li>Extra function : ATR (Automatic Torque Reverse)<br><br>&nbsp;</li></ul><p><strong>FEATURES :</strong></p><p>High performance brushless endo motor</p><ul><li>Super high torque, high speed, fast response, more accurate output, and more stable, ensuring more efficient &amp; safe preparation.</li><li>Adjustable reciprocating angles range :&nbsp;20 – 340,10 as the minimum unit for adjustment accurate control on rotating angle reduces the risk of instrument fracture, enabling more efficient and safer preparation.</li><li>Smooth rotation, lower noise and small vibration in handpiece doctors feel good during operations.Patients feel more comfortable during operation.</li></ul><p><strong>Wireless connection</strong></p><ul><li>Use wireless signal to control the handpiece, realizing flexible operation without restraint of tail cord. Light and small handpiece makes holding comfortable.</li></ul><p><strong>Full touch button design HD LCD display</strong></p><ul><li>Touchable intelligent panel is smooth and easy to clean.The panel can be illuminated; thus, the buttons are easy to identify.Clear display offers simple and clear information feedback.</li></ul><p><strong>Wireless charging</strong></p><ul><li>Adopt wireless charging design for handpiece. Put the handpiece on the main unit for charging. Built-in 2000mAh large capacity rechargeable lithium battery one charge for longtime operation.</li></ul><p><strong>Built-in apex locator</strong></p><ul><li>Intergraded length determination makes endodontic treatment safer and more efficient. Realize real-time display of file location in canal. Automatically stops or reversely rotates as soon as the file reaches the apical stop, so as to prevent perforation. Auto start and auto stop functions respectively enable motor to automatically start while the file gets in canal and stop when it is out.<br>&nbsp;</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Speed</strong></td><td>100 – 1200 RPM</td></tr><tr><td><strong>Torque</strong></td><td>0.4 – 5.0 N·cm</td></tr><tr><td><strong>Battery</strong></td><td>3.7V / 2000mAh (Handpiece) 11.1V / 2600mAh (Base)</td></tr><tr><td><strong>Dimensions</strong></td><td>240 × 180 × 130 mm</td></tr><tr><td><strong>Power Input</strong></td><td>~100V – 240V, 50Hz/60Hz, 800mA</td></tr><tr><td><strong>Power Output</strong></td><td>15.0V – 1.6A</td></tr></tbody></table></figure>', '<ul><li>1 x&nbsp;Main unit(containing Apex Locator)</li><li>1 x Motor&nbsp;Handpiece</li><li>2 x Silicon cover</li><li>2 x “O” ring</li><li>1 x&nbsp;Contra Angle</li><li>1 x&nbsp;Power Adaptor</li><li>1 x&nbsp;USB Wire</li><li>1 x Lubricator</li><li>1 x&nbsp;Measuring Wire</li><li>4 x&nbsp;File Clip</li><li>2 x&nbsp;Lip Hook</li><li>2 x&nbsp;Touch Probe</li><li>Instruction manual</li></ul>', NULL, 78, '3', 0.00, 95000.00, 95000.00, 3, 3, 105, NULL, 0, 0, NULL, NULL, '2025-07-27-6885b30ed3dc1.png', NULL, 1, '2025-07-27 10:48:10', '2025-07-27 10:48:10'),
(375, 'P00327', NULL, 'Endo Smart Plus: Wireless Engine + Countra-Angle - WOODPECKER', 'endo-smart-plus-wireless-engine-countra-angle-woodpecker-P00327', '<h2>Endo Smart Plus Cordless Motor</h2><p><strong>Endo Smart Plus</strong> is a high-performance, cordless, brushless endodontic motor for use <strong>with the Woodpex V apex locator</strong>. By connecting to the locator <strong>the position of the file within the canal can be monitored</strong> during the procedure and functions such as Auto Apical Reverse can be activated.</p><p>The <strong>Endo Smart+</strong> motor has a precise rotation angle and allows for <strong>automatic reverse,</strong> which helps prevent file rupture, resulting in greater preparation efficiency.</p><h3>Features of Endo Smart Plus:</h3><ul><li>It has a <strong>brushless motor,</strong> which means higher performance, precision and durability.</li><li>Compatible with most premium files.</li><li>It offers a <strong>reciprocating motion</strong> function.</li><li>Adjustable range <strong>20º - 400º</strong>.</li><li>It incorporates a small head for <strong>greater visibility</strong>.</li><li><strong>OLED display</strong> with relevant information (speed, torque and programme).</li><li>Fail-safe battery charging, thanks to wireless charging.</li><li><strong>Automatic</strong> torque <strong>calibration</strong>.</li><li>9 programmes that can be memorised.</li><li><strong>Adjustable torque:</strong> 0.4 Ncm to 5.0 Ncm.</li><li><strong>Adjustable speed:</strong> 100 to 1,200 rpm.</li><li>Handpiece warranty: 24 months.</li></ul><h3>Contra Angle 6:1 Endo Smart Plus:</h3><ul><li>Contra angle <strong>6:1</strong>.</li><li><strong>Super mini</strong>, allowing a clearer field of operation.</li><li>Capable of rotating <strong>360º</strong>.</li><li><strong>Adjustable angle,</strong> providing <strong>easy accessibility</strong> to different teeth.</li><li>Compatible with ENDO RADAR Plus, Endo Smart Plus and Motopex.</li><li>Autoclavable.</li><li>Counter-angle guarantee: 12 months.</li></ul><h3>Contents of the Endo Smart Plus:</h3><ul><li>Handpiece:</li><li>Contra angle mini 6:1</li><li>Charging base</li><li>Apex cable</li><li>Charger</li><li>Lubrication nozzle</li><li>Protective cover</li><li>Instruction manual</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Handpiece Warranty</strong></td><td>24 months</td></tr><tr><td><strong>Contra-Angle Warranty</strong></td><td>12 months</td></tr><tr><td><strong>Battery</strong></td><td>3.7V / 2000mAh lithium battery</td></tr><tr><td><strong>Input Power</strong></td><td>~100V – 240V, 50Hz/60Hz, 0.4A Max</td></tr><tr><td><strong>Output Power</strong></td><td>DC 5V / 1A</td></tr><tr><td><strong>Torque Range</strong></td><td>0.4 Ncm – 5.0 Ncm (4 mNm – 50 mNm)</td></tr><tr><td><strong>Speed Range</strong></td><td>100 RPM – 1200 RPM</td></tr><tr><td><strong>Weight</strong></td><td>210 grams</td></tr></tbody></table></figure>', NULL, NULL, 77, '3', 0.00, 58500.00, 58500.00, 3, 3, 105, NULL, 0, 0, NULL, NULL, '2025-07-27-6885b81e8fa32.png', NULL, 1, '2025-07-27 11:09:46', '2025-07-27 11:09:46'),
(376, 'P00328', NULL, 'Woodpecker RVG i Sensor (Compatible With Windows Only)', 'woodpecker-rvg-i-sensor-compatible-with-windows-only-P00328', '<p><strong>Woodpecker i-Sensor RVG</strong> is a revolutionary intraoral sensor that sets new standards in dental imaging. With its exceptional features and advanced technology, it delivers the best and most important aspects for dental professionals seeking high-quality intraoral imaging. At the heart of the i-Sensor RVG is its high-resolution imaging capability, offering a theoretical resolution of 25 lp/mm. This ensures unparalleled clarity and detail in radiographic images, allowing for precise diagnosis and treatment planning. With a high-definition sensor boasting up to 2.2 million pixels, every intricate detail is captured with remarkable accuracy. The sensor\'s leading 16-bit ADC chip provides up to 60,000+ gray scale levels, enabling outstanding image quality and superior diagnostic capabilities. This wide dynamic range ensures optimal visualization of subtle anatomical structures, including root apex bifurcations and fine caries lesions. The i-Sensor RVG\'s user-friendly software is both smart and powerful. With one-click smart installation, it allows for easy setup and seamless integration into existing imaging workflows. The software offers powerful image processing functions, empowering users to enhance image quality quickly and significantly. It also provides efficient workflow management, optimizing productivity and saving valuable time. Durable and reliable, the i-Sensor RVG has undergone extensive testing, including 80,000+ bending tests, to ensure its longevity. Its robust construction and IP68 protection rating make it resistant to damage from everyday use and allow for immersion in disinfectant liquids, ensuring the highest standards of hygiene and infection control.</p><p>The sensor\'s thin design, measuring only 4.5mm, coupled with ergonomically optimized cut corners, simplifies sensor placement and improves patient comfort. It is specifically designed to excel in bitewing radiography, providing better contact with teeth and facilitating simplified vertical bitewing acquisition. With the Woodpecker i-Sensor RVG, dental professionals gain access to an all-encompassing imaging solution that combines exceptional image quality, ease of use, durability, and advanced software functionality. It empowers dental professionals to deliver accurate diagnoses, effective treatment planning, and superior patient care.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Brand</strong></td><td>Woodpecker</td></tr><tr><td><strong>Pixel Size</strong></td><td>20 µm</td></tr><tr><td><strong>Power Adapter Input</strong></td><td>5V / USB Interface</td></tr><tr><td><strong>Effective Area</strong></td><td>20 × 30 mm (H1) / 26 × 36 mm (H2)</td></tr><tr><td><strong>Pixel Matrix Size</strong></td><td>1000 × 1500 (H1) / 1300 × 1800 (H2)</td></tr><tr><td><strong>Dimensions</strong></td><td>38.5 × 25 × 4.5 mm (H1) / 40 × 31 × 4.5 mm (H2)</td></tr><tr><td><strong>Detector Technology</strong></td><td>APS CMOS</td></tr><tr><td><strong>True Resolution</strong></td><td>20 lp/mm</td></tr></tbody></table></figure>', NULL, NULL, 111, '3', 0.00, 0.00, 0.00, 0, 0, 105, NULL, 1, 0, NULL, NULL, '2025-07-27-6885bb9eeb59e.png', NULL, 1, '2025-07-27 11:24:42', '2025-07-27 11:53:43'),
