(381, 'P00331', 376, 'Woodpecker / DTE RVG i-Sensor H1.5', 'woodpecker-dte-rvg-i-sensor-h15-P00331', NULL, NULL, NULL, NULL, NULL, NULL, 0.00, 115000.00, 115000.00, 3, 3, NULL, NULL, NULL, NULL, NULL, NULL, '2025-07-27-6885c26bba18b.png', NULL, 1, '2025-07-27 11:53:43', '2025-07-27 11:53:43'),
(382, 'P00332', NULL, 'Woodpecker Surgic Touch Piezosurgery Unit', 'woodpecker-surgic-touch-piezosurgery-unit-P00332', '<p>The <strong>Woodpecker Surgic Touch Piezosurgery Unit</strong> is a cutting-edge dental surgical equipment designed to revolutionize procedures in various fields including Implantology, Periodontology, Endodontics, and Orthodontic Surgery. Its key features include precise micrometric cutting capability, selective cutting that safeguards soft tissues, and a cavitation effect for enhanced visibility during surgery, all thanks to its controlled three-dimensional ultrasound oscillations.</p><p>This advanced device comes equipped with an automatic tuning circuit that maintains consistent performance by offsetting tip wear. It is a versatile tool suitable for a wide range of applications, including oral surgery, orthopedic surgery, maxillofacial surgery, cosmetic surgery, neurosurgery, and otolaryngology, offering flexibility and precision in different medical settings.</p><p>Safety is paramount with the Surgic Touch, and the manufacturer, Woodpecker, emphasizes the importance of adhering to safety requirements outlined in the manual to prevent personal injuries or damage to property. The unit features a user-friendly interface with a 7-inch touchscreen, and a multi-function foot pedal for easy control of water flow, working modes, and power settings.</p><p>With its cold-cutting mode, the Surgic Touch generates minimal heat during operation, ensuring patient comfort and excellent postoperative recovery. The handpiece is designed for high performance and durability, and it can be easily sterilized for repeated use. Additionally, the LED-equipped handpiece offers enhanced visibility during procedures.</p><p><strong>Operating Modes of the Woodpecker Surgic Touch Piezosurgery Unit</strong></p><ul><li><strong>Cutting Mode:</strong> Achieve precise cutting with seven power levels tailored to different bone densities.</li><li><strong>Periodontal Mode:</strong> Delicate periodontal treatments made efficient with adjustable water flow and power settings.</li><li><strong>Endodontic Mode:</strong> Perform intricate endodontic surgeries with ease using precise power and water flow adjustments.</li><li><strong>Cleaning Mode:</strong> Simplify device maintenance and post-procedure cleanup with this mode, controlled via a multi-function foot pedal.</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Operation Type</strong></td><td>Intermittent: 60s ON, 10s OFF</td></tr><tr><td><strong>Power Supply Voltage</strong></td><td>100V–240V, 50Hz/60Hz, 150VA</td></tr><tr><td><strong>Working Frequency</strong></td><td>24kHz – 36kHz</td></tr><tr><td><strong>Display</strong></td><td>7-inch Touchscreen Interface</td></tr><tr><td><strong>Operating Modes</strong></td><td>Cutting Mode, Periodontal Mode, Endodontic Mode, Cleaning Mode</td></tr><tr><td><strong>Main Unit Dimensions</strong></td><td>276 mm × 267 mm × 110 mm</td></tr><tr><td><strong>Intended Use</strong></td><td>Oral and Maxillofacial Surgery</td></tr><tr><td><strong>Contraindications</strong></td><td>- Not for use on patients with pacemakers or implantable electronic devices</td></tr><tr><td>&nbsp;</td><td>- Operators with similar devices should also avoid usage</td></tr><tr><td>&nbsp;</td><td>- Electrosurgical knife may interfere with device function</td></tr></tbody></table></figure><p>Do not carry out this treatment on metal or ceramic prosthetic artifacts. The ultrasonic vibrations could lead to decrementing of such artifacts</p>', '<ul><li>1 x&nbsp;Main Unit</li><li>1 x Multi-function foot pedal</li><li>2 x Normal saline connector</li><li>1 x&nbsp;Hook</li><li>8 x&nbsp;Pump tube</li><li>1 x&nbsp;Peristaltic pump</li><li>1 x Surgic Touch (LED) handpiece complete&nbsp;with cord</li><li>2 x&nbsp;Silicone handpiece holder</li><li>4 x&nbsp;Connection for the cord and tube&nbsp;of the peristaltic pump</li><li>1 x&nbsp;Torque wrench</li><li>2 x&nbsp;Sterilize box</li><li>1 x&nbsp;Power-supply cable</li></ul>', NULL, 85, '3', 0.00, 445000.00, 445000.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-07-27-6885f2b106555.png', NULL, 1, '2025-07-27 12:12:26', '2025-07-27 15:19:41'),
(383, 'P00333', NULL, 'Fi-E & Fi-P Combo Gutta-Percha Obturation System', 'fi-e-fi-p-combo-gutta-percha-obturation-system-P00333', '<p>The Fi-E &amp; Fi-P Combo Gutta-Percha Obturation System from Woodpecker combines an ergonomic, fast-heating, multi setting obturation plugger and a cordless heated gutta percha delivery pen.</p><h3><strong>Woodpecker Fi-P&nbsp;</strong></h3><p>An ergonomic, fast-heating, multi setting obturation plugger.&nbsp;</p><p><strong>Features:</strong></p><ul><li>For vertical condensation / compaction.</li><li>High precision temperature control.</li><li>0.2 Second heating time - for fast and efficient treatment.</li><li>0.35mm Bendable plugger tips, suitable for narrow root canals.</li><li>4 Hours working time on a full charge.</li><li>Enables approx. 1500 Treatments before charging is needed.</li><li>Light weight design for reduced hand fatigue.</li><li>Clear dual display for ambidextrous use.&nbsp;</li></ul><h3><strong>Woodpecker Fi-E</strong></h3><p>Cordless Heated Gutta Percha Delivery Pen</p><p>Part of the Fi Obturation Range - The Fi-E delivers a consistent and uniform GP at the perfect fluidity.&nbsp;</p><p>With an ergonomic design, and one button injection the Fi-E relieves hand fatigue and provides greater efficiency and reach.</p><p>The pen offers minimal maintenance and straight forward controls. With self-cleaning, and 2 step settings. The window display will show precisely how much GP is available.&nbsp;</p><p><strong>Features:&nbsp;</strong></p><ul><li>Mess free liquid GP - GP Bar is self-contained in the Tip only.</li><li>Wireless Pen and Bendable, 360° Tip for ultimate reach.</li><li>Dual button injection - For easy use at all angles.</li><li>Clear indicator window to show remaining GP amount.</li><li>Clear \'Heating\' indicator light.</li><li>Multiple Heat and Injection Speed Settings.</li><li>Will self-clean residue ready for New GP insert.</li><li>Automatically re-sets ready for new GP.</li><li>Includes 2 Battery packs, for extended use and fast replacement.&nbsp;</li></ul><p><br>&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Item</strong></th><th><strong>Quantity</strong></th></tr></thead><tbody><tr><td>Fi-P Plugger Pen</td><td>1 pc</td></tr><tr><td>Charging Base</td><td>1 pc</td></tr><tr><td>Power Lead</td><td>2 pcs</td></tr><tr><td>Spare Battery Pack</td><td>1 pc</td></tr><tr><td>Autoclavable Plugger Tips</td><td>4 pcs (5506, 4004, 4504, 5508)</td></tr><tr><td>Fi-E GP Injection Pen</td><td>1 pc</td></tr><tr><td>Power Packs</td><td>2 pcs</td></tr><tr><td>Dual Charging Stand</td><td>1 pc</td></tr><tr><td>Autoclavable Injection Needles</td><td>4 pcs (E23G-M, E23G-L, E25G-L ×2)</td></tr><tr><td>Insulated Sleeves</td><td>2 pcs</td></tr><tr><td>Locking Nut</td><td>1 pc</td></tr><tr><td>Tip Wrench / Bending Tool</td><td>1 pc</td></tr><tr><td>Instruction Manuals</td><td>2 pcs</td></tr><tr><td>Woodpecker Certification &amp; Warranty Cards</td><td>2 pcs</td></tr></tbody></table></figure>', NULL, NULL, 200, '3', 0.00, 0.00, 0.00, 0, 0, 105, NULL, 1, 0, NULL, NULL, '2025-07-27-6885ca19c8ddf.png', NULL, 1, '2025-07-27 12:26:29', '2025-07-27 12:26:29'),
