(385, 'P00335', 383, 'WOODPECKER Fi-P Obturation System', 'woodpecker-fi-p-obturation-system', NULL, NULL, NULL, NULL, NULL, NULL, 0.00, 42000.00, 42000.00, 2, 2, NULL, NULL, NULL, NULL, NULL, NULL, '2025-07-27-6885ca19cda9c.png', NULL, 1, '2025-07-27 12:26:29', '2025-07-27 12:26:29'),
(386, 'P00336', NULL, 'Ultrasonic dental scaler UDS-B', 'ultrasonic-dental-scaler-uds-b-P00336', '<p>The <strong>Woodpecker UDS-B Ultrasonic Scaler</strong> is a high-performance dental device designed for effective scaling, offering advanced features for both functionality and user convenience. It comes equipped with a <strong>detachable handpiece with LED light</strong>, enhancing visibility during procedures. The handpiece is <strong>autoclavable at 135°C and 0.22MPa</strong>, ensuring optimal sterilization and hygiene. Constructed from <strong>durable titanium alloy</strong>, it delivers excellent mechanical performance and long-term reliability. The built-in <strong>high-quality piezo-ceramic components</strong> provide consistent power with minimal heat generation, while the <strong>silica gel cable</strong> adds flexibility and durability. The scaler features a <strong>specialized scaling tip</strong> that utilizes cavitation technology for effective removal of dental calculus and efficient germ elimination. With <strong>automatic frequency tracking</strong>, the device maintains optimal operating frequency for stable and reliable performance. It is <strong>digitally controlled</strong>, making it user-friendly and efficient. Additionally, the UDS-B is <strong>compatible with EMS handpieces and tips</strong>, offering versatility for different clinical setups. Backed by <strong>CE and FDA certifications</strong>, the Woodpecker UDS-B is a trusted solution for professional dental scaling needs.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Adapter Input</strong></td><td>110V–220/240V~, 50/60Hz, 150mA</td></tr><tr><td><strong>Output Primary Tip Vibration Excursion</strong></td><td>≤100µm</td></tr><tr><td><strong>Output Half-Excursion Force</strong></td><td>&lt;2N</td></tr><tr><td><strong>Output Tip Vibration Frequency</strong></td><td>28kHz ± 3kHz</td></tr><tr><td><strong>Main Unit Input</strong></td><td>24V~, 1.3A</td></tr><tr><td><strong>Output Power</strong></td><td>3–20W</td></tr><tr><td><strong>Main Unit Fuse</strong></td><td>T1.6AL, 250V</td></tr><tr><td><strong>Adapter Fuse</strong></td><td>T0.5AL, 250V</td></tr><tr><td><strong>Water Pressure</strong></td><td>0.01–0.5MPa</td></tr><tr><td><strong>Operating Mode</strong></td><td>Continuous Operation</td></tr><tr><td><strong>Weight of Main Unit</strong></td><td>0.75 kg</td></tr><tr><td><strong>Weight of Adapter</strong></td><td>1.2 kg</td></tr><tr><td><strong>Protection Against Electric Shock</strong></td><td>Class II, Type BF</td></tr><tr><td><strong>Dimension</strong></td><td>170 × 111 × 65 mm</td></tr><tr><td><strong>Protection Against Harmful Ingress of Water</strong></td><td>Ordinary Equipment</td></tr><tr><td><strong>Protection Degree Against Water (Foot Switch)</strong></td><td>IPX1</td></tr></tbody></table></figure>', '<ul><li>Main unit x 1</li><li>&nbsp;Handpiece x 1</li><li>&nbsp;Foot switch x 1</li><li>Tip x 5</li><li>&nbsp;Adapter x 1</li><li>&nbsp;Torque wrench x 1</li><li>Operation manuel x 1</li></ul>', NULL, 75, '3', 0.00, 14800.00, 14800.00, 0, 0, 105, NULL, 0, 0, NULL, NULL, '2025-07-27-6885f6d2a7bb8.png', NULL, 1, '2025-07-27 15:37:18', '2025-07-31 17:08:30'),
(387, 'P00337', NULL, 'Woodpecker Uds P LED Ultrasonic Scaler', 'woodpecker-uds-p-led-ultrasonic-scaler-P00337', '<p><strong>UDS-P LED dental scaler</strong> is a cutting-edge, detachable, and autoclavable handpiece that operates at the optimal frequency, ensuring stable performance, while its digital controls and high efficiency make it a standout in the dental market; with features such as automatic frequency tracking, easy operation, and a power range of 3W to 20W, it offers convenience and precision for scaling procedures, while adhering to safety standards with its Class II electric shock protection and degree of protection against harmful water ingress, making it a reliable choice for dental professionals; additionally, its endo function enables efficient root canal treatments with adjustable power levels, and for utmost hygiene, the detachable handpiece can be sterilized at high temperatures and pressures, preventing cross-contamination; it is imperative to follow proper sterilization procedures, maintain cleanliness, and adhere to precautionary measures outlined in the user manual to ensure safe and effective use of the equipment. The UDS-P LED scaler\'s technical specifications further demonstrate its advanced capabilities. With an output vibration excursion of less than 100μm and a half-excursion force of less than 2N, it delivers controlled and gentle scaling movements.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Power Input</strong></td><td>110V~ 50Hz/60Hz or 220–240V~ 50Hz/60Hz</td></tr><tr><td><strong>Main Unit Input</strong></td><td>24V~, 1.3A</td></tr><tr><td><strong>Output Power</strong></td><td>3W ~ 20W</td></tr><tr><td><strong>Frequency</strong></td><td>28kHz ± 3kHz</td></tr><tr><td><strong>Water Pressure</strong></td><td>0.1 bar ~ 5 bar (0.01 MPa ~ 0.5 MPa)</td></tr><tr><td><strong>Main Unit Weight</strong></td><td>0.68 kg</td></tr><tr><td><strong>Adapter Weight</strong></td><td>1.2 kg</td></tr><tr><td><strong>Dimensions</strong></td><td>178 mm × 145 mm × 89 mm</td></tr></tbody></table></figure>', '<ul><li>1 x Main unit</li><li>1 x Handpiece</li><li>1 x Foot switch</li><li>6 x Tip</li><li>1 x Adapter</li><li>1 x Torque wrench</li><li>1 x Operation manual</li></ul>', NULL, 75, '3', 0.00, 25250.00, 25250.00, 3, 3, 105, NULL, 0, 0, NULL, NULL, '2025-07-27-6885f9f8793e3.png', NULL, 1, '2025-07-27 15:50:44', '2025-07-27 15:53:56'),
(388, 'P00338', NULL, 'Woodpecker U600 Ultrasonic Scaler', 'woodpecker-u600-ultrasonic-scaler-P00338', '<h3>U600 Ultrasonic Scaler</h3><p>Scaler is mainly used for teeth cleaning, dental calculus elimination and root canal treatment.</p><p><strong>Features:</strong></p><ul><li>The ultrasonic scaler U600 LED has scaling, perio, endo functions;</li><li>Auto-water supply function;</li><li>Smart touch system;</li><li>Effective and thorough endodontic irrigation;</li><li>The handpiece is detachable and can be autoclaved to high temperature 134°C and high pressure 0.22Mpa;</li><li>Detachable handpiece with light enable better visibility;</li><li>Automatic frequency tracking ensures that the machine always works on the best frequency and more steadily;</li><li>Digital control, easy operation and more efficient for scaling;</li><li>Intelligent degenerative feedback - in accordance with different tooth surface, will automatically output accurate power to the tip;</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Product</strong></th><th><strong>U600 Ultrasonic Scaler</strong></th></tr></thead><tbody><tr><td><strong>Primary Use</strong></td><td>Teeth cleaning, dental calculus removal, and root canal treatment</td></tr><tr><td><strong>Functions</strong></td><td>Scaling, Perio, Endo</td></tr><tr><td><strong>Water Supply</strong></td><td>Auto-water supply function</td></tr><tr><td><strong>Control Interface</strong></td><td>Smart touch system</td></tr><tr><td><strong>Irrigation Capability</strong></td><td>Effective and thorough endodontic irrigation</td></tr><tr><td><strong>Handpiece</strong></td><td>Detachable, autoclavable at 134°C and 0.22 MPa</td></tr><tr><td><strong>Handpiece Lighting</strong></td><td>Equipped with LED for better visibility</td></tr><tr><td><strong>Frequency Tracking</strong></td><td>Automatic frequency tracking for stable performance</td></tr><tr><td><strong>Control System</strong></td><td>Digital control for easy operation and improved efficiency</td></tr><tr><td><strong>Power Feedback System</strong></td><td>Intelligent degenerative feedback adapts power output based on tooth surface</td></tr></tbody></table></figure><p>U600 Ultrasonic Scaler is equipped with various shapes of tips, including slender tip which is specially used to perform subgingival scaling.</p>', '<p>Main Unit, Detachable handpiece, power cord, Foot switch, Scaling tips G2x1, G12x1, Scaling tip E60x1, E62x1, Torque wrench, Endo wrench, water pipe, Quick -connector for water, waterproof \"O\" ring, Bottle sealed ring, 700ml water bottle, LED lamp.</p>', NULL, 75, '3', 0.00, 57600.00, 57600.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-07-27-6886093f9b8bd.png', NULL, 1, '2025-07-27 16:05:23', '2025-07-27 16:55:55'),
(389, 'P00339', NULL, 'Woodpecker Uds E Led Ultrasonic Scaler (8 Tips Free)', 'woodpecker-uds-e-led-ultrasonic-scaler-8-tips-free-P00339', '<p>The <strong>UDS-E LED</strong> Ultrasonic Scaler is a cutting-edge dental instrument designed to provide efficient and effective teeth cleaning and dental disease treatment. <strong>Ultrasonic Scaler UDS E-Led</strong>&nbsp;by&nbsp;<strong>woodpecker</strong>&nbsp;is <strong>a multi-function scaler</strong> that works in three different modes i.e general, perio and endo with a feature of <strong>an automatic frequency tracking system</strong>&nbsp;The scaler is equipped with an optical handpiece, providing greater convenience during clinical procedures. It allows for easy handling and maneuverability, ensuring precise and efficient operation. Additionally, the scaler features an auto-water supply function, which simplifies the process and enhances usability.</p><p>One notable aspect of the UDS-E LED scaler is its inner water pipe, constructed from antiseptic material. This design enables the use of various clinical fluids such as hydrogen peroxide, chlorhexidine, and sodium hypochlorite with the auto-water supply system. As a result, the performance of perio and endo procedures is significantly improved.The handpiece of the scaler is detachable and can be autoclaved at temperatures up to 134°C and pressures up to 0.22MPa. This ensures proper sterilization and hygiene maintenance, meeting the stringent standards of dental practice.<br>Automatic frequency tracking is another key feature of the UDS-E LED scaler. This technology ensures that the machine consistently operates at the optimal frequency, providing stable and reliable performance throughout dental procedures.<br><br>With its cutting-edge features and functionality, the UDS-E LED scaler represents a new generation of dental instruments in the global market. It is designed to meet the needs of dental professionals, offering exceptional performance, convenience, and reliability.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Power Supply Input</strong></td><td>220–240V, 50Hz/60Hz, 150mA</td></tr><tr><td><strong>Main Unit Input</strong></td><td>24V, 50Hz/60Hz, 1.3A</td></tr><tr><td><strong>Primary Tip Vibration Excursion</strong></td><td>≤100μm</td></tr><tr><td><strong>Half-Excursion Force</strong></td><td>&lt;2N</td></tr><tr><td><strong>Output Tip Vibration Frequency</strong></td><td>28kHz ± 3kHz</td></tr><tr><td><strong>Output Power</strong></td><td>3W to 20W</td></tr></tbody></table></figure>', '<ul><li>x Main Unit&nbsp;</li><li>1 x Detachable Handpiece&nbsp;</li><li>1 x Power Supply</li><li>1 x Foot Switch</li><li>1 x Scaling Tip G1</li></ul><p>1 x&nbsp;Scaling Tip G4</p><ul><li>1 x Scaling Tip G5</li><li>1 x&nbsp;Scaling Tip G6</li><li>1 x&nbsp;Scaling Tip P1</li><li>1 x&nbsp;Scaling Tip P3</li><li>1 x&nbsp;Scaling Tip P4D</li><li>1 x Endo Chuck E1</li><li>1 x Tip Holder 2#</li><li>1 x Torque Wrench</li><li>1 x Endo Wrench</li><li>1 x Water Bottle 500ml</li><li>1 x Water Bottle 350ml</li><li>1 x LED Lamp</li><li>1 x Instruction of LED Lamp Replacement</li><li>1 x&nbsp;Instruction Manual</li><li>1 x Qualified Certification</li><li>1 x Packing List</li></ul><p><strong>O-ring Pack</strong></p><ul><li>Handpiece Decoration Ring</li><li>Waterproof O-Ring</li><li>Sealed Ring&nbsp;</li></ul>', NULL, 75, '3', 0.00, 42000.00, 42000.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-07-27-688601d5cc499.png', NULL, 1, '2025-07-27 16:24:17', '2025-07-27 16:24:17');
