(390, 'P00340', NULL, 'Woodpecker UDS-J Ultrasonic Scaler (5 scaler Tips FREE)', 'woodpecker-uds-j-ultrasonic-scaler-5-scaler-tips-free-P00340', '<p>The <strong>UDS-J Ultrasonic Scaler</strong> is an advanced dental device designed to aid in the effective cleaning and treatment of teeth. This state-of-the-art scaler features a sealed handpiece, ensuring optimal hygiene and preventing cross-contamination between patients. The handpiece\'s design allows for easy maneuverability and reduces hand fatigue during extended use. With two specialized modes, scaling, and perio, the UDS-J scaler offers versatility in addressing various oral hygiene needs. The scaling mode is designed for general plaque and calculus removal on the tooth surfaces, while the perio mode focuses on subgingival cleaning and treatment of periodontal pockets. This allows dental professionals to provide tailored treatments and comprehensive oral care.</p><p>Equipped with advanced ultrasonic technology, the UDS-J scaler produces powerful vibrations at an optimal frequency. These vibrations, transmitted through the scaling tips, create mechanical energy that effectively breaks down and removes stubborn deposits from the teeth\'s surfaces and interdental spaces. The scaler\'s precise control system allows dental professionals to adjust the power output, ensuring accurate and efficient cleaning while minimizing discomfort for patients. Furthermore, the <strong>UDS-J scaler</strong> incorporates an adjustable water flow system that helps flush away debris and cool the treated area. This continuous water spray enhances visibility and maintains a clean operating field, enabling precise and controlled scaling.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Power Supply Input</strong></td><td>220–240V, 50Hz/60Hz, 150mA</td></tr><tr><td><strong>Main Unit Input</strong></td><td>24V, 50Hz/60Hz, 1.3A</td></tr><tr><td><strong>Output Power</strong></td><td>3W to 20W</td></tr><tr><td><strong>Tip Vibration Frequency</strong></td><td>30kHz ± 3kHz</td></tr><tr><td><strong>Half-Excursion Force</strong></td><td>&lt;2N</td></tr><tr><td><strong>Primary Tip Vibration Excursion</strong></td><td>≤100μm</td></tr><tr><td><strong>Main Unit Fuse</strong></td><td>T1.6AL, 250V</td></tr><tr><td><strong>Power Supply Fuse</strong></td><td>T0.5AL, 250V</td></tr><tr><td><strong>Water Pressure</strong></td><td>0.01MPa to 0.5MPa</td></tr><tr><td><strong>Main Unit Weight</strong></td><td>0.8 kg</td></tr><tr><td><strong>Power Supply Weight</strong></td><td>1.0 kg</td></tr></tbody></table></figure>', '<ul><li>1x Main unit</li><li>1 x Handpiece</li><li>1 x Footswitch</li><li>5 x Tips (3 x G1, 1 x G2, 1 x P1)</li><li>1 x Adapter</li><li>1 x Torque wrench</li><li>1 x Operation manual&nbsp;</li></ul>', NULL, 75, '3', 0.00, 13800.00, 13800.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-07-27-6886053493388.png', NULL, 1, '2025-07-27 16:38:40', '2025-07-27 16:42:47'),
(391, 'P00341', NULL, 'Woodpecker Ultrasonic Scaler UDS-J2 LED', 'woodpecker-ultrasonic-scaler-uds-j2-led-P00341', '<p>The <strong>Woodpecker Ultrasonic Scaler UDS-J2 LED</strong> is a high-performance dental scaler designed for efficient and precise dental cleaning procedures. It features a <strong>sealed handpiece with an integrated LED light</strong>, providing enhanced visibility for improved clinical accuracy. The <strong>handpiece sleeve is autoclavable</strong>, ensuring optimal hygiene and infection control between patients. With <strong>automatic frequency tracking</strong>, the device continuously monitors and adjusts to maintain peak performance. It also <strong>automatically identifies and locks onto the best working frequency</strong>, delivering consistent and reliable results. This scaler is an ideal choice for modern dental practices looking for durability, safety, and superior functionality.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Power Input</strong></td><td>110V~ 50Hz/60Hz220–240V~ 50Hz/60Hz</td></tr><tr><td><strong>Output Power</strong></td><td>3W ~ 20W</td></tr><tr><td><strong>Frequency</strong></td><td>30kHz ± 3kHz</td></tr><tr><td><strong>Water Pressure</strong></td><td>0.1 bar ~ 5 bar (0.01 MPa ~ 0.5 MPa)</td></tr><tr><td><strong>Main Unit Weight</strong></td><td>1.7 kg</td></tr><tr><td><strong>Dimensions</strong></td><td>137 cm × 95 cm × 213 cm <i>(Check if units are correct)</i></td></tr></tbody></table></figure><p>⚠️ <strong>Note:</strong> The dimensions listed (137cm × 95cm × 213cm) seem unusually large for a dental scaler. You might want to verify if these should be <strong>millimeters (mm)</strong> instead of <strong>centimeters (cm)</strong>. Likely correct: <strong>137mm × 95mm × 213mm</strong>.</p>', NULL, NULL, 75, '3', 0.00, 17100.00, 17100.00, 1, 1, 105, NULL, 0, 0, NULL, NULL, '2025-07-27-6886081f8f26d.png', NULL, 1, '2025-07-27 16:51:07', '2025-07-27 16:51:07'),
(392, 'P00342', NULL, 'Woodpecker Uds-N3 LED Built in Ultrasonic Scaler', 'woodpecker-uds-n3-led-built-in-ultrasonic-scaler-P00342', '<p>The <strong>Woodpecker Ultrasonic Scaler UDS-N3 LED</strong> is a high-quality, built-in piezoelectric scaler designed for use in dental clinics. Suitable for both adults and children, it features a <strong>detachable handpiece with built-in LED light</strong>, providing enhanced visibility during procedures. The handpiece is <strong>autoclavable</strong>, ensuring effective sterilization and infection control. The scaler supports <strong>scaling and endodontic functions</strong>, with <strong>automatic frequency tracking</strong> that continuously adjusts for optimal performance. It incorporates <strong>accurate feedback control and constant power output</strong>, offering greater precision and a more comfortable experience for patients. The unit operates on <strong>24V~ 50Hz/60Hz, 1.3A</strong> input and includes the <strong>HW-5L detachable handpiece</strong>. Certified by <strong>CE, ISO, and FDA</strong>, and manufactured in <strong>Guangxi, China</strong>, this scaler complies with international medical device standards. With a <strong>production capacity of 1000 units per month</strong> and a <strong>Type 2 medical device registration (GSYJX2230082)</strong>, it is a reliable and efficient choice for modern dental practices.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Main Unit Input</strong></td><td>24V~, 50Hz/60Hz, 1.3A</td></tr><tr><td><strong>Output Power</strong></td><td>3W ~ 20W</td></tr><tr><td><strong>Frequency</strong></td><td>28kHz ± 3kHz</td></tr><tr><td><strong>Water Pressure</strong></td><td>0.1 bar ~ 5 bar (0.01 MPa ~ 0.5 MPa)</td></tr><tr><td><strong>Main Unit Weight</strong></td><td>0.2 kg</td></tr><tr><td><strong>Dimensions</strong></td><td>74 mm × 56 mm × 38 mm</td></tr><tr><td><strong>Parameter</strong></td><td><strong>Specification</strong></td></tr><tr><td><strong>Main Unit Input</strong></td><td>24V~, 50Hz/60Hz, 1.3A</td></tr><tr><td><strong>Output Power</strong></td><td>3W ~ 20W</td></tr><tr><td><strong>Frequency</strong></td><td>28kHz ± 3kHz</td></tr><tr><td><strong>Water Pressure</strong></td><td>0.1 bar ~ 5 bar (0.01 MPa ~ 0.5 MPa)</td></tr></tbody></table></figure>', '<ul><li>Main unit 1 pc</li><li>Detachable handpiece HW-5L 1 pc</li><li>Cable 1 pc</li><li>Scaling Tips G1T 2 pcs G2T G4T P1T E1T 1 pcs</li><li>Torque wrench TW-1L 1 pc</li><li>Endo wrench EW-1L 1 pc</li><li>Water pipe 1 pc</li><li>Potentiometer know 1 pc</li><li>Potentiometer and electonic pipe 1 pc</li><li>Cutting sleeve (for handpiece) 1 pc</li><li>Waterproof O ring 4 pcs</li><li>Handpiece decrative ring 1pc</li></ul>', NULL, 75, '3', 0.00, 18680.00, 18680.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-07-27-68861949a1d77.png', NULL, 1, '2025-07-27 18:04:21', '2025-07-27 18:04:21'),
(393, 'P00343', NULL, 'Woodpecker Ultrasonic Piezo Scaler UDS-N6 Built-in', 'woodpecker-ultrasonic-piezo-scaler-uds-n6-built-in-P00343', '<p>The Woodpecker UDS-N6 Built-in Ultrasonic Piezo Scaler is a compact and efficient dental scaler designed to seamlessly integrate with dental chairs. Featuring a high-quality aluminum alloy detachable handpiece (HW-6) with built-in LED illumination, it ensures superior visibility during procedures. The handpiece is autoclavable, ensuring optimal hygiene and durability, and its metal construction minimizes the risk of cracking. This scaler supports a range of functions including scaling, periodontal, and optional endodontic treatments, making it versatile for various clinical needs. It is compatible with EMS handpieces and tips, enabling flexibility in usage. Designed for both supragingival and subgingival scaling, the UDS-N6 utilizes microcomputer control and automatic frequency tracking for stable and precise performance. Its compact design is 30% smaller than the UDS-N2 model, helping save space on the dental chair tray and making it an ideal choice for modern dental practices.</p><p>&nbsp;</p><p>&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Technical Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Main Unit Input</strong></td><td>~24V 50Hz</td></tr><tr><td><strong>Output Power</strong></td><td>38VA</td></tr><tr><td><strong>Frequency</strong></td><td>28kHz ± 3kHz</td></tr><tr><td><strong>Main Unit Weight</strong></td><td>0.13 Kg</td></tr><tr><td><strong>Dimensions</strong></td><td>59mm x 57mm x 33mm</td></tr></tbody></table></figure>', '<ul><li>1 x Main Unit</li><li>1 x Detachable handpiece</li><li>1 x LED</li><li>1 x Cable</li><li>1 x Scaling Tip G4</li><li>1 x Scaling Tip G5</li><li>1 x Scaling Tip G12</li><li>1 x Scaling Tip P3</li><li>1 x Scaling Tip P8</li><li>1 x Torque Wrench</li><li>1 x Water Pipe</li><li>1 x Potentiometer Knob</li><li>1 x Power Adjustment Dial</li><li>1 x Power Potentiometer, wiring</li><li>1 x Cutting Sleeve (for handpiece)</li><li>1 x Waterproof \"O\" Ring</li><li>1 x Handpiece Lock Ring</li><li>1 x Two-sided adhesive foam</li><li>1 x Nylon Cable Tie</li><li>1 x Instruction Manual</li><li>1 x Qualified Certification</li><li>1 x Warrenty Card</li><li>1 x Packaging List</li></ul>', NULL, 75, '3', 0.00, 32000.00, 32000.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-07-28-688716d86e44e.png', NULL, 1, '2025-07-28 12:06:12', '2025-07-28 12:06:12'),
(394, 'P00344', NULL, 'Woodpecker Ultrasonic Scalar & Air Polisher PT-A', 'woodpecker-ultrasonic-scalar-air-polisher-pt-a-P00344', '<p><strong>Woodpecker PT-A</strong> is an advanced dual-function dental device that integrates ultrasonic scaling and air polishing into a single, compact system designed for comprehensive dental hygiene and periodontal treatment. With its intelligent handpiece recognition, it automatically switches between scaling and polishing modes based on the handpiece selected, offering seamless operation for clinicians.</p><p>This all-in-one device is ideal for a range of procedures including supragingival and subgingival scaling, periodontal therapy, endodontic irrigation, and cosmetic polishing. The unit features a user-friendly <strong>touchscreen LCD panel</strong> for intuitive control and real-time monitoring of water flow, power, and air pressure settings.</p><p>The <strong>ultrasonic handpiece</strong> delivers high-frequency vibrations with a rounded tip trajectory to ensure effective yet painless scaling without damaging enamel or cementum. Meanwhile, the <strong>air polishing system</strong> uses sodium bicarbonate-based powders to gently remove plaque and stains from both natural teeth and orthodontic appliances, even preparing surfaces for bonding, restorations, or whitening procedures.</p><p>Engineered for efficiency and hygiene, the PT-A features <strong>detachable, autoclavable handpieces</strong>, a <strong>three-piece air polishing nozzle</strong>, and a <strong>cone-structured powder tank</strong> to reduce residual powder. It supports chemical irrigation using solutions like <strong>chlorhexidine, hydrogen peroxide, and sodium hypochlorite</strong>, improving the effectiveness of root canal and periodontal treatments.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Technical Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Model</strong></td><td>PT-A</td></tr><tr><td><strong>Power Adapter Input</strong></td><td>220–240V~ 50Hz/60Hz, 400mA</td></tr><tr><td><strong>Power Adapter Output</strong></td><td>25V~ 50Hz/60Hz, 2.8A</td></tr><tr><td><strong>Main Unit Input</strong></td><td>25V~ 50Hz/60Hz, 2.8A</td></tr><tr><td><strong>Output Vibrating Frequency (Ultrasonic Tip)</strong></td><td>30 ± 5 kHz</td></tr><tr><td><strong>Max Vibration Amplitude of Tip</strong></td><td>90μm (±50%)</td></tr><tr><td><strong>Output Power (Tip)</strong></td><td>3W–20W</td></tr><tr><td><strong>Semi-offset Force (Max)</strong></td><td>5N (±50%)</td></tr><tr><td><strong>Water Inlet Pressure</strong></td><td>1–5 bar (0.1–0.5 MPa)</td></tr><tr><td><strong>Air Inlet Pressure</strong></td><td>5.5–7.5 bar (0.55–0.75 MPa)</td></tr><tr><td><strong>Water Outlet Temp. (Air Polishing System)</strong></td><td>0–45°C</td></tr><tr><td><strong>Main Unit Dimensions</strong></td><td>330mm × 280mm × 120mm</td></tr><tr><td><strong>Handpiece Sterilization</strong></td><td>Autoclavable at 134°C, 2.0–2.3 bar</td></tr><tr><td><strong>Operation Mode</strong></td><td>Continuous Operation</td></tr><tr><td><strong>Electric Shock Protection Class</strong></td><td>Class I, B-type Applied Part</td></tr><tr><td><strong>Waterproof Rating</strong></td><td>IPX0 (Main Unit), IPX1 (Foot Pedal)</td></tr><tr><td><strong>Fuses - Main Unit</strong></td><td>T5AH 250V</td></tr><tr><td><strong>Fuses - Power Adapter</strong></td><td>T1.0AL 250V</td></tr><tr><td><strong>Operating Temperature Range</strong></td><td>+5°C to +40°C</td></tr><tr><td><strong>Relative Humidity Range</strong></td><td>30%–75%</td></tr><tr><td><strong>Atmospheric Pressure Range</strong></td><td>70kPa–106kPa</td></tr><tr><td><strong>Cooling Water Temperature</strong></td><td>+5°C to +25°C</td></tr></tbody></table></figure>', '<ul><li>1 x Main unit</li><li>1 x Ultrasonic handpiece</li><li>1 x Multi-functional foot pedal</li><li>1 x&nbsp;Power adapter</li><li>1 x&nbsp;Tip P59</li><li>2 x&nbsp;Water bottle</li><li>2 x&nbsp;Needle</li><li>2 x&nbsp;Water pipe Air pipe</li><li>2 x&nbsp;Powder tank</li><li>2 x&nbsp;Air polishing handpiece</li><li>2 x&nbsp;Torque wrench</li><li>3 x&nbsp;Torque wrench</li></ul>', NULL, 75, '3', 0.00, 298000.00, 298000.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-07-28-6887185f7eddf.png', NULL, 1, '2025-07-28 12:12:43', '2025-07-28 12:12:43'),
(397, 'P00345', NULL, 'Dynamic® DU892 Portable Dental Unit', 'dynamic-du892-portable-dental-unit-P00345', '<p>The Dynamic® DU892 Portable Dental Unit is a highly functional and user-friendly solution designed for dental professionals who require mobility without compromising performance. Housed in a lightweight, stylish rod-style box, this unit is easy to transport and ideal for use in a variety of environments, including dental clinics, hospitals, military, and outdoor dental care setups. Its fashionable design, available in blue or grey coating, helps put patients at ease during treatment. Engineered with a compact structure tailored to dentists’ operational habits, it offers intuitive use and smooth workflow. The unit integrates essential dental systems, including air, water, suction, and drainage, delivering a complete treatment setup in one compact form. Featuring a powerful, oil-free motor that ensures stable performance and minimal maintenance, it boasts a service life exceeding 15,000 hours. The drainage bottle is designed for easy removal and disinfection, promoting hygiene and convenience. With foot control operation, simple part installation, and eco-friendly waste disposal, the DU892 ensures both user and patient safety. It comes with a 1-year warranty, making it a reliable choice for modern, mobile dentistry.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Technical Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Voltage (V)</strong></td><td>110–240</td></tr><tr><td><strong>Frequency (Hz)</strong></td><td>50/60</td></tr><tr><td><strong>Power (W)</strong></td><td>550</td></tr><tr><td><strong>Tank Capacity (L)</strong></td><td>4</td></tr><tr><td><strong>Net Weight (KG)</strong></td><td>26</td></tr><tr><td><strong>Noise Level (dB)</strong></td><td>≤60</td></tr><tr><td><strong>Dimensions (mm)</strong></td><td>450 × 310 × 680</td></tr><tr><td><strong>SKU</strong></td><td>DL-D-DU892-M4-110 / DL-D-DU892-B2-110 /DL-D-DU892-M4-220 / DL-D-DU892-B2-220</td></tr></tbody></table></figure>', '<ul><li>3-way Syringe</li><li>Saliva Ejector</li><li>compressor</li><li>L.S.H Tube</li><li>H.S.H Tube</li></ul>', NULL, 71, '3', 0.00, 130000.00, 130000.00, 2, 2, 52, NULL, 0, 0, NULL, NULL, '2025-07-28-6887225e46548.png', NULL, 1, '2025-07-28 12:55:22', '2025-07-28 14:00:42'),
(398, 'P00346', NULL, 'Dynamic® DU893 Portable Dental Unit', 'dynamic-du893-portable-dental-unit-P00346', '<p>The Dynamic® DU893 Portable Dental Unit is an all-in-one, high-performance solution tailored for dental professionals seeking mobility and efficiency. Designed in a stylish, lightweight rod-box format, it allows for effortless transportation and setup, making it ideal for use in dental hospitals, clinics, military fieldwork, and outdoor treatment environments. With its sleek design available in blue or grey, the unit creates a calming atmosphere for patients. Engineered to align with the operational habits of dentists, it features a compact structure and intuitive layout, ensuring ease of use and efficiency during procedures.</p><p>This advanced unit comes fully integrated with essential dental systems including a powerful oil-free air compressor, ultrasonic scaler, LED curing light, suction, drainage, air, and water systems—delivering complete functionality in a portable format. It operates simply via a foot control pad and requires minimal setup. Built with a high-quality motor and robust outer casing, it offers excellent durability with a service life exceeding 15,000 hours and a 1-year warranty. The oil-free design reduces maintenance needs, while the detachable drainage bottle ensures easy disinfection. Environmentally conscious, the unit safely separates waste to prevent cross-contamination, making the DU893 a safe, reliable, and eco-friendly choice for modern mobile dental care.</p><p><strong>Standard Features:</strong><br>4 hole or 2 hole High handpiece tube 1 pc<br>4 hole or 2 hole Low handpiece tube 1 pc<br>3-way syringe 1 pc<br>Saliva ejector 1 pc<br>LED curing light 1 pc<br>Ultrasonic Scaler 1 pc<br>Compressor 1 set</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Technical Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Voltage</strong></td><td>100V–240V</td></tr><tr><td><strong>Power</strong></td><td>0.55 KW</td></tr><tr><td><strong>Air Flow</strong></td><td>40 L/min</td></tr><tr><td><strong>Tank Capacity</strong></td><td>5 L</td></tr><tr><td><strong>Net Weight</strong></td><td>28 KG</td></tr><tr><td><strong>Dimensions</strong></td><td>450 × 310 × 680 mm</td></tr><tr><td><strong>Noise Level</strong></td><td>≤ 60 dB(A)</td></tr></tbody></table></figure>', NULL, NULL, 71, '3', 0.00, 150000.00, 150000.00, 3, 3, 52, NULL, 0, 0, NULL, NULL, '2025-07-28-688724d7d33f3.png', NULL, 1, '2025-07-28 13:05:55', '2025-07-28 13:59:46'),
(399, 'P00347', NULL, 'OIL FREE COMPRESSOR DA5002 1.5HP', 'oil-free-compressor-da5002-15hp-P00347', '<p>Silent, piston‑type, oil‑free dental compressor with advanced filtration, thermal protection, and epoxy‑coated tank. Suitable for 1 dental operatory; quiet at ~≤ 60 dB with oversized tank for smoothing pressure.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Technical Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Power</strong></td><td>1.5 HP</td></tr><tr><td><strong>Tank Capacity</strong></td><td>50 L</td></tr><tr><td><strong>Air Flow</strong></td><td>230 L/min (at 0 bar)</td></tr><tr><td><strong>Max Pressure</strong></td><td>8 bar</td></tr><tr><td><strong>Noise Level</strong></td><td>52–59 dB</td></tr><tr><td><strong>RPM</strong></td><td>~1400</td></tr><tr><td><strong>Voltage</strong></td><td>100–240 V</td></tr></tbody></table></figure>', '<ul><li>Carton: 760×480×880 mm</li><li>Gross weight: 60–65 kg</li></ul>', NULL, 261, '7', 0.00, 102000.00, 102000.00, 3, 3, 52, NULL, 0, 0, NULL, NULL, NULL, NULL, 1, '2025-07-28 13:16:45', '2025-07-28 14:05:08'),
(400, 'P00348', NULL, 'OIL FREE COMPRESSOR DA7001 1.00HP', 'oil-free-compressor-da7001-100hp-P00348', '<p>Entry-level oil-free compressor; good for single-unit support where space is limited.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Technical Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Power</strong></td><td>1.0 HP</td></tr><tr><td><strong>Tank Capacity</strong></td><td>~30 L</td></tr><tr><td><strong>Operation</strong></td><td>Silent Operation</td></tr><tr><td><strong>Design</strong></td><td>Oil-Free</td></tr></tbody></table></figure>', '<ul><li>Carton: ~600×400×600 mm</li><li>Gross weight: ~35 kg</li></ul>', NULL, 261, '7', 0.00, 50000.00, 50000.00, 2, 2, 52, NULL, 0, 0, NULL, NULL, NULL, NULL, 1, '2025-07-28 13:16:45', '2025-07-28 14:05:30'),
(401, 'P00349', NULL, 'OIL FREE COMPRESSOR DA7002 2.00HP', 'oil-free-compressor-da7002-200hp-P00349', '<p>Mid-range, robust compressor for heavier use, with multi‑phase filtration and consistent pressure delivery.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Technical Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Power</strong></td><td>2.0 HP</td></tr><tr><td><strong>Tank Capacity</strong></td><td>~50 L</td></tr><tr><td><strong>Flow Rate</strong></td><td>High Flow Rate</td></tr><tr><td><strong>Design</strong></td><td>Oil-Free &amp; Quiet</td></tr></tbody></table></figure>', '<ul><li>Carton: Larger format</li><li>Gross weight: ~70 kg</li></ul>', NULL, 261, '7', 0.00, 107500.00, 107500.00, 3, 3, 52, NULL, 0, 0, NULL, NULL, NULL, NULL, 1, '2025-07-28 13:16:45', '2025-07-28 14:05:53'),
(402, 'P00350', NULL, 'OIL FREE COMPRESSOR DA7003 3.00HP', 'oil-free-compressor-da7003-300hp-P00350', '<p>High-capacity dental compressor suited for multi-chair clinics or lab use demanding higher air volumes.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Technical Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Power</strong></td><td>3.0 HP</td></tr><tr><td><strong>Tank Capacity</strong></td><td>~70 L</td></tr><tr><td><strong>Build</strong></td><td>Heavy Duty</td></tr><tr><td><strong>Application</strong></td><td>Suitable for Multi-Chair Use</td></tr></tbody></table></figure>', '<ul><li>Carton: Heavy-duty</li><li>Gross weight: ~90 kg</li></ul>', NULL, 261, '7', 0.00, 164000.00, 164000.00, 2, 2, 52, NULL, 0, 0, NULL, NULL, '2025-07-28-68872af25d40f.png', NULL, 1, '2025-07-28 13:16:45', '2025-07-28 14:06:28'),
(403, 'P00351', NULL, 'DENTAL PORTABLE CHAIR(DU32L) CHAIR & LIGHT & STOOL', 'dental-portable-chairdu32l-chair-light-stool-P00351', '<p>Lightweight, foldable dental chair set with LED light, spittoon, tray &amp; stool. Made of high-strength aluminum alloy, portable bag included. Ideal for mobile clinics and field use.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Technical Parameter</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td><strong>Chair Load Capacity</strong></td><td>135 kg</td></tr><tr><td><strong>Folded Size</strong></td><td>890 × 590 × 350 mm</td></tr><tr><td><strong>Light Max Height</strong></td><td>1700 mm</td></tr><tr><td><strong>Headrest</strong></td><td>Adjustable</td></tr><tr><td><strong>Backrest Tilt Range</strong></td><td>110° – 175°</td></tr><tr><td><strong>Headrest Travel</strong></td><td>80 mm</td></tr></tbody></table></figure>', '<ul><li>Chair: 910×630×390 mm</li><li>Light: 930×140×140 mm</li><li>Stool: 700×360×260 mm</li></ul>', NULL, 71, '3', 0.00, 75000.00, 75000.00, 1, 1, 52, NULL, 0, 0, NULL, NULL, '2025-07-28-68872bac29ee0.png', NULL, 1, '2025-07-28 13:35:04', '2025-07-28 13:35:04'),
(406, 'P00352', NULL, 'STERIPULP LIQUID 15ML', 'steripulp-liquid-15ml-P00352', '<p><strong>SafeEndo Steripulp Liquid</strong></p><p>SteriPulp is used as an antiseptic for the treatment of infected root canals in complicated pulpitis and resection of the upper part of the tooth root,&nbsp;Based on phenol, formic aldehyde (non less than 30%), with dexamethasone. Phenol and Formaldehyde are antiseptics denaturalizing microorganisms\' proteins, thus providing an antiseptic effect, deep mummification, and root canal sterilization. The liquid is produced for use in an aggressive biological medium with a temperature range between 32°C and 42°C (in the oral cavity at the temperature (of 37±1)°C and humidity of 60-90 %).</p><p><strong>INDICATIONS</strong></p><ul><li>Infected tooth root canals in case of complicated pulpitis</li><li>Treatment with an antiseptic agent during an apicoectomy</li><li>Infected root canals in Re-treatment cases</li></ul><p><strong>CONTRAINDICATIONS</strong></p><ul><li>Drug idiosyncrasy</li><li>Do not misuse</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>Formaldehyde, Phenol, Dexamethasone, and filler</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5°C to 25°C</td></tr><tr><td><strong>Storage Conditions</strong></td><td>- Keep in a dry place - Tightly close the container after use</td></tr><tr><td><strong>Expiry Warning</strong></td><td>Do not use after the expiry date</td></tr><tr><td><strong>Shelf Life</strong></td><td>3 years</td></tr></tbody></table></figure>', '<ul><li>1 x 15ml bottle&nbsp;with a pipette-cap</li></ul>', NULL, 197, '3', 0.00, 2160.00, 2160.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-68874ccfb2147.png', NULL, 1, '2025-07-28 15:56:27', '2025-08-05 10:10:49'),
(407, 'P00353', NULL, 'SafeEndo Socket Cure', 'safeendo-socket-cure-P00353', '<p><strong>SafeEndo Socket Cure</strong></p><p><strong>Socket Cure</strong> is a fiber paste with a specific odor used for antiseptic treatment of extraction<br>socket. Socket Cure is not resorbable. Paste washes out of sockets over time, which helps in wound healing. During follow-up, there’s no need to extract paste remains, i.e. no soft tissue traumatizing.</p><ul><li><strong>Butamben</strong> is a local anesthetic, that acts by inhibiting the voltage-gated calcium channels in dorsal&nbsp;root ganglion neurons.</li><li><strong>Iodoform </strong>– antiseptic, possesses a durable antibacterial effect</li><li><strong>Eugenol</strong> enhances its antiseptic effect and thanks to its analgesic benefit, relieves pain</li><li>Excipients, provide a sustained therapeutic effect</li></ul><p><strong>INDICATION:</strong></p><p><strong>SocketCure is used during:</strong></p><ul><li>Socket treatment after tooth extraction</li><li>Alveoalgia prophylaxis</li><li>Acute alveolitis treatment</li></ul><p><strong>CONTRAINDICATIONS</strong></p><ul><li>Iodine or its derivatives allergy</li><li>Do not use for patients with a blood-clotting disorder</li><li>Do not swallow</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>- Butamben 26% - Iodoform 16% - Eugenol 14% - Excipients</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5°C to 25°C</td></tr><tr><td><strong>Storage Instructions</strong></td><td>- Tightly close the jar after use - Do not use after the expiry date</td></tr><tr><td><strong>Shelf Life</strong></td><td>3 years</td></tr></tbody></table></figure>', '<ul><li>1 X 15g Jar</li></ul>', NULL, 320, '3', 0.00, 2592.00, 2592.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-68874eb389709.png', NULL, 1, '2025-07-28 16:04:31', '2025-08-04 15:49:20'),
(408, 'P00354', NULL, 'SafeEndo Smart Temp', 'safeendo-smart-temp-P00354', '<p><strong>SafeEndo Smart Temp</strong></p><p>SmartTemp is a paste consistency, adaptive in nature temporary filling material which hardens upon contact with moisture in Oral Cavity. The marginal seal of the material is excellent, so it makes tight seals and closure of the working area.</p><p><strong>INDICATION</strong></p><ul><li>As a temporary filling material for Root Canal Procedures and Cavity Restoration and Inlays and implant abutment sealer.</li></ul><p><strong>CONTRAINDICATION</strong></p><ul><li>Drug idiosyncrasy Use carefully if a person is allergic to PVC resin</li><li>Do not use directly on the exposed Pulp area as a temporary or permanent closure.</li></ul><p><br>&nbsp;</p>', '<p>&nbsp;</p><figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>Zinc Oxide, Calcium Sulphate, Poly Vinyl Acetate Resin, Flavours, Additives</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5°C to 25°C</td></tr><tr><td><strong>Storage Instructions</strong></td><td>- Store in a well-sealed container - Close materials tightly after use</td></tr><tr><td><strong>Expiry Warning</strong></td><td>Do not use after the expiry date</td></tr><tr><td><strong>Shelf Life</strong></td><td>2.5 years</td></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', '<ul><li>1 x 40g Jar</li></ul>', NULL, 201, '3', 0.00, 336.00, 336.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-68874fdc83023.png', NULL, 1, '2025-07-28 16:09:28', '2025-08-04 13:40:57'),
(409, 'P00355', NULL, 'SafeEndo Smart Retract Syringe', 'safeendo-smart-retract-syringe-P00355', '<p><strong>afeEndo Smart Retract Syringe</strong></p><p>Hemostatic Gel contains 25% of Aluminum chloride, which provides fast and effective hemostasis and does not cause hard and soft tooth tissue coloring. Smart Retract gel is water-based and easy to wash out with water. Gingival retraction takes place immediately and lasts for 20-30 minutes. Dental product is produced for use in aggressive biological medium with a temperature range between 32°C and 42°C (in the oral cavity at the temperature (of 37±1)°C and humidity of 60-90 %).</p><p><strong>INDICATIONS</strong></p><ul><li>Gingival Retraction gel after the crown bridge, cavity class ii, veneer cutting</li><li>Capillary Gingival bleeding at the time of restoration</li><li>Prevent Gingival capillary bleeding</li><li>Stop Gingival leakage</li><li>Gingival retraction for impression making and cervical caries treatment.</li></ul><p><strong>CONTRAINDICATIONS</strong></p><ul><li>Drug idiosyncrasy</li><li>Use with great care for the allergic patient</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>- Aluminum chloride (25%) - Benzalkonium chloride - Gel forming agent</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5°C to 25°C</td></tr><tr><td><strong>Storage Instructions</strong></td><td>- Keep in a dry place - Tightly close the container after use</td></tr><tr><td><strong>Expiry Warning</strong></td><td>Do not use after the expiry date</td></tr><tr><td><strong>Shelf Life</strong></td><td>3 years</td></tr></tbody></table></figure>', '<ul><li>1 x 5ml Syringe</li><li>5 x Dispensing Tips</li></ul>', NULL, 210, '3', 0.00, 1120.00, 1120.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-688750ec958d4.png', NULL, 1, '2025-07-28 16:14:00', '2025-08-04 13:39:34'),
(410, 'P00356', NULL, 'SafeEndo SmartRetract Hemostatic Liquid 15ml', 'safeendo-smartretract-hemostatic-liquid-15ml-P00356', '<p>SafeEndo <strong>SmartRetract Hemostatic Liquid</strong>, presented in a convenient 15ml euro dropper bottle (REF 002-03-015), emerges as an advanced solution for precise gingival retraction and efficient hemostasis in dental procedures. Infused with a powerful blend of Aluminium Chloride (25%), Benzalkonium Chloride, and a gel-forming agent, this innovative formula sets itself apart as a reliable aid for preventing gingival capillary bleeding, arresting gingival leakage, and facilitating gingival retraction for procedures like impression making and cervical caries treatment.</p><p>Boasting a unique advantage, the product demonstrates high efficiency as a hemostatic and astringent agent, providing immediate retraction with a lasting effect of 20-30 minutes. Its user-friendly design is highlighted by the inclusion of a syringe with dispensing tips, ensuring precise application and ease of use. A noteworthy feature is its swift removal with a simple jet of water, leaving no residue. Importantly, the SafeEndo SmartRetract Hemostatic Liquid avoids discoloration when in contact with tissues and materials, ensuring a clean and professional outcome. With a perfect balance of efficacy and convenience, this product stands as a trusted choice for dental professionals seeking a dependable solution for gingival retraction and hemostasis in their clinical practice.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Function</strong></td><td>High-efficient hemostatic and astringent agent</td></tr><tr><td><strong>Effect Duration</strong></td><td>Immediate retraction with prolonged effect (20–30 minutes)</td></tr><tr><td><strong>Rinsing</strong></td><td>Easily washed away with a jet of water</td></tr><tr><td><strong>Tissue Compatibility</strong></td><td>No discoloration of contacting tissues and materials</td></tr><tr><td><strong>Application Method</strong></td><td>Easy to use with syringe and flexible dispensing tips</td></tr></tbody></table></figure>', '<ul><li>1 x&nbsp;Liquid (15 ml)</li></ul>', NULL, 210, '3', 0.00, 816.00, 816.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-688752156f22b.png', NULL, 1, '2025-07-28 16:18:57', '2025-08-04 12:43:21'),
(411, 'P00357', NULL, 'SafeEndo Smart Prep Liquid Root Canal Irrigant - 100ml', 'safeendo-smart-prep-liquid-root-canal-irrigant-100ml-P00357', '<p>SafeEndo Smart Prep Liquid Root Canal Irrigant, available in a 100ml solution, represents a cutting-edge advancement in endodontic irrigation. Developed by SafeEndo, a leader in endodontic solutions, this irrigant is meticulously formulated to enhance root canal disinfection, providing clinicians with a reliable and effective tool for optimal endodontic outcomes.</p><p><strong>Key Features:</strong></p><p><strong>Triple-Action Formula:</strong> SafeEndo Smart Prep boasts a triple-action formula designed for superior root canal disinfection. This formulation includes antibacterial agents, tissue-dissolving components, and smear layer removal capabilities, ensuring a comprehensive approach to cleaning and disinfecting the root canal system.</p><p><strong>Advanced Smear Layer Removal:</strong> The irrigant is specifically engineered for advanced smear layer removal, facilitating the elimination of debris and organic material from the root canal walls. This feature contributes to the establishment of a clean and biocompatible environment for subsequent endodontic procedures.</p><p><strong>Enhanced Tissue Dissolution:</strong> SafeEndo Smart Prep incorporates tissue-dissolving properties to effectively remove pulpal remnants and organic debris within the root canal. This ensures thorough cleaning and debridement, promoting a favorable environment for successful endodontic treatments.</p><p><strong>Benefits:</strong></p><p><strong>Comprehensive Root Canal Disinfection:</strong> The triple-action formula ensures comprehensive root canal disinfection by targeting bacteria, dissolving tissues, and removing smear layers. Clinicians can achieve a high level of cleanliness and disinfection within the root canal system.</p><p><strong>Facilitates Instrumentation:</strong> SafeEndo Smart Prep prepares the root canal system for instrumentation by removing obstacles such as smear layers and organic debris. This facilitates optimal shaping and cleaning during endodontic procedures.</p><p><strong>Biocompatible and Safe:</strong> The irrigant is formulated to be biocompatible and safe for clinical use. Clinicians can trust in the safety of Smart Prep during endodontic procedures, minimizing the risk of adverse reactions and ensuring patient comfort.</p>', NULL, NULL, NULL, 190, '3', 0.00, 768.00, 768.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-6887532669283.png', NULL, 1, '2025-07-28 16:23:30', '2025-08-04 12:38:42'),
(412, 'P00358', NULL, 'SafeEndo Smart Prep EDTA Gel 5ml', 'safeendo-smart-prep-edta-gel-5ml-P00358', '<p><strong>SafeEndo Smart Prep Paste</strong></p><p>The main component is EDTAsalts. After injection into dentine, EDTA forms a complex with dentine calcium, loosens the structure of hard tooth tissues, and makes easier the enlargement of the calcified and sclerous orifice of the canals, cleaning, and formation of hard accessible tooth canals. The lubricating agent is good for endodontic instruments. Water soluble Paste base allows easy and fast washing of the canals. The use of Smart Prep paste with Carbamide peroxide together with the solution of sodium hypochlorite makes a foam because of the active emission of chloride and oxygen. Dental product is produced for use in aggressive biological medium with a temperature range between 32°C and 42°C (in the oral cavity at the temperature<br>(37±1)°C and humidity 60-90 %).</p><p><strong>INDICATIONS</strong></p><ul><li>Revealing and formation of root canal orifice</li><li>Lubricating of dental instruments during chemical and mechanical enlargement of root canals</li></ul><p><strong>CONTRAINDICATIONS</strong></p><ul><li>Drug idiosyncrasy</li><li>Use with great care for the allergic patient</li><li>Do not misuse</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>- EDTA Salts (17%) - Carbamide Peroxide (10%) - Paste Forming Agent</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5°C to 25°C</td></tr><tr><td><strong>Storage Instructions</strong></td><td>- Store in a well-sealed container - Close materials tightly after use - Keep away from fire</td></tr><tr><td><strong>Expiry Warning</strong></td><td>Do not use after the expiry date</td></tr><tr><td><strong>Shelf Life</strong></td><td>3 years</td></tr></tbody></table></figure>', '<ul><li>1 x 5ml Syringe</li><li>5 x Dispensing Tips</li></ul>', NULL, 190, '3', 0.00, 576.00, 576.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-68875439082e0.png', NULL, 1, '2025-07-28 16:28:05', '2025-08-04 12:33:23'),
(413, 'P00359', NULL, 'SafeEndo Smart Prep EDTA Gel 25ml', 'safeendo-smart-prep-edta-gel-25ml-P00359', '<p>SafeEndo <strong>Smart Prep EDTA Gel</strong> is an advanced endodontic solution designed to facilitate the detection and chemical enlargement of root canals, ensuring optimal dental care. This specialized gel is formulated with essential ingredients, including EDTA salts (17%) and Carbamide Peroxide (10%), along with a paste-forming agent. Available in a convenient syringe packaging with options of 5 ml (REF 001-02-005) and 25 ml (REF 001-02-025), this product is meticulously crafted for precision and efficiency in endodontic procedures.</p><p><strong>INDICATIONS :</strong><br>Revealing and formation of root canal orifice<br>Lubricating of dental instruments during chemical and mechanical enlargement of root canals</p><p><br><strong>CONTRAINDICATIONS :</strong><br>Drug idiosyncrasy<br>Use with great care for allergic patient<br>&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Function</strong></td><td>Effective lubricant for endodontic instruments</td></tr><tr><td><strong>Application</strong></td><td>Excellent indication of root canal biomechanical preparation</td></tr><tr><td><strong>Penetration</strong></td><td>Fast penetration of root canal irrigant solution into canals and microtubules</td></tr><tr><td><strong>Rinsing</strong></td><td>Easily washed away with water</td></tr><tr><td><strong>Interaction with NaOCl</strong></td><td>Effervescent effect with Sodium Hypochlorite enhances cleanliness</td></tr><tr><td><strong>Additional Use</strong></td><td>Used as an endodontic whitening material in non-vital aesthetic areas</td></tr></tbody></table></figure>', '<ul><li>1 x Gel (25ml)</li></ul>', NULL, 190, '3', 0.00, 2592.00, 2592.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-688755afc418b.png', NULL, 1, '2025-07-28 16:34:19', '2025-08-04 12:32:41'),
(414, 'P00360', NULL, 'SafeEndo Smart Etch 5ml', 'safeendo-smart-etch-5ml-P00360', '<p><strong>SafeEndo Smart Etch</strong></p><p>SafeEndo Smart Etch is a 37% phosphoric etchant Gel which is used to etch enamel and/or dentin as indicated in the instructions provided with the various dental adhesive systems.</p><p>Gel for etching of enamel and dentine.Within 15-30 sec. after the gel application, the enamel color becomes chalky, which means that the surface gets rough, which increases the adhesion of restoration materials to the enamel surface. After applying gel on the dentine surface, Orthophosphoric acid forms acid phosphates with dentine calcium and smear layer. The gel removes the smear layer, opens dentinal tubules, and changes the surface of the dentine. That provides high adhesion of restorative materials to tooth dentine and enamel.&nbsp;&nbsp;Gel Smart Etch is water-based and can be easily removed with water and air.&nbsp; Dental product is produced for use in aggressive biological medium with a temperature range between 32°C and 42°C (in the oral cavity at the temperature (of 37±1)°C and humidity of 60-90 %).</p><p><strong>INDICATIONS</strong></p><ul><li>Enamel and dentine etching according to the acid etching technique</li></ul><p><strong>CONTRAINDICATIONS</strong></p><ul><li>Drug idiosyncrasy</li><li>Use with great care for the allergic patient</li><li>Don’t misuse.</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>- Orthophosphoric Acid (37%) - Gel-forming agent with an aqueous base</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5°C to 25°C</td></tr><tr><td><strong>Storage Instructions</strong></td><td>- Store in a well-sealed container - Close materials tightly after use</td></tr><tr><td><strong>Expiry Warning</strong></td><td>Do not use after the expiry date</td></tr><tr><td><strong>Shelf Life</strong></td><td>3 years</td></tr></tbody></table></figure>', '<ul><li>1 x 5ml Syringe</li><li>5 x Dispensing Tips</li></ul>', NULL, 145, '3', 0.00, 480.00, 480.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-688757131359d.png', NULL, 1, '2025-07-28 16:40:15', '2025-08-04 12:26:42'),
(415, 'P00361', NULL, 'SafeEndo Smart Etch 25ml', 'safeendo-smart-etch-25ml-P00361', '<p><br>SafeEndo <strong>Smart Etch 25ml</strong> is an advanced dental etching gel meticulously crafted to elevate the precision and efficacy of enamel and dentin preparation through the acid etching technique. Boasting a potent formulation with 37% orthophosphoric acid, this innovative gel ensures optimal surface conditioning for dental procedures. Packaged in a convenient 25 ml syringe, equipped with REF 001-01-025, and accompanied by dispensing tips, the SmartEtch system facilitates controlled and accurate application.</p><p>The standout feature of SafeEndo Smart Etch lies in its high color contrast, allowing dental professionals to exercise enhanced application control. Its efficient consistency enables pinpoint application, streamlining the process for practitioners and enhancing overall treatment accuracy. A distinctive advantage is its ease of removal, as the gel can be effortlessly washed away with a combination of water and air. This not only simplifies the cleanup process for dental professionals but also contributes to a more comfortable experience for patients.</p><p>Moreover, SafeEndo Smart Etch is designed to prevent tooth surface discoloration, ensuring the preservation of natural aesthetics. With a commitment to quality and innovation, this product stands as a reliable choice for dental practitioners seeking a user-friendly and effective solution for enamel and dentin etching in their clinical applications.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Application Control</strong></td><td>High colour contrast for precise application</td></tr><tr><td><strong>Consistency</strong></td><td>Efficient consistency for point application</td></tr><tr><td><strong>Rinsing</strong></td><td>Easily washed away with a stream of water and air</td></tr><tr><td><strong>Tooth Surface Compatibility</strong></td><td>Does not discolour the tooth surface</td></tr></tbody></table></figure>', '<ul><li>1 x&nbsp;Syringe (25 ml)</li></ul>', NULL, 145, '3', 0.00, 2160.00, 2160.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-6887592139943.png', NULL, 1, '2025-07-28 16:49:01', '2025-08-04 12:25:55'),
(416, 'P00362', NULL, 'SafeEndo Secure T', 'safeendo-secure-t-P00362', '<p><strong>SafeEndo Secure T</strong></p><p>Secure T achieves the highest effective range of cleaning &amp; disinfection. Secure T is user-friendly due to its low level of toxicity, good cleaning properties &amp; perfume-free formulation. It is especially recommended for all areas where, in addition to the compliance with high hygienic demands, an odour-free &amp; surfactant-based disinfectant product is required.</p><p><strong>INDICATIONS:</strong></p><ul><li>Secure T is a multipurpose disinfectant/decontaminant cleaner for use on Hard, Nonporus, Intimate surface, Hospital furniture, Isolation areas, Instruments (noncorosive), Surgical operatory, Dental operatory, Incubators, Exterior surface of Dental Curing Light and Ultrasonic Scaler, Intraoral Camera, Exterior Surface of Radiographic Sensor, Glass surfaces, in Ultrasonic Cleaner as Pre Cleaning Procedure.</li></ul><p><strong>CONTRAINDICATIONS</strong></p><ul><li>Drug idiosyncrasy</li><li>Do not misuse</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>- Isopropyl Alcohol (25%) - Benzethonium Chloride (0.28%) - Sterile Distilled Water - Flavours and Stabilizers</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5°C to 25°C</td></tr><tr><td><strong>Storage Instructions</strong></td><td>- Keep in a dry place - Tightly close the container after use</td></tr><tr><td><strong>Expiry Warning</strong></td><td>Do not use after the expiry date</td></tr><tr><td><strong>Shelf Life</strong></td><td>2 years</td></tr></tbody></table></figure>', '<ul><li>1 X 500ml Bottle</li></ul>', NULL, 96, '3', 0.00, 624.00, 624.00, 10, 10, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-68875a34dcff3.png', NULL, 1, '2025-07-28 16:53:36', '2025-08-04 12:20:10');
