(417, 'P00363', NULL, 'SafeEndo ReCreate LC-7 Composite Kit', 'safeendo-recreate-lc-7-composite-kit-P00363', '<p>The <strong>SafeEndo ReCreate LC-7 Composite Kit</strong> stands as a pinnacle in modern restorative dentistry, offering a comprehensive solution for dental professionals. This advanced kit comprises four syringes, each containing 4.5g of nano-hybrid composite in popular shades A1, A2, A3, and B2. The ability to request custom shade options underscores its commitment to personalized patient care.</p><p>Designed to address a spectrum of dental applications, the kit caters to the restoration of all cavity classes based on Black\'s classification, core build-ups, splinting, and correction of composite restorations. Its versatility extends to the fabrication of indirect restorations like inlays, onlays, and veneers, making it an indispensable asset in the dentist\'s toolkit.</p><p>What sets this kit apart is its exceptional performance. The ReCreate LC-7 Composite excels in polishing, ensuring a flawlessly smooth finish. Its non-adhesive quality simplifies the application process by preventing unwanted sticking to instruments, while maintaining stability during modeling for precise shaping. The composite also boasts excellent radiopacity for accurate diagnostics and features fluorescence for a natural aesthetic.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>Nano-hybrid Composite</td></tr><tr><td><strong>Advantages</strong></td><td>- Excellent polishing - Non-sticky (does not stick to instrument) - Stable during modeling - Excellent radiopacity - Fluorescence</td></tr></tbody></table></figure>', '<ul><li>4 x 4.5g Syringe (Shade A1, A2, A3, B2)</li><li>1 x ProClean 8gm Composite Polishing Paste</li><li>1 x&nbsp;ReCreate Bond-7</li><li>1 x&nbsp;Accessories</li></ul>', NULL, 124, '3', 0.00, 7680.00, 7680.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-68875bb75e1a6.png', NULL, 1, '2025-07-28 17:00:03', '2025-08-04 12:15:22'),
(418, 'P00364', NULL, 'SafeEndo ReCreate LC Flow', 'safeendo-recreate-lc-flow-P00364', '<p><strong>ReCreate-LC Flow</strong> is radiopaque, high strength and wear resistance light curing flowable composite. It is indicated for restoration in Anterior and Posterior Teeth.</p><p>ReCreate-LC Flow is optimal in its viscosity, it exhibits very good wetting and adaptation to cavity walls. ReCreate-LC Flow is used with a Dentine/Enamel etching and bonding system.</p><p>ReCreate-Lc Flow is a material which adapts very well to the cavity, helps to avoid air enclosures and accelerates restorations.</p><p><strong>Indications&nbsp;:</strong></p><p>• Filling minimally invasive cavities of all class<br>• Filling small Class I cavities and extended fissure sealing<br>• Filling Class V (Cervical Caries) directly<br>• V shaped cavities including Root Erosion<br>• Repair Of Ceramic and Composite Resin Veneers<br>• Block out undercuts for Impression<br>• Luting translucent prosthetic and orthodontic pieces</p><p><strong>Contraindications :</strong></p><p>• Drug idiosyncrasy<br>• Use with great care for allergic patients with methacylate</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Shades Available</strong></td><td>A1, A2, A3, B2</td></tr><tr><td><strong>Composition</strong></td><td>- Bisphenol A Glycidyl Methacrylate - Urethane Dimethacrylate - Triethylene Glycol Dimethacrylate - Ethoxylated Bisphenol A Dimethacrylate - Silanated Glass Filler - Amorphous Fumed Silica - Inorganic Filler (68%)</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5°C to 25°C</td></tr><tr><td><strong>Storage Instructions</strong></td><td>- Store in a well-sealed container - Close materials tightly after use</td></tr><tr><td><strong>Expiry Warning</strong></td><td>Do not use after the expiry date</td></tr><tr><td><strong>Shelf Life</strong></td><td>2.5 years</td></tr></tbody></table></figure>', '<ul><li>2 x ReCreate LC Flow 2.5gm</li></ul>', NULL, 127, '3', 0.00, 0.00, 0.00, 0, 0, 90, NULL, 1, 0, NULL, NULL, '2025-07-28-68875e4ab7b80.png', NULL, 1, '2025-07-28 17:11:02', '2025-08-04 12:11:50'),
