(423, 'P00369', NULL, 'SafeEndo ReCreate Bond 7 (7th Gen Bonding Agent)', 'safeendo-recreate-bond-7-7th-gen-bonding-agent-P00369', '<p>SafeEndo <strong>ReCreate Bond 7</strong> is an innovative and advanced seventh-generation bonding system designed to elevate the precision and reliability of light-cured (LC) composite restorations in dental applications. Packaged in a convenient 5 ml dropper bottle, this self-etch adhesive material is engineered for easy penetration into dentine tubules, ensuring a seamless and secure bond with dental tissues. The composition comprises dimethacrylate oligomers like bis-GMA and HEMA, colloidal filler, modifiers, polymerization activators, stabilizers, and solvents, all working synergistically to deliver exceptional bonding strength.</p><p>Noteworthy advantages include its elastance and tight edge fit, contributing to a remarkable 27 MPa adhesion to tooth hard tissues. SafeEndo ReCreate Bond 7 enables straightforward adaptation of the composite first layer and exhibits compatibility with all light-curing composites, providing practitioners with versatility in their clinical applications. The application process involves careful surface preparation, followed by the application of 1-2 coats of the adhesive material and efficient drying with air. Photopolymerization with 400-500 nm wavelength light solidifies the bond, ensuring a reliable connection between dental tissues and the composite material.</p><p>SafeEndo ReCreate Bond 7 is not only user-friendly but also emphasizes safety considerations, cautioning against eugenol-containing materials and advising careful application with allergic patients. With a shelf life of three years and proper storage conditions, this bonding system stands as a dependable choice for dental professionals seeking optimal outcomes in LC composite restorations.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Bonding System</strong></td><td>Self-Etch</td></tr><tr><td><strong>Composition</strong></td><td>Dimethacrylate oligomers (Bis-GMA, HEMA, etc.)</td></tr><tr><td><strong>Adhesion Strength</strong></td><td>27 MPa</td></tr><tr><td><strong>Application</strong></td><td>Single-component adhesive</td></tr><tr><td><strong>Compatibility</strong></td><td>Compatible with all light-curing composites</td></tr><tr><td><strong>Storage Conditions</strong></td><td>5°C to 25°C, protected from light</td></tr></tbody></table></figure>', '<ul><li>1 x Dropper bottle (5 ml)</li></ul>', NULL, 145, '3', 0.00, 2400.00, 2400.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-6887614c3adae.png', NULL, 1, '2025-07-28 17:23:52', '2025-08-04 12:10:53'),
(424, 'P00370', NULL, 'SafeEndo ReCreate Bond 5 (5th Gen Bonding Agent)', 'safeendo-recreate-bond-5-5th-gen-bonding-agent-P00370', '<p>SafeEndo <strong>ReCreate Bond 5</strong> revolutionizes dental bonding with its advanced 5th generation total-etch system, ensuring secure and durable adhesion for light-curing (LC) composite restorations. Engineered with a meticulous blend of dimethacrylate oligomers, colloidal filler, modifiers, polymerization activators, stabilizers, and solvents, this single-component adhesive material promises reliable bonding to dental tissues. The formulation\'s chemical reactivity establishes a strong affinity with collagen fibers and tooth hydroxyapatite, forming a robust chemical bond with both enamel and wet dentin.</p><p>Boasting an impressive adhesion strength of 27 MPa, SafeEndo ReCreate Bond 5 facilitates easy penetration into dentine tubules, delivering an elastance and tight edge fit. Compatible with all light-curing composites, its versatility is complemented by a user-friendly dropper bottle presentation (5 ml), allowing precise application. Careful storage between 5 °C to 25 °C in a dry place, shielded from light, preserves the product\'s efficacy, with a shelf life of three years.</p><p>The comprehensive method of application involves meticulous attention to detail, from tooth preparation to photopolymerization. SafeEndo ReCreate Bond 5, with its three-year shelf life, represents a pinnacle in dental bonding systems, offering practitioners a reliable solution for achieving optimal results in LC composite restorations while prioritizing patient safety and longevity.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Bonding System</strong></td><td>5th Generation Total-Etch</td></tr><tr><td><strong>Adhesion Strength</strong></td><td>27 MPa</td></tr><tr><td><strong>Application</strong></td><td>Light-curing single-component adhesive material</td></tr><tr><td><strong>Recommended Application Time</strong></td><td>15 seconds on prepared tooth surface</td></tr><tr><td><strong>Storage Conditions</strong></td><td>5°C to 25°C Dry place Protected from light Tightly closed container</td></tr></tbody></table></figure>', '<ul><li>1 x Dropper bottle (5 ml)</li></ul>', NULL, 145, '3', 0.00, 1920.00, 1920.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-68876345ab254.png', NULL, 1, '2025-07-28 17:32:17', '2025-08-04 12:10:01'),
(425, 'P00371', NULL, 'SafeEndo ReCal LC', 'safeendo-recal-lc-P00371', '<p><strong>SafeEndo ReCal LC </strong>is a light-curing resin modified radiopaque flowable calcium hydroxide material for cavity lining (base) for Indirect pulp capping especially under composites.</p><p><strong>SafeEndo ReCal LC Calcium Hydroxide </strong>is a rigid-setting, light-curing lining material designed for use as a&nbsp;indirect pulp capping agent and a protective liner under dental filling materials, cement, and other base materials. It has no effect on the polymerization of composite filling materials.</p><p><strong>INDICATION :&nbsp;</strong></p><ul><li>As a liner for indirect&nbsp;pulp capping.</li><li>As liner under all filling materials.</li><li>As protection against acid when applying the total-etch technique.</li></ul><p><strong>CONTRAINDICATION :</strong></p><ul><li>Drug idiosyncrasy</li><li>Use with carefully if person is allergic to methacrylates and BHT</li><li>Do not use directly on large exposed Pulp area as a temporary or permanent closure</li></ul><p><strong>Advantages :</strong></p><ul><li>ReCal - Lc is designed to perform better barrier for pulp tissues, appropriate placement of material in to deep cavities.</li><li>Light curing property gives better stability of cavity liner that gives immediate placement of restoration over cavity lining area.</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>- Resin Modified Calcium Hydroxide - Zirconium Oxide - Photoinitiators - Paste Forming Agent</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5°C to 25°C</td></tr><tr><td><strong>Storage Instructions</strong></td><td>- Store in a well-sealed container - Close materials tightly after use</td></tr><tr><td><strong>Expiry Warning</strong></td><td>Do not use after the expiry date</td></tr><tr><td><strong>Shelf Life</strong></td><td>2.5 years</td></tr></tbody></table></figure>', '<ul><li>1 x&nbsp;ReCal – Lc 2.5gm syringe</li></ul>', NULL, 503, '3', 0.00, 1320.00, 1320.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-688764223ced9.png', NULL, 1, '2025-07-28 17:35:58', '2025-08-04 12:08:24'),
(426, 'P00372', NULL, 'SafeEndo GlassyRestore LC Restorative Cement', 'safeendo-glassyrestore-lc-restorative-cement-P00372', '<p><strong>SafeEndo GlassyRestore LC Restorative Cement</strong> is a light-cured, radiopaque glass ionomer cement designed for high-performance dental restorations. Its advanced formula combines fluoroaluminosilicate glass with polyacrylic acid and light-activated resin monomers, ensuring strong chemical adhesion to enamel and dentin. GlassyRestore LC offers excellent mechanical strength, fluoride release for long-term cavity protection, and outstanding acid erosion and wear resistance. The material is easy to handle, with a working time of 2.5–3 minutes and a fast light-curing time of 20–30 seconds, delivering immediate hardening for efficient clinical workflow. It is highly biocompatible and ideal for Class I, II, III, and V restorations, ART fillings, fissure sealing, and lining under composites. The radiopaque property ensures clear visibility on X-rays, aiding post-treatment assessment. SafeEndo GlassyRestore LC delivers durable, aesthetic, and reliable restorations, making it a versatile choice for modern restorative dentistry.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition (Powder)</strong></td><td>Fluoroaluminosilicate Glass Powder</td></tr><tr><td><strong>Composition (Liquid)</strong></td><td>Polyacrylic Acid, HEMA (Hydroxyethyl Methacrylate), Water</td></tr><tr><td><strong>Powder to Liquid Ratio</strong></td><td>1 flat scoop of powder : 2 drops of liquid</td></tr><tr><td><strong>Measuring Spoon Capacity</strong></td><td>1.8 g</td></tr><tr><td><strong>Mixing Time</strong></td><td>30 seconds</td></tr><tr><td><strong>Mixing Surface</strong></td><td>Mixing pad (1 piece included)</td></tr><tr><td><strong>Light-Curing Time</strong></td><td>20 seconds</td></tr><tr><td><strong>Compressive Strength</strong></td><td>260 ± 7 MPa</td></tr><tr><td><strong>Depth of Cure</strong></td><td>Tested at 23 ± 1°C, 50 ± 10% relative humidity</td></tr><tr><td><strong>Fluoride Release</strong></td><td>Yes – for prolonged anti-caries effect</td></tr><tr><td><strong>Radiopacity</strong></td><td>Yes – visible in X-rays</td></tr><tr><td><strong>Biocompatibility</strong></td><td>High – safe for use on tooth tissues</td></tr><tr><td><strong>Aesthetics</strong></td><td>Natural appearance suitable for visible restorations</td></tr></tbody></table></figure>', '<ul><li>1 x 15g Powder (Bottle)</li><li>1 x 7.2 ml Liquid (Bottle)</li><li>1 x Measuring Spoon</li><li>1 x Mixing Pad&nbsp;</li></ul>', NULL, 141, '3', 0.00, 2016.00, 2016.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-6887653143d27.png', NULL, 1, '2025-07-28 17:40:29', '2025-08-04 11:48:51'),
(427, 'P00373', NULL, 'SafeEndo GlassyLute Luting GIC', 'safeendo-glassylute-luting-gic-P00373', '<p><strong>SafeEndo GlassyLute Restorative Luting Glass Ionomer Cement (GIC)</strong> is a dental product designed for reliable fixation in dental procedures. Its composition includes fluoro aluminosilicate glass powder, modifiers, and a liquid blend of polyacrylic acid, maelic acid, and tartaric acid. These components work synergistically to form a plastic paste with a film thickness of 10 µm upon mixing, ensuring precise application.</p><p>This cement boasts high biocompatibility with tooth tissues, offering a robust 185MPa strength and remarkable resistance to acid erosion. The polyacrylic acid facilitates chemical adhesion, ensuring a snug fit and excellent marginal integrity. Its fluorine-containing glass filler contributes to prolonged anticaries effects, enhancing patient outcomes.</p><p>SafeEndo GlassyLute is ideal for fixing crowns, dental bridgework, inlays, onlays, and orthodontic brackets. Its aesthetic properties make it suitable for metal-free restorations using high-strength ceramics, ensuring both functional and cosmetic excellence.</p><p><strong>INDICATION</strong></p><ul><li>For fixation of Crowns, Dental bridgework, Inlays , Onlays and Orthodontic<br>Brackets</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>- Fluoroaluminosilicate glass powder - Modificator - Polyacrylic acid - Maelic acid - Tartaric acid (Liquid)</td></tr><tr><td><strong>Properties</strong></td><td>- High biocompatibility - 185 MPa strength - Acid erosion resistance - Fluorine-containing glass filler for anticaries effect</td></tr><tr><td><strong>Indications</strong></td><td>- Crowns - Dental bridgework - Inlays - Onlays - Orthodontic brackets</td></tr><tr><td><strong>Method of Use</strong></td><td>- Surface preparation - Mixing - Application</td></tr><tr><td><strong>Storage Conditions</strong></td><td>- Temperature: 5°C to 25°C - Store in a dry place, away from humidity</td></tr><tr><td><strong>Shelf Life</strong></td><td>3 years</td></tr></tbody></table></figure>', '<ul><li>1 x Powder (35g bottle)</li><li>1 x Liquid (25g bottle)</li><li>1 x Measuring spoon</li><li>1 x Mixing pad</li></ul>', NULL, 128, '3', 0.00, 2880.00, 2880.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-6887666ed7d01.png', NULL, 1, '2025-07-28 17:45:46', '2025-08-04 11:47:44'),
(428, 'P00374', NULL, 'SafeEndo Explore', 'safeendo-explore-P00374', '<p><strong>SafeEndo Explore</strong> is a red dye containg Acid Rhodamine Dye in semi-aqueous base that enables visual differentiation between infected carious and sound dentine. It is an excellent caries disclosing agent for conservative dentistry. It aids in the excavation of the outer decalcified and infected carious dentin layer, permitting optimal caries removal. Explore Caries Detector is an excellent means of detecting caries and plays a major role in maintaining and preserving teeth. It provides support for the excavation of the demineralized outer tooth hard structure affected by the caries, making it possible to remove the caries as completely as possible.</p><p><strong>Indication :</strong></p><ul><li>Caries Disclosing Agent for Conservative Dentistry</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Formulation</strong></td><td>Dye-based liquid solution designed for caries detection</td></tr><tr><td><strong>Color</strong></td><td>Typically red</td></tr><tr><td><strong>Volume</strong></td><td>15 ml</td></tr><tr><td><strong>Application Tools</strong></td><td>Compatible with brushes, micro applicators, or syringes</td></tr><tr><td><strong>Storage Requirements</strong></td><td>Store in a cool, dry place away from light and heat sources</td></tr></tbody></table></figure>', '<ul><li>1 x Explore liquid 15ml</li></ul>', NULL, 307, '3', 0.00, 1200.00, 1200.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-6887675cda619.png', NULL, 1, '2025-07-28 17:49:44', '2025-08-04 11:46:25'),
(429, 'P00375', NULL, 'SafeEndo EugeSeal', 'safeendo-eugeseal-P00375', '<p><strong>SafeEndo EugeSeal </strong>is a Zinc Oxide Eugenol based sealer in powder-liquid form for permanent filling of root canals. This sealant has been specially designed to tightly seal the apex of the root and the prepared root canal. It can be easily removed along with Gutta Percha Point when refilling is necessary.</p><p>Sealing material Eugeseal&nbsp;belongs to Zinc-Oxide-Eugenol based class of materials. <strong>Calcium phosphate</strong> stimulates Bone Regeneration. <strong>Thymol iodide</strong> is a strong antiseptic material with prolonged effect. Anesthetics - <strong>Dexamethasone</strong> and <strong>Hydrocortisone</strong> significantly reduce periapical pain. <strong>Plasticizer</strong> allows to make a plastic paste during mixing of Powder and Liquid at the ratio 7:1.</p><p>Liquid contains <strong>Eugenol</strong>, modified with Polymeric Material, which ensures sealer nonshrinkage after its hardening and insolubility in distilled water at the temperature of 37°C (solubility is 0.15%).</p><p>The thickness of film is 3-5 µm, what allows antiseptic to penetrate in microtubules and root canals furcations. Paste can be used for filling with gutta-percha points. Eugenol, slightly melt the surface of gutta-percha points, stick them together thus allowing to fill the canal thoroughly and isolate it from microorganisms.</p><p>Paste, made from kit Eugeseal, do not lose its plasticity on mixing pad within 5-6 hours and hardens in oral cavity (in 37°C) within 24-48 hours. If needed material can be easily extracted from root canal.</p><p><strong>Indications :</strong></p><ul><li>Sealing of prepared root canals with gutta-percha points</li><li>Sealing of root canals&nbsp;without gutta-percha points in decidous teeth</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition (Powder)</strong></td><td>- Zinc Oxide - Calcium Phosphate - Zirconium Dioxide - Thymol Iodide - Dexamethasone (0.01%) - Hydrocortisone Acetate (1.00%) - Plasticizer</td></tr><tr><td><strong>Composition (Liquid)</strong></td><td>- Eugenol - Modified by additives</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5°C to 25°C</td></tr><tr><td><strong>Storage Instructions</strong></td><td>Tightly close bottle immediately after use</td></tr><tr><td><strong>Shelf Life</strong></td><td>3 years</td></tr></tbody></table></figure>', '<ul><li>1 x Powder Glass Bottle (14 g)</li><li>1 x Liquid Bottle with a pipette-cap (10 ml)</li><li>1 x Measuring spoon</li><li>1 x Mixing pad</li></ul>', NULL, 197, '3', 0.00, 3120.00, 3120.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-6887688b0590e.png', NULL, 1, '2025-07-28 17:54:47', '2025-08-04 11:43:22'),
(430, 'P00376', NULL, 'SafeEndo EpoxySeal', 'safeendo-epoxyseal-P00376', '<p><strong>SafeEndo EpoxySeal</strong> is a resin based root canal sealer which is a paste－paste type of dual syringe.<br>It has a outstanding chemical and physical property including extremely excellent sealing property and biocompatobility.</p><p>Mixing of white and gray pastes, in equal proportions, forms plastic paste with film width<br>of 5-10µm which produces a root canal filling material of excellent sealing capacity. As a result of its close adaptation to the root canal walls and its very small contraction during setting, it allows tightly sealing root canal obturation of excellent tissue compatibility.</p><p>At room temperature 20-23°C paste keeps its plasticity during 4 hours. Paste hardens in root canal within 24 hours and forms bioinert amino resin with good adhesion and low solubility. Overfilling material in apex area will not lead to any complications.</p><p><strong>Indications :</strong></p><ul><li>Permanent obturation of root canals of teeth of the secondary dentition.</li></ul><p><strong>Advantages :</strong></p><ul><li>Excellent flow properties</li><li>Long lifespan of filling</li><li>Reliable sealing</li><li>Does not contain urotropin</li><li>Does not bring pain on after filling</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>- Epoxy Resin - Amine Hardening Agents - Zirconium Oxide - Filling Component - Plasticizing Agent</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5°C to 25°C</td></tr><tr><td><strong>Storage Instructions</strong></td><td>Tightly close container immediately after use</td></tr><tr><td><strong>Shelf Life</strong></td><td>3 years</td></tr></tbody></table></figure>', '<ul><li>1 x EpoxySeal White Paste Tube, 5 ml</li><li>1 x EpoxySeal Ivory&nbsp;Paste Tube, 5 ml</li><li>1 x Mixing pad</li></ul>', NULL, 197, '3', 0.00, 2880.00, 2880.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-68876b0296629.png', NULL, 1, '2025-07-28 18:05:18', '2025-08-04 11:36:41'),
(431, 'P00377', NULL, 'SafeEndo DisSolve E', 'safeendo-dissolve-e-P00377', '<p><strong>DisSolve E</strong>, Gutta Percha Solvent is used for removing gutta percha at the time of root canal re-treatment. Also useful for removing all types of root canal filling materials including Zinc Oxide – Eugenol Cement or as a cleaner for endodontic instruments. DisSolve E, Gutta Percha Solvent is based on natural substances and therefore it does not cause irritation to oral mucosa and peri-apical tissue.</p><p><strong>Indications :</strong></p><ul><li>DisSolve E G.P. Solvent is used for removing gutta percha at the time of root canal retreatment.</li><li>Also useful for removing all types of root canal filling materials including Zinc Oxide – Eugenol Cement or as a cleaner for endodontic instruments.</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Product Type</strong></td><td>Gutta-Percha and ZOE Cement Solvent</td></tr><tr><td><strong>Active Ingredient</strong></td><td>d-Limonene (Natural Extract)</td></tr><tr><td><strong>Toxicity</strong></td><td>Non-toxic, non-carcinogenic, and free from chloroform or trichloroethylene</td></tr><tr><td><strong>Consistency</strong></td><td>Liquid solvent for efficient material softening</td></tr><tr><td><strong>Storage Conditions</strong></td><td>Store in a cool, dry place away from direct sunlight</td></tr></tbody></table></figure>', '<ul><li>1 x DisSolve-E Bottle (15 ml)</li><li>1 x Dropper</li></ul>', NULL, 214, '3', 0.00, 480.00, 480.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-688793273e94a.png', NULL, 1, '2025-07-28 20:56:35', '2025-08-04 11:28:47'),
(432, 'P00378', NULL, 'SafeEndo Devitalize Plus Syringe - 2.5gm', 'safeendo-devitalize-plus-syringe-25gm-P00378', '<p><strong>SafeEndo Devitalize Plus</strong> is a arsenic-free devitalization fibrous paste.</p><p>Main composition of Devitalize Plus is Polyoxymethylene which is an antiseptic, that coagulates proteins providing necrosis of pulp tissue. Lidocaine Hydrochloride is an anesthetic component, reducing pain risk during tooth Pulp Devitalization. Racemic Camphor along with Para Chlorophenol make next generation pulp devitalization paste; which gives synergetic effect to Lidocaine Hydrochloride and Polyoxymethylene.</p><p><strong>DEVITALIZE PLUS</strong>&nbsp;provides prolonged and painless pulp devitalization within 1-5 days. Paste is intended for use in aggressive biological medium with the temperature range between&nbsp;32°C and 42°C (in oral cavity at the temperature (37±1) °C and humidity 60-90 %)</p><p><strong>Indication :</strong></p><ul><li>Pulp devitalization before removal or amputation</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>- Racemic Camphor - Polyoxymethylene - ParaChlorophenol - Lidocaine Hydrochloride - Paste-Forming Component - Colorant - Fiber Filler</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5 °C to 25 °C</td></tr><tr><td><strong>Storage Instructions</strong></td><td>Tightly close container immediately after use</td></tr><tr><td><strong>Usage Warning</strong></td><td>Do not use after expiry date</td></tr><tr><td><strong>Shelf Life</strong></td><td>3 years</td></tr></tbody></table></figure>', '<ul><li>1 x Syringe (2.5 gm)</li></ul>', NULL, 177, '3', 0.00, 2400.00, 2400.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-688794e3e8e99.png', NULL, 1, '2025-07-28 21:03:59', '2025-08-04 11:27:32'),
(433, 'P00379', NULL, 'SafeEndo Devitalize Jar - 8gm', 'safeendo-devitalize-jar-8gm-P00379', '<p><strong>SafeEndo Devitalize</strong> is a arsenic free devitalizing paste. The active ingredient is Polyoxymethylene, a coagulant which acts on albumin and confers the required fibrous consistency to the pulp to facilitate its subsequent extirpation. Lidocaine Hydrochloride is an anaesthetic to relieve pain and calm irritation.&nbsp;</p><p>Arsenic-free Devitalization fibrous paste. Polyoxymethylene is an antiseptic, which coagulates proteins providing necrosis of pulp tissue. Lidocaine hydrochloride is an anesthetic component, reducing pain risk during tooth pulp devitalization. Paste DEVITALIZE provides&nbsp;painless pulp devitalization within 1-5 days.</p><p>Paste is intended for use in aggressive biological medium with the temperature range between 32 °C and 42 °C (in oral cavity at the temperature (37±1) °C and humidity 60-90%).</p><h3>Indications :</h3><ul><li>Pulp&nbsp;devitalization before removal or amputation.</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>- Polyoxymethylene - Para Chlorophenol - Lidocaine Hydrochloride - Paste-Forming Component - Colorant - Fiber Filler</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5 °C to 25 °C</td></tr><tr><td><strong>Storage Instructions</strong></td><td>Tightly close container immediately after use</td></tr><tr><td><strong>Usage Warning</strong></td><td>Do not use after expiry date</td></tr><tr><td><strong>Shelf Life</strong></td><td>3 years</td></tr></tbody></table></figure>', '<ul><li>1 x Paste (8 gm) Jar</li></ul>', NULL, 177, '3', 0.00, 2160.00, 2160.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-6887960e5bcb9.png', NULL, 1, '2025-07-28 21:08:58', '2025-08-04 11:27:00'),
(434, 'P00380', NULL, 'SafeEndo CresoPulp Liquid', 'safeendo-cresopulp-liquid-P00380', '<p><strong>SafeEndo CresoPulp</strong> is indicated for use as&nbsp;immediate pain reliever and antiseptic in case of traumatic and acute pulpitis, prior to plup devitalization</p><p>Lidocaine hydrochloride provides analgesic effect. Chlorophenol, eugenol and M-cresol are broad spectrum antiseptics, possessing slightly mummifying effect on nerve fibers. Camphor mitigates the impact of chlorophenol on the body.</p><p>CresoPulp Liquid is intended for use in aggressive biological medium with the temperature range between 32°C and 42°C (in oral cavity at the temperature (37±1)°C and humidity 60-90 %).</p><p><strong>INDICATIONS :-</strong></p><ul><li>For Antiseptic of tooth root canals.</li><li>Immediate Pain relief and antiseptic in case of traumatic and acute pulpitis, prior to plup&nbsp; devitalization.</li><li>Pain relief in case of acute pulpitis.</li><li>For anesthesia in traumatic and acute pulpitis before applying of devitalization paste (Devitalize)</li><li>As a long-acting application for pulpitis management</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition</strong></td><td>- Chlorophenol - Lidocaine Hydrochloride – 5% - Eugenol - M-Cresol - Camphor</td></tr><tr><td><strong>Storage Temperature</strong></td><td>5 °C to 25 °C</td></tr><tr><td><strong>Storage Conditions</strong></td><td>Keep in a dry place</td></tr><tr><td><strong>Storage Instructions</strong></td><td>Tightly close container immediately after use</td></tr><tr><td><strong>Usage Warning</strong></td><td>Do not use after expiry date</td></tr><tr><td><strong>Shelf Life</strong></td><td>3 years</td></tr></tbody></table></figure>', '<ul><li>1 x CresoPulp Liquid Bottle (15 ml)</li><li>1 x Pipette-Cap</li></ul>', NULL, 177, '3', 0.00, 2160.00, 2160.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-6887971292985.png', NULL, 1, '2025-07-28 21:13:18', '2025-08-04 11:26:13'),
(435, 'P00381', NULL, 'BIOSTRUCTURE MTA 1G/2ML', 'biostructure-mta-1g2ml-P00381', '<p><br><strong>SafeEndo BioStructure MTA </strong>is a specialized dental cement based on Di and Tri-Calcium Silicate and Tricalcium Aluminate, derived from advanced material research in inorganic hydraulic powder technology. MTA is indicated for both vital pulp therapy and Endodontics procedures.</p><p><strong>BioStructure MTA</strong>&nbsp;is a stainproof, tricalcium silicate-based bioactive cement that can be used universally for vital pulp and other endodontic indications in primary and permanent teeth. It is a bioceramic cement that triggers the healing process. It mixes more smoothly, is easier to dispense and has more stable placement, washout resistance and faster clinical setting.</p><p><strong>Indications :</strong></p><ul><li>Pulp capping</li><li>Cavity lining</li><li>Pulpotomies</li><li>Root-end fillings</li><li>Apexification</li><li>Apexogenesis</li><li>Perforation repair</li><li>Root resorption</li><li>Obturation (pulpectomy)</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Composition (Powder)</strong></td><td>- Di-Calcium Silicate - Tri-Calcium Silicate - Tricalcium Aluminate - Zirconium Oxide</td></tr><tr><td><strong>Composition (Liquid)</strong></td><td>Calcium Chloride in Purified Water</td></tr><tr><td><strong>Initial Setting Time</strong></td><td>16 minutes</td></tr><tr><td><strong>Compressive Resistance</strong></td><td>45 ± 2 MPa</td></tr><tr><td><strong>Solubility</strong></td><td>0.58%</td></tr><tr><td><strong>pH Value</strong></td><td>12.8</td></tr></tbody></table></figure>', '<ul><li>1 x Powder 1gm</li><li>1 x Liquid 2ml</li><li>1 x Mixing pad</li></ul>', NULL, 197, '3', 0.00, 2160.00, 2160.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-6887982b522d6.png', NULL, 1, '2025-07-28 21:17:59', '2025-08-04 10:56:35'),
(436, 'P00382', NULL, 'SafeEndo Biostructure MTA Putty - 2 x 0.70gm Syringe', 'safeendo-biostructure-mta-putty-2-x-070gm-syringe-P00382', '<p><strong>SafeEndo Biostructure MTA Putty</strong></p><p>SafeEndo BioStructure MTA Putty is a specialized dental material used for root repair procedures. It is based on advanced material research, containing Di and Tri-Calcium Silicate and Tricalcium Aluminate. This bioactive and bioceramic root repair material offers excellent biocompatibility, high mechanical resistance, and low solubility. It hardens in the presence of moisture with a controlled setting time, ensuring precise application during dental procedures. SafeEndo BioStructure MTA Putty exhibits high alkalinity and radiopacity, making it ideal for various endodontic applications where root repair and sealing are essential. This innovative dental cement provides a reliable solution for clinicians seeking effective and long-lasting outcomes in root canal treatments and other dental interventions requiring biocompatible and durable materials.</p><p><strong>Indications:</strong></p><ul><li>Indirect Pulp Capping</li><li>Direct Pulp Capping</li><li>Apexogenesis</li><li>Partial Pulpotomy</li><li>Pulpotomy</li><li>As Cavity liner and base for recurrent carious areas</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Condition</strong></td><td>New: Unused, unopened, undamaged item in original packaging</td></tr><tr><td><strong>Brand</strong></td><td>SAFE ENDO</td></tr><tr><td><strong>Model</strong></td><td>Biostructure MTA Putty</td></tr><tr><td><strong>MPN (Manufacturer Part Number)</strong></td><td>Does Not Apply</td></tr><tr><td><strong>Country/Region of Manufacture</strong></td><td>India</td></tr><tr><td><strong>California Prop 65 Warning</strong></td><td>N/A</td></tr><tr><td><strong>Intended Use/Discipline</strong></td><td>Dental Laboratory</td></tr><tr><td><strong>UPC</strong></td><td>Does Not Apply</td></tr><tr><td><strong>Category</strong></td><td>Business &amp; Industrial &gt; Healthcare, Lab &amp; Dental &gt; Medical, Lab &amp; Dental Supplies &gt; Other Medical, Lab &amp; Dental Supplies</td></tr></tbody></table></figure>', NULL, NULL, 197, '3', 0.00, 3984.00, 3984.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-688799e9856ae.png', NULL, 1, '2025-07-28 21:25:25', '2025-08-04 10:55:38'),
(437, 'P00383', NULL, 'SafeEndo BioActive RCS - 3g', 'safeendo-bioactive-rcs-3g-P00383', '<p><strong>SafeEndo BioActive RCS</strong>&nbsp;is a bioactive mineral root canal sealer based on innovative mineral micro-aggregate chemistry “Active Biosilicate Technology” that offers.</p><p><strong>Advantages :-</strong></p><ul><li>Biocompatibility: high mineral purity and monomer free formulation reducing the risk of adverse tissue reaction.</li><li>Bioactive properties: hydroxyapatite formation at the tooth-sealer interface and mineralization of dentinal structure.</li><li>Alkaline pH.</li><li>Sealing properties: crystallization of the material inside the dentin tubules creating a tight seal.</li><li>Retreatable : if a retreatment is needed, BioActive RCS can be easily removed from the root canal.</li></ul><p><strong>Indications :-</strong></p><p>Permanent root canal filling in combination with gutta-percha points in vital or necrotic pulp cases or after a retreatment procedure. BioActive RCS is suitable for use in single cone technique or cold lateral condensation.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Condition</strong></td><td>New: Unused, unopened, undamaged item in original packaging</td></tr><tr><td><strong>Brand</strong></td><td>Safe Endo</td></tr><tr><td><strong>Model</strong></td><td>BioActive RCS</td></tr><tr><td><strong>MPN (Manufacturer Part Number)</strong></td><td>Does Not Apply</td></tr><tr><td><strong>Country/Region of Manufacture</strong></td><td>India</td></tr><tr><td><strong>Intended Use/Discipline</strong></td><td>Dentistry</td></tr><tr><td><strong>Category</strong></td><td>Business &amp; Industrial &gt; Healthcare, Lab &amp; Dental &gt; Medical, Lab &amp; Dental Supplies &gt; Other Medical, Lab &amp; Dental Supplies</td></tr></tbody></table></figure>', NULL, NULL, 197, '3', 0.00, 4992.00, 4992.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-68879b2590fc7.png', NULL, 1, '2025-07-28 21:30:41', '2025-08-04 10:53:10'),
(438, 'P00384', NULL, 'SafeEndo IodoCure Calcium Hydroxide With Iodoform Paste For Endo Treatment', 'safeendo-iodocure-calcium-hydroxide-with-iodoform-paste-for-endo-treatment-P00384', '<p>SafeEndo IodoCure calcium Hydroxide paste with iodoform (Radiopaque), used as temporary or permanent root filling material.<br>Calcium hydroxide with Iodoform is used for stimulating the healing process. This paste is packaged in a convenient syringe to eliminate messy mixing.<br>The action of calcium hydroxide is achieved through the ionic dissociation of Ca(2+) and OH(-) ions and their effect on vital tissues, the induction of hard-tissue deposition, and the antibacterial properties.<br>Iodoform has been added to Ca(OH)2 due to its antibacterial effect, healing properties, and ability to be resorbed when in excess .</p><p><strong>Advantages :</strong>Strong antiseptic properties (contains iodoform)High pH value (12.8),provides fast,continuous and durable bactericidal effect during treatment of infected canals,and in periapical area (99% of bacteria are killed within 48 hours after root canal filling with the paste)Paste is easily removed from canals if necessaryStimulates hard tissues formation in apexSyringe with reinforced plunger,convenient to hold in hand, Luer-Lock capUltra-thin dispensing tips (0.52 mm with a hole size 22) allow to apply paste directly into canals<br>INDICATIONS : Paste is used as temporary filling of tooth root canals during staged treatment and as permanent filling of tooth root canals at the final stage of the treatment.<br>Paste IodoCure is used for :<br>Treatment of acute and chronic forms of periodontitisTreatment of pulpitis, granulomatous periodontitis and granulating periodontitisFor Apexification during treatment of tooth root canals with open apex in periodontitisTreatment of cystic lesion and chronic granulomaIn case of root perforation and root resorptionAs permanent filling material for infected root canals after its treatmentAs permanent filling material for milk teeth</p><p><br><strong>FEATURES</strong>:Paste has a strong bactericidal effect.Iodoform provides prolonged antimicrobic effect in root canal microflora. When in contact with tissues iodoform undergoes gradual decomposition evolving free iodine.Hydrophobical paste-forming component provides paste’s fluidity and plasticity,ensures hermetic sealing of root canal, protects soft tissues when inserting paste out of theapex.Calcium containing filler stimulates hard tissues formation at the apex level, provides alkaline (pH 12,8) antimicrobial medium and gradual paste hardening under the influence of in-thecanal moisture.Paste hardens in canal under the influence of in-the-canal moisture within 1-3 months.During hardening and after it the material can be easily removed out of the canal.Being out of apex in soft tissues paste reabsorbs.When filling of milk teeth paste reabsorbs as quickly as tooth resorption is held.Paste can be applied with gutta-percha or polypropylene points.IodoCure does not prevent from formation and developing of dental budIn order to avoid tooth crown coloring do not fill whole pulp cavity with the paste<br>&nbsp;</p>', '<figure class=\"table\"><table><tbody><tr><td><strong>Specification</strong></td><td><strong>Details</strong></td></tr><tr><td><strong>Condition</strong></td><td>New: Unused, unopened, undamaged item in original packaging</td></tr><tr><td><strong>Brand</strong></td><td>Safe Endo</td></tr><tr><td><strong>Model</strong></td><td>SafeEndo IodoCure</td></tr><tr><td><strong>MPN (Manufacturer Part Number)</strong></td><td>Does Not Apply</td></tr><tr><td><strong>Country/Region of Manufacture</strong></td><td>India</td></tr><tr><td><strong>Modified Item</strong></td><td>No</td></tr><tr><td><strong>Intended Use/Discipline</strong></td><td>Dental Laboratory, Dentistry, Endodontics</td></tr><tr><td><strong>UPC</strong></td><td>Does Not Apply</td></tr><tr><td><strong>Category</strong></td><td>Business &amp; Industrial &gt; Healthcare, Lab &amp; Dental &gt; Medical, Lab &amp; Dental Supplies &gt; Other Medical, Lab &amp; Dental Supplies</td></tr></tbody></table></figure>', '<ul><li>2 x IodoCure syringe (2 gm)</li></ul>', NULL, 201, '3', 0.00, 1536.00, 1536.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-68879e95d4f80.png', NULL, 1, '2025-07-28 21:45:21', '2025-08-04 10:51:25'),
(439, 'P00385', NULL, '2 x SafeEndo ReTemp-LC Flow Temporary Restorative Flowable Composite Dental', '2-x-safeendo-retemp-lc-flow-temporary-restorative-flowable-composite-dental-P00385', '<p><strong>2 x SafeEndo ReTemp-LC Flow Temporary Restorative Flowable Composite&nbsp;</strong></p><p>ReTemp – Lc Flow is a blue colour, light curing paste based on a polymer binder and inorganic filler. Thanks to its elastic consistency, the material is easily removable , also in case of undercuts with help of appropriate hand instruments ( probe or excavator) with a single shape of cavity. Therefore post-treatment drilling of cavity to remove temporary material is not needed.</p><p>ReTemp - Lc Flow is a light curing flowable composite designed for temporary fillings in endodontic treatment, micro prosthesis, temporary sealing of abutment screw of Implant.</p><p><strong>Indications :</strong></p><ul><li>Temporary preparation of Cavity wall for Endodontic irrigation</li><li>Temporary isolation during microprosthetics</li><li>Temporary sealing of implant adutment screw</li><li>Temporary filling of Inlay and Onlay of the cavity</li><li>Sealing of Root Canal Orifices after obturation</li><li>Fixation of polymer matrix in interdental spaces during restoration</li></ul><p><strong>Features:</strong></p><ul><li>Saves time (curing time is 10-20 sec)</li><li>Easy to use&nbsp;</li><li>Tight marginal seal</li><li>Withstands chewing load</li><li>Easy to treat and polish</li><li>No Need of Etching and Bonding Required.</li><li>Can be easily removed in one portion without&nbsp; drilling</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Condition</strong></td><td>New: Unused, unopened, undamaged item in original packaging</td></tr><tr><td><strong>MPN (Manufacturer Part Number)</strong></td><td>N/A</td></tr><tr><td><strong>Expiration Date</strong></td><td>Long Expiry</td></tr><tr><td><strong>Model</strong></td><td>SafeEndo ReTemp-LC Flow</td></tr><tr><td><strong>Intended Use/Discipline</strong></td><td>Dentistry, Endodontics</td></tr><tr><td><strong>Brand</strong></td><td>SafeEndo</td></tr><tr><td><strong>Category</strong></td><td>Business &amp; Industrial &gt; Healthcare, Lab &amp; Dental &gt; Medical, Lab &amp; Dental Supplies &gt; Other Medical, Lab &amp; Dental Supplies</td></tr><tr><td><strong>Item Description (Seller)</strong></td><td>Not specified</td></tr></tbody></table></figure>', '<ul><li>2 x ReTemp – Lc 2.5g syringe</li></ul><p><br>&nbsp;</p>', NULL, 127, '3', 0.00, 1632.00, 1632.00, 11, 11, 90, NULL, 0, 0, NULL, NULL, '2025-07-28-68879fbdab053.png', NULL, 1, '2025-07-28 21:50:17', '2025-08-04 10:49:21'),
(440, 'P00386', NULL, 'TDV Anatomical Wooden Wedges (100pk)', 'tdv-anatomical-wooden-wedges-100pk-P00386', '<p>Anatomical wooden wedges designed for general use in restoration procedures with the mechanical function of adapting the matrix and/or separating adjacent teeth. These wedges do not need clippings or adjustments and guarantee the matrix fixing, providing restorations without any sub-gingival excess and perfect contour.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Sizes</strong></td><td>Nos 1, 2, 3, 4 &amp; 5</td></tr><tr><td><strong>Colour</strong></td><td>Yellow (No 1), Blue (No 2), Red (No 3), Purple (No 4), Natural (No 5)</td></tr><tr><td><strong>Packaging</strong></td><td>Each box contains 100 wedges in assorted sizes</td></tr></tbody></table></figure>', NULL, NULL, 33, '7', 0.00, 1100.00, 1100.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-29-6888617e7cb64.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-04 10:48:36'),
(441, 'P00387', NULL, 'TDV Approximal Finishing Sandpaper - 4mm x 170mm - 150 Strips. Medium and Fine', 'tdv-approximal-finishing-sandpaper-4mm-x-170mm-150-strips-medium-and-fine-P00387', '<p>Approximal Finishing Sandpaper - 4mm x 170mm - 150 Strips. Medium and Fine grits separated by a neutral space for an easier insertion through the contact point area without harming it. Indicated for finishing and polishing composites.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Manufacturer Code</strong></td><td>3062</td></tr><tr><td><strong>Brand</strong></td><td>TDV</td></tr><tr><td><strong>Dimensions</strong></td><td>4 mm</td></tr><tr><td><strong>Grit</strong></td><td>Medium/Fine</td></tr><tr><td><strong>Packaging</strong></td><td>Package of 150 strips</td></tr><tr><td><strong>Primary Market</strong></td><td>Not Specified</td></tr><tr><td><strong>Siding/Edging/Shape</strong></td><td>Single sided</td></tr><tr><td><strong>Style/Material</strong></td><td>Sandpaper</td></tr></tbody></table></figure>', NULL, NULL, 157, '7', 0.00, 1250.00, 1250.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-29-688860c9d8c88.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-04 10:47:52');
INSERT INTO `products` (`id`, `product_code`, `parent_id`, `product_name`, `slug`, `product_description`, `key_specifications`, `packaging`, `warranty`, `category_id`, `delivery_target_days`, `discount`, `actual_price`, `sell_price`, `available_quantity`, `stock_quantity`, `brand_id`, `product_location`, `has_variations`, `flash_sale`, `weekly_offer`, `special_offer`, `main_image`, `product_catalogue`, `status`, `created_at`, `updated_at`) VALUES
(442, 'P00388', NULL, 'CLINICAL EDUCATION KIT: UNIMATRIX R SYSTEM', 'clinical-education-kit-unimatrix-r-system-P00388', '<p>Unimatrix R<br>Preformed sectional matrix system for class II restorations</p><p>Save time, minimize rework, enjoy ease of use, and put your patients’ comfort first! A new concept in Class II restorations.</p><p>The Unimatrix R system is designed to optimize Class II restorations. Consisting of preformed matrices, reinforced rings and triangular silicone tips, it allows for much easier reconstruction of the contact points. The rings are reinforced for stability and strength.</p><p>They are available in two formats: Hard, for cases that require a contact point with higher pressure, and Soft, for cases that require less pressure. Available in 3 different sizes, the convex shape of the matrices provides perfect dental anatomy. In addition, silicone protectors optimize the adaptation of the matrix.</p>', NULL, NULL, NULL, 150, '7', 0.00, 10375.00, 10375.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-29-68885f91e21ad.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-04 09:55:36'),
