(449, 'P00395', NULL, 'METALLIC MATRIX STRIP-DEAD SOFT 0.05X6MMX1MTR', 'metallic-matrix-strip-dead-soft-005x6mmx1mtr', NULL, NULL, NULL, NULL, 88, '7', 0.00, 376.00, 376.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, NULL, NULL, 1, '2025-07-28 21:55:33', '2025-08-22 17:33:13'),
(450, 'P00396', NULL, 'METALLIC MATRIX STRIP-DEAD SOFT', 'metallic-matrix-strip-dead-soft-P00396', '<p>Features and Benefits</p><p>– In composite restorations, helps to rebuild the dental anatomy<br>– Protect adjacent teeth during preparation, acid conditioning and adhesive application<br>– Due its transparency, resins can be cured through the matrix<br>– Thickness of 0,05mm, for an easy insertion in the proximal area<br>– Available in reel and cut strips</p><p>&nbsp;</p>', NULL, NULL, NULL, 157, '7', 0.00, 0.00, 0.00, 0, 0, 97, NULL, 1, 0, NULL, NULL, '2025-07-29-688879a3134a5.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 17:00:09'),
(451, 'P00397', NULL, 'Microcut - 1 Hack-Saw + 1 Saw + 1 Sanding Blade', 'microcut-1-hack-saw-1-saw-1-sanding-blade-P00397', '<p>Microcut - 1 Hack-Saw + 1 Saw Blade + 1 Sanding Blade. &nbsp;Designed to remove excesses of composites, adhesives, cements and amalgams from proximal areas. Indicated for Inlay and Onlay procedures and laminated veneers. Easy and safe way to remove surplus materials without damaging the contact points.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Manufacturer Code</strong></td><td>3030</td></tr><tr><td><strong>Brand</strong></td><td>Microcut</td></tr><tr><td><strong>Component(s)</strong></td><td>Hack-saw, saw blade &amp; sanding blade</td></tr><tr><td><strong>Packaging</strong></td><td>Kit</td></tr></tbody></table></figure>', NULL, NULL, 157, '7', 0.00, 6000.00, 6000.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-29-68885ab9be6f3.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:59:36'),
(452, 'P00398', NULL, 'Microcut Refill, Diamond Strips', 'microcut-refill-diamond-strips-P00398', '<p>Step into the future of dentistry with Microcut, a sophisticated manual dental instrument designed to enhance the precision and ease of your dental procedures. This revolutionary tool combines the robustness of a metal hack-saw frame with the versatility of interchangeable saw blades and diamond strips, offering a one-stop solution for various dental applications. From removing excess composites and adhesives to performing intricate orthodontic slices, Microcut serves as a trusted companion in your dental practice.</p><h2><strong>Embrace the Precision of Microcut</strong></h2><p>Microcut, equipped with a finely crafted saw blade of just 0.05mm thickness, is your key to unlocking effortless access to the challenging interproximal regions. Say goodbye to the struggle of reaching difficult spaces, as this ultra-thin blade navigates these areas with ease, enabling efficient removal of excess composites, adhesives, and cements.</p><h2><strong>Experience the Versatility of Diamond Strips</strong></h2><p>The Microcut\'s diamond strips further elevate its functionality, providing seamless access to interproximal regions. Their utilization extends beyond simple access - these versatile strips are designed for executing precise orthodontic slices, and for the meticulous finishing and polishing of the region. With Microcut, you have the freedom to perform diverse procedures with one single tool, enhancing your efficiency and productivity.</p>', NULL, NULL, NULL, 157, '7', 0.00, 2500.00, 2500.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-29-6888585fc5b7f.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:59:15'),
(453, 'P00399', NULL, 'MicroCut Refill – Saw Blade, 5/Pk by TDV', 'microcut-refill-saw-blade-5pk-by-tdv-P00399', '<p><strong>Microcut Refill – Saw Blade, 5/Pk (TDV 3031)</strong><br>The Microcut Refill Saw Blades by TDV are precision-engineered components designed for safe and efficient interproximal reduction and contouring in restorative dental procedures. This pack contains 5 high-quality stainless steel blades compatible with Microcut systems, offering exceptional cutting performance and durability. Ideal for clinicians seeking accuracy and control in enamel reduction and finishing, these blades ensure minimal patient discomfort while maintaining optimal clinical results. Trusted by dental professionals, Microcut blades are a reliable choice for enhancing workflow efficiency and treatment outcomes.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Component(s)</strong></td><td>Saw blade</td></tr><tr><td><strong>Packaging</strong></td><td>5 blades</td></tr><tr><td><strong>Weight</strong></td><td>0.1 lbs</td></tr><tr><td><strong>Dimensions</strong></td><td>2 × 2 × 0.5 in</td></tr></tbody></table></figure>', '<ul><li>5 blades</li></ul>', NULL, 157, '7', 0.00, 2000.00, 2000.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-29-6888564cced30.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:58:45'),
(454, 'P00400', NULL, 'TDV Poligloss (3gm syringe) Dental Polishing Paste', 'tdv-poligloss-3gm-syringe-dental-polishing-paste-P00400', '<p>Poligloss is an aluminum oxide polishing paste.<br><br><strong>Indication</strong><br>Indicated for final polishing and maintenance of esthetic restorations, providing a final gloss in all restorative materials and dental enamel. Poligloss can also be combined with TDV felt discs or other velvety discs.<br><br><strong>Features</strong><br>&nbsp;</p><ul><li>Applied in composites, amalgams, metals, ceramics and dental enamel</li><li>Useful at the clinic and laboratory</li><li>Excellent natural brightness</li><li>Hydrosouble, for an easy cleaning</li></ul>', NULL, '<ul><li>3g Syringe</li></ul>', NULL, 158, '7', 0.00, 1500.00, 1500.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-29-68885468ca6d0.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:54:51'),
(455, 'P00401', NULL, 'PRAXIS -120 ASSORTEF ABRASIVE DISCS + MANDREL', 'praxis-120-assortef-abrasive-discs-mandrel-P00401', '<p>Praxis Sandpaper Discs - 120 Assorted Discs + Mandrel POP-ON. 3/8\" and 1/2\" diameters in 4 grits, identified by colors. For composite restoration finishing and polishing.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Manufacturer Code</strong></td><td>3001</td></tr><tr><td><strong>Brand</strong></td><td>Praxis</td></tr><tr><td><strong>Dimensions</strong></td><td>Assorted</td></tr><tr><td><strong>Grit</strong></td><td>Assorted</td></tr><tr><td><strong>Packaging</strong></td><td>Package of 120 discs with 1 mandrel</td></tr><tr><td><strong>Primary Market</strong></td><td>Not Specified</td></tr><tr><td><strong>Siding / Shape</strong></td><td>Sand</td></tr><tr><td><strong>Style</strong></td><td>Pop-on</td></tr></tbody></table></figure>', NULL, NULL, 159, '7', 0.00, 7500.00, 7500.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-29-688866372863f.png', NULL, 1, '2025-07-28 21:55:33', '2025-07-29 13:37:50'),
(456, 'P00402', NULL, 'TDV Praxis Dental Finishing & Polishing Kit', 'tdv-praxis-dental-finishing-polishing-kit-P00402', '<p>Praxis is a Finishing and polishing discs for composites.Praxis is a pop-on mandrel system indicated for a complete sequence of polishing.<br><br><strong>Features</strong><br>&nbsp;</p><ul><li>Metallic core for an easy fit on the mandrel</li><li>Enables the fast inversion of the abrasive surface to mesial and distal positions</li><li>Ultra-fine and very flexible discs</li><li>Four grits codified by colors: Coarse (burgundy), Medium (pink), Fine (light pink) e Extrafine (white)</li><li>Available in ½” and 3/8” sizes</li><li>Praxis Mandrel required</li></ul>', NULL, '<ul><li>120 Assorted Discs + 1 Mandrel</li></ul>', NULL, 154, '7', 0.00, 4765.00, 4765.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-29-68884ebad1db8.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:48:56'),
(457, 'P00403', NULL, 'RESINLAY PATTERN PHOTO GEL- 3G GEL + 3 TIPS', 'resinlay-pattern-photo-gel-3g-gel-3-tips-P00403', '<h2><strong>Description</strong></h2><h2><strong>Resinlay Pattern Photo Gel</strong></h2><p>Light-curing acrylic resin gel for universal modeling</p><p><strong>Save time and product. Resinlay Pattern Photo brings a new concept in acrylic resins.</strong></p><p>Synonymous with agility and value for money, it is light-curing, ready to use and does not heat up like conventional resins! Resinlay Pattern Photo was developed for universal modeling and fabrication of casting patterns.</p><p>The gel version is indicated for use in places that are difficult to access or that require greater adhesion and pressure, it has ideal thixotropy for precise application, either direct or indirect. Much more practicality for your daily life!</p><p>The applicator tips have been carefully designed to make application easy and fast. Resinlay Pattern Photo Gel can be used alone or combined with the Paste version in associated techniques. Various forms of application!</p><h2><strong>Benefits</strong></h2><ul><li>Easy application.</li><li>There will be no runoff from the point of application.</li><li>Greater flexibility compared to self-curing wax and/or acrylic resin.</li><li>Convenience and time savings.</li><li>Applicator tips – Ideal for insertion in places of difficult access.</li></ul>', NULL, NULL, NULL, 502, '7', 0.00, 2400.00, 2400.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-29-68884c6fcfdfd.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:47:42'),
(458, 'P00404', NULL, 'TDV Sandpaper Discs - (Dental Finishing and Polishing Discs)', 'tdv-sandpaper-discs-dental-finishing-and-polishing-discs-P00404', '<p>Indicated for finishing and polishing in composites with four grits codified by colors<br><br><strong>Features</strong><br>&nbsp;</p><ul><li>Excellent Profitability</li><li>Grits: Coarse (burgundy), Medium (pink), Fine (light pink) e Extrafine (white)</li><li>Ultra-fine discs, very flexible and versatile, allow access to the most difficult regions</li></ul>', NULL, '<ul><li>SandPaper Disc 12 Mm&nbsp;100 Assorted Discs</li><li>SandPaper Disc 16 Mm 100 Assorted Discs</li></ul>', NULL, 159, '7', 0.00, 1800.00, 1800.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-29-68884b16e7c91.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:40:46'),
(459, 'P00405', NULL, 'TDV Superfix X8 Discs Type Shofu Polishing Kit', 'tdv-superfix-x8-discs-type-shofu-polishing-kit-P00405', '<p>The TDV Superfix polishing kit features 8 assorted sanding discs designed for the finishing and polishing of composite resin restorations. With no metal center, these discs maximize the abrasive surface for thorough efficiency. They come in two diameter options, 9.5 mm and 12.7 mm, with four color-coded grits for easy selection. Flexible supports allow compatibility with the Versaplus mandrel system, ensuring usability in different applications. Ideal for reaching intricate areas, they ensure a smooth and professional finish every time.<br><br>Introducing the TDV Superfix X8 Discs, a premium kit of sanding discs crafted for professionals seeking perfection in polishing and finishing composite resin restorations. This set includes 8 assorted discs that feature a flexible backing, allowing them to adapt seamlessly to the Versaplus mandrel system. The discs come in two perfectly sized diameters of 9.5 mm and 12.7 mm, and are available in four distinct color-coded grit options, making it simple to choose the right disc for any task. What sets these discs apart is the absence of a metal center. This innovative design not only prevents damage to dental pieces but also ensures that you are making the most of the disc\'s abrasive surface. The ultra-thin and malleable nature of the TDV Superfix discs permits easy access to hard-to-reach areas, offering an incredible level of precision. Ideal for dental professionals looking to achieve the finest finishes, this kit guarantees durable and practical applications that meet the highest standards established by regulatory authorities. Elevate your finishing process with the TDV Superfix kit, where quality meets efficiency.<br><br><strong>Usage ideas</strong> Perfect for dental professionals, the TDV Superfix discs are ideal for polishing composite resins in dental restorations. They are particularly useful when working in tight spaces, allowing for detail-oriented finishing without compromising safety. Use these discs for dental care, providing patients with smooth, well-finished surfaces. Great for use in cosmetic dental procedures or routine restorations, enhancing dental aesthetics seamlessly. Incorporate them into your standard dental toolkit to ensure the highest quality results in every procedure.<br>&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Origin</strong></td><td>Argentina</td></tr><tr><td><strong>Vendor</strong></td><td>Shop on Mercado Libre Argentina</td></tr><tr><td><strong>Brand</strong></td><td>TDV</td></tr><tr><td><strong>Weight</strong></td><td>0.26 KGS</td></tr><tr><td><strong>Condition</strong></td><td>New</td></tr><tr><td><strong>UPC</strong></td><td>7897990326813</td></tr></tbody></table></figure>', NULL, NULL, 154, '7', 0.00, 3850.00, 3850.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-29-688849fe16db5.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:40:06'),
(460, 'P00406', NULL, 'TDV Unimatrix Mini Kit', 'tdv-unimatrix-mini-kit-P00406', '<p>Preformed sectional matrix system for class II restorations</p><p>Unimatrix is a ring to adjust the matrix and the wedge at the proximal in Class II procedures, ensuring a very good adaptation that will result in an excellent contact point re-establishment.</p><h3><strong>Features and Benefits</strong></h3><ul><li>Easy and quick placement by a ring system, which replace the typical matrix holders &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li><li>The ring includes silicone tips for a better adjustment &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li><li>To be used with the sectional matrices, allowing tight contact points</li></ul><h3><strong>Pack includes: 25 Assorted matrices, 1 x Ring and 4 x Silicone tubes</strong></h3>', NULL, NULL, NULL, 150, '7', 0.00, 4390.00, 4390.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-29-688848c1c61ba.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:38:53'),
(461, 'P00407', NULL, 'TDV Unimatrix Plier', 'tdv-unimatrix-plier-P00407', '<ul><li>Developed to handle accurately and safety all kinds of the Unimatrix Ring as well as the Elastic Wedges system.</li></ul>', '<figure class=\"table\"><table><tbody><tr><th>Weight</th><td>0.01 kg</td></tr><tr><th>Brands</th><td><a href=\"https://dentalstall.com/brands/buy-tdv-dental-products-online-at-best-price/\">TDV</a></td></tr></tbody></table></figure>', '<ul><li>1 X Unimatrix Plier</li></ul>', NULL, 356, '7', 0.00, 3650.00, 3650.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-28-6887a901c63e2.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:38:18'),
(462, 'P00408', NULL, 'Unimatrix R Sectional Matrix', 'unimatrix-r-sectional-matrix-P00408', '<h2><strong>Unimatrix R</strong></h2><p><strong>Preformed sectional matrix system for class II restorations</strong></p><p>Save time, minimize rework, enjoy ease of use, and put your patients’ comfort first!<strong>&nbsp;A new concept in Class II restorations</strong>.</p><p>The Unimatrix R system is designed to optimize Class II restorations. Consisting of preformed matrices, reinforced rings and triangular silicone tips, it allows for much easier reconstruction of the contact points. The rings are reinforced for stability and strength.</p><p>They are available in two formats: Hard, for cases that require a contact point with higher pressure, and Soft, for cases that require less pressure. Available in 3 different sizes, the convex shape of the matrices provides perfect dental anatomy. In addition, silicone protectors optimize the adaptation of the matrix.</p>', NULL, NULL, NULL, 150, '7', 0.00, 9500.00, 9500.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-28-6887a621645e5.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:34:41'),
(463, 'P00409', NULL, 'TDV Unimatrix R Matrices', 'tdv-unimatrix-r-matrices-P00409', '<p>The Unimatrix R System is composed by three sizes of preformed sectional matrices and two reinforced rings, Hard and Soft, which provides the ideal strength on the dental separation, more stability on the procedure and longevity. Both rings are equipped with triangular silicone tips.<br><br><strong>Features</strong><br>&nbsp;</p><ul><li>Reinforced Rings:</li><li>Hard (blue): Indicated for cases requiring more pressure and dental separation</li><li>Soft (pink): Indicated for cases requiring less pressure and dental separation</li><li>Both have a greater resistance to deformation, extending its lifetime</li><li>Its angles allows a perfect adaptation to the occlusal-cervical height, no influencing of the adjacent tooth</li><li>Triangular Silicone Tips</li><li>More anatomical, providing a better adaptation</li><li>Offer more comfort to the patient</li><li>Sectional Matrices</li><li>Convexity and thickness of 0,05mm, allowing reconstruction of perfect and tight contact points, giving a natural anatomy to the tooth</li><li>Available in 3 different sizes (S|M|L) for a better adaptation in all clinical situations</li><li>Unimatrix R is a very complete and profitable system. Simple to use and fast to set, that provides an excellent final result to the dentist, saving the professional time and offering more confident to reconstruct contact points.</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Brand</strong></td><td>TDV</td></tr><tr><td><strong>Category</strong></td><td>Restorative &amp; Cosmetic</td></tr><tr><td><strong>Subcategory</strong></td><td>Matrix Bands</td></tr><tr><td><strong>Additional Subcategory</strong></td><td>Matrix Bands / Retainers / Wedges</td></tr></tbody></table></figure>', '<ul><li>50 Assorted Discs + 2 Tings (Hard+Soft) + 8 Triangular Silicone Tips</li></ul>', NULL, 150, '7', 0.00, 7100.00, 7100.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-28-6887a47df3122.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:34:13'),
(464, 'P00410', NULL, 'TDV Unimatrix Refill kit - (Pack of 100 Assorted Matrices) Dental Products', 'tdv-unimatrix-refill-kit-pack-of-100-assorted-matrices-dental-products-P00410', '<p>The Unimatrix sectional matrices system, indicated for Class II restorations, is composed by preformed sectional matrices and Unimatrix Rings for its attachment. Among the advantages that this system provides a side conventional matrices, stands out the facility of contact points and tooth natural anatomy reconstruction, facility of use and comfort to the patient. The ends of Unimatrix rings are equipped with silicon tubes that provide a better set adaptation.&nbsp;</p>', NULL, NULL, NULL, 152, '7', 0.00, 6800.00, 6800.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-28-6887a32f925f8.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:30:21'),
(465, 'P00411', NULL, 'Unimatrix Sectional Matrix Refill x 50', 'unimatrix-sectional-matrix-refill-x-50-P00411', '<p>Unimatrix Refill – 50 pcs Stainless Steel Preformed Sectional Matrices.&nbsp; PLEASE NOTE&nbsp; the Large size matrix has a sub-gingival extension or cervical flap that provides more coverage at gingival margins and facilitates placement in the gingival sulcus for sub-gingival restorations.</p><p><strong>Manufacturer Code:</strong></p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Manufacturer Code</strong></td><td>4125G (Large) 4125M (Medium) 4125S (Small) 4125 (Assorted)</td></tr><tr><td><strong>Brand</strong></td><td>Unimatrix TDV</td></tr><tr><td><strong>Material/Thickness</strong></td><td>Stainless Steel</td></tr><tr><td><strong>Packaging</strong></td><td>Package of 50 matrices</td></tr><tr><td><strong>Primary Market</strong></td><td>Not Specified</td></tr><tr><td><strong>Size/Design/Shape</strong></td><td>Large with cervical extension</td></tr><tr><td><strong>Type</strong></td><td>Sectional</td></tr></tbody></table></figure><p>&nbsp;</p>', NULL, NULL, 157, '7', 0.00, 3940.00, 3940.00, 10, 10, 97, NULL, 0, 0, NULL, NULL, '2025-07-28-6887a275aabca.png', NULL, 1, '2025-07-28 21:55:33', '2025-08-03 16:29:30'),
