(477, 'P00423', NULL, 'NSK Varios E11 Endodontic Ultrasonic Scaling Tip', 'nsk-varios-e11-endodontic-ultrasonic-scaling-tip-P00423', '<p>The NSK Varios E11 Endodontic Ultrasonic Scaling Tip is specifically designed for ultrasonic endodontic treatments, delivering high precision and efficiency in root canal cleaning and debridement. Its design allows for optimal access and navigation through complex canal systems, providing effective cleaning while preserving tooth structure. The ultrasonic vibrations ensure thorough removal of debris, bacteria, and infected tissue, making it an essential tool for endodontic procedures.</p><p><strong>Specifically Designed for Endodontics-&nbsp;</strong>The E11 tip is tailored for root canal treatment, including debridement and biofilm removal, not routine scaling. Its shape is optimised for navigating curved and complex canal anatomy, allowing thorough cleaning while preserving tooth structure.</p><p><strong>Ultrasonic Precision &amp; Efficiency-&nbsp;</strong>Uses piezoelectric ultrasonic vibrations to effectively dislodge debris, bacteria, and infected tissue from canals. Offers greater tactile control than rotary or manual files in delicate endodontic spaces.</p><p><strong>Minimally Invasive Cleaning-&nbsp;</strong>The slender, ultrasonic design gently cleans without over-instrumentation, helping preserve dentin integrity while achieving deep canal sanitation.</p><p><strong>Compatible with NSK Varios Systems-</strong> Seamlessly integrates with NSK Varios ultrasonic units such as Varios970 and Varios Combi Pro--benefiting from their iPiezo auto-tuning and stable output features.</p><p><strong>Broad Tip Range in a Trusted Ecosystem-&nbsp;</strong>NSK\'s Varios line offers over 70 tip variants for various applications, ensuring the right tip for every task---from scaling to endodontics to restorative work.</p><p>Choose the NSK Varios E11 Endodontic Ultrasonic Scaling Tip when you\'re performing precision root canal cleaning and require a specialised, high-performance ultrasonic tip that aids in safe, effective endodontic debribement.</p>', NULL, NULL, NULL, 501, '3', 0.00, 9200.00, 9200.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-30-6889dd2889778.png', NULL, 1, '2025-07-30 14:36:52', '2025-08-13 15:42:56'),
(478, 'P00424', NULL, 'NSK Varios E4D Endodontic Ultrasonic Scaling Tip', 'nsk-varios-e4d-endodontic-ultrasonic-scaling-tip-P00424', '<p>The NSK Varios E4D Endodontic Ultrasonic Scaling Tip is expertly designed for precision endodontic treatments, utilising ultrasonic technology to achieve efficient cleaning and debridement of root canals. Its diamond-coated surface enhances its cutting ability, making it ideal for accessing difficult areas within the root canal and removing calcifications, debris, and biofilm with accuracy.</p><p><strong>Precision Design for Deep Canal Access-&nbsp;</strong>The E4D tip features a slim, elongated shape that allows it to reach deep into narrow and curved root canals, improved access to complex anatomical areas that are difficult to clean with traditional instruments.&nbsp;</p><p><strong>Enhanced Ultrasonic Irrigant Activation-&nbsp;</strong>Designed to maximise irrigant agitation, the E4D improves the penetration and effectiveness of cleaning solutions, such as sodium hypochlorite and EDTA, ensuring thorough debridement of lateral canals, isthmuses and apical regions.</p><p><strong>Controlled, Low-Power Ultrasonic Vibration-&nbsp;</strong>The E4D tip is fully compatible with NSK\'s Varios ultrasonic scaler systems, providing reliable energy transfer, smooth, operation, and ease of use for endodontic specialists.</p><p><strong>Durable and Autoclavable-&nbsp;</strong>Made from high-quality, corrosion-resistant materials, the E4D tip withstands repeated sterilisation cycles while maintaining its precision and structural integrity over time.&nbsp;</p><p><strong>Compatible with NSK Varios Ultrasonic Units-</strong> The E4D tip is fully compatible with NSK\'s Varios ultrasonic scaler systems, providing reliable energy transfer, smooth operation, and ease of use for endodontic specialists.</p>', NULL, NULL, NULL, 501, '3', 0.00, 1.00, 1.00, 0, 0, 77, NULL, 0, 0, NULL, NULL, '2025-07-30-6889de0858b4f.png', NULL, 1, '2025-07-30 14:40:37', '2025-08-15 11:19:55'),
(479, 'P00425', NULL, 'NSK Varios E7 Endodontic Ultrasonic Scaling Tip', 'nsk-varios-e7-endodontic-ultrasonic-scaling-tip-P00425', '<p>The NSK Varios E7 Endodontic Ultrasonic Scaling Tip is specifically designed to enhance the efficiency and effectiveness of root canal treatments. Utilising advanced ultrasonic technology, this tip facilitates meticulous cleaning and debridement within the intricate anatomy of root canals, ensuring optimal conditions for successful endodontic procedures.</p><p><strong>Ideal for Gutta-Percha and Sealer Removal-&nbsp;</strong>The E7 tip is purpose-built for the ultrasonic removal of gutta-percha, root canal sealers, and filling materials, particularly in the coronal and middle thirds of the canal. It enables fast, effective retreatment without excessive mechanical pressure.</p><p><strong>Strong and Tapered for Controlled Debridement-&nbsp;</strong>Its robust, tapered design allows safe penetration and breakdown of obturation materials while maintaining the original canal anatomy. It\'s an essential tool for clinicians performing non-surgical endodontic retreatments.</p><p><strong>Precise Ultrasonic Vibration for Minimal Risk-&nbsp;</strong>The E7 delivers controlled ultrasonic energy that effectively agitates and dislodges materials without over-instrumentation this reduces the risk of canal wall damage or ledging, improving procedural safety.&nbsp;</p><p><strong>Designed for Use with NSK Varios Ultrasonic Units-</strong> Fully compatible with NSK Varios ultrasonic scaler systems, the E7 offers reliable power transmission and smooth handling, allowing for consistent performance throughout complex procedures.</p><p><strong>Reusable, Sterilisable, and Durable-&nbsp;</strong>Manufactured from high-grade, corrosion-resistant materials, the E7 tip is fully autoclavable and built to withstand repeated clinical use, making it a dependable choice for modern endodontic practices.</p>', NULL, NULL, NULL, 501, '3', 0.00, 1.00, 1.00, 10, 10, 77, NULL, 0, 0, NULL, NULL, '2025-07-30-6889de98a271a.png', NULL, 1, '2025-07-30 14:43:00', '2025-08-22 17:46:08'),
(480, 'P00426', NULL, 'NSK Endo-Mate DT Endomotor', 'nsk-endo-mate-dt-endomotor-P00426', '<p><strong>NSK Endo-Mate DT Endomotor </strong>is a state-of-the-art Endo Micromotor that offers exceptional functionality and convenience. Specifically designed for use with Ni-Ti files from all major suppliers, it provides precise and reliable performance in endodontic procedures. One of its standout features is the user-programmable preset memory, which allows you to store up to 9 speed and torque settings. This ensures that you can easily select the optimal settings based on the specific requirements of each procedure, streamlining your workflow and enhancing efficiency. Portability is another key advantage of the ENDO-MATE DT. With its compact and lightweight control unit, you can conveniently transport it between dental offices, providing flexibility and versatility in different clinical settings. Whether you prefer to connect it directly to a wall outlet or utilize the rechargeable battery option, the ENDO-MATE DT offers the freedom to choose the power source that suits your needs. The device features a large LCD display, offering excellent visibility and allowing for instantaneous recognition of micromotor status. This user-friendly interface enhances usability and facilitates quick and accurate adjustments during procedures. With its advanced design, compatibility with major file suppliers, and precise performance, the ENDO-MATE DT by NSK is an indispensable tool for endodontic treatments. It empowers dental professionals to achieve exceptional results with ease and confidence, revolutionizing the way root canal procedures are performed.</p><p><br>&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Torque Control</strong></td><td>0.3 to 3 N·cm</td></tr><tr><td><strong>Speed Range</strong></td><td>140 – 550 min⁻¹</td></tr><tr><td><strong>Dimensions (W × D × H)</strong></td><td>92 × 148 × 124 mm</td></tr><tr><td><strong>Weight</strong></td><td>Unit: 456 gMotor Handpiece &amp; Cord: 92 g</td></tr><tr><td><strong>Power Supply</strong></td><td>AC 120V 60 Hz / 230V 50/60 HzBattery Pack</td></tr></tbody></table></figure>', '<ul><li>1 X Control Unit</li><li>1 X Motor And Cord</li><li>1 X Handpiece Stand</li><li>1 x Contra Angle Handpiece (16:1)</li><li>1 X AC Adaptor</li></ul><p>&nbsp;</p>', NULL, 77, '3', 0.00, 60060.00, 60060.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-30-6889e2770a2c5.png', NULL, 1, '2025-07-30 14:59:31', '2025-08-13 13:53:54'),
(481, 'P00427', NULL, 'NSK Contrangle Handpiece FX 22', 'nsk-contrangle-handpiece-fx-22-P00427', '<p>The <strong>NSK Contrangle Handpiece FX 22</strong>, is a cutting-edge dental instrument that combines advanced features and superior performance. This contra angle handpiece is specifically designed to provide exceptional visibility and optimal balance, revolutionizing the dental experience for both professionals and patients. With its slim head and body design, the NSK Contrangle Handpiece FX 22 offers improved visibility of the oral operational field. Even hard-to-reach areas within the oral cavity become more accessible, allowing dental professionals to perform precise and intricate procedures with ease. The enhanced visibility ensures accurate treatment and boosts overall efficiency.The NSK Contrangle Handpiece FX 22 guarantees a lightweight yet robust construction. Compared to traditional brass materials, stainless steel offers superior durability, ensuring that the handpiece withstands the rigors of daily dental practice. The reduced weight contributes to ergonomic hand comfort, minimizing hand fatigue during extended procedures. Dental professionals will appreciate the realistic tactile sense provided by the stainless steel body, further enhancing their control and dexterity.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Max Speed</strong></td><td>30,000 min⁻¹</td></tr><tr><td><strong>Attachment Type</strong></td><td>Latch type</td></tr><tr><td><strong>Bur Compatibility</strong></td><td>CA burs (ø2.35 mm)</td></tr><tr><td><strong>Application</strong></td><td>Ideal for a wide range of dental procedures</td></tr></tbody></table></figure>', '<ul><li>1 x Handpiece</li></ul>', NULL, 81, '3', 0.00, 12257.00, 12257.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688af56e5e7da.png', NULL, 1, '2025-07-31 10:32:42', '2025-08-13 13:30:55'),
(482, 'P00428', NULL, 'NSK Contrangle Handpiece FX 23', 'nsk-contrangle-handpiece-fx-23-P00428', '<p><strong>NSK Contra angle Handpiece FX 23</strong> Access is a state-of-the-art dental handpiece that incorporates innovative features to enhance dental procedures. With its slim head and body design, it offers improved visibility in the oral cavity, even in hard-to-reach areas, ensuring precise and accurate dental work. The cartridge replacement system allows for easy and efficient replacement of cartridges during surgery, reducing service costs and minimizing downtime. The handpiece is equipped with the NSK Paste Defense System, which effectively prevents dust and polishing paste debris from entering, ensuring its longevity. The rotor is coated with NSK DLC, a protective coating that prevents breakage caused by surface abrasions from polishing paste, enhancing its durability. The Clean Head System includes an anti-suck back mechanism that prevents blood and foreign matter from entering the head, prolonging the lifespan of the handpiece. The Push Button Chuck mechanism allows for hassle-free bur insertion and removal with a simple push of a button, ensuring secure retention even under high loads. With exceptional durability, efficiency, and reliability, the NSK Contra angle Handpiece FX 23 Access is an advanced tool for dental professionals, enhancing visibility, enabling easy cartridge replacement, preventing debris from entering, and ensuring secure bur retention.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Gear Ratio</strong></td><td>1:1 Direct Drive</td></tr><tr><td><strong>Compatible Bur Diameter</strong></td><td>Ø2.35 mm</td></tr><tr><td><strong>Maximum Speed</strong></td><td>30,000 min⁻¹</td></tr><tr><td><strong>Chuck Mechanism</strong></td><td>Push Button (for easy bur insertion/removal)</td></tr></tbody></table></figure>', '<ul><li>1 x Handpiece</li></ul>', NULL, 81, '3', 0.00, 15600.00, 15600.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688af6d87febf.png', NULL, 1, '2025-07-31 10:38:44', '2025-08-13 13:32:12'),
(483, 'P00429', NULL, 'NSK FX 65 Straight Handpiece', 'nsk-fx-65-straight-handpiece-P00429', '<p><strong>NSK FX 65 Straight Handpiece</strong> is a cutting-edge dental instrument that offers exceptional performance and precision for a variety of dental procedures. One of the standout features of the FX 65 is its ergonomic design, which ensures comfortable handling and optimal control during use. The slim and lightweight construction reduces hand and wrist fatigue, allowing dental professionals to work for extended periods without discomfort. The FX 65 is equipped with NSK\'s advanced Clean Head System, which prevents the entry of blood and debris into the head of the handpiece. This system maintains the internal components\' cleanliness, enhancing their longevity and reducing the risk of damage or contamination. The handpiece utilizes high-precision gears that run quietly and provide supreme durability. This ensures smooth operation, minimal vibrations, and exceptional reliability, contributing to a comfortable and efficient dental experience for both the dentist and the patient.</p><p>The 1:1 direct drive gear ratio of the FX 65 allows for precise control and efficient power transfer to the bur. This results in accurate cutting, drilling, or polishing, enabling dental professionals to achieve optimal treatment outcomes. Furthermore, the FX 65 features a push button chuck mechanism, allowing for effortless and tool-free bur insertion and removal. This simplifies the workflow and saves time during procedures, enhancing efficiency and productivity in the dental practice.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Clean Head System</strong></td><td>Yes</td></tr><tr><td><strong>Maximum Speed</strong></td><td>40,000 rpm</td></tr><tr><td><strong>Gear Ratio</strong></td><td>1:1 Direct Drive</td></tr><tr><td><strong>Bur Compatibility</strong></td><td>HP Burs (Ø2.35 mm)</td></tr></tbody></table></figure>', '<ul><li>1 x Handpiece</li></ul>', NULL, 81, '3', 0.00, 19036.00, 19036.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688af80947471.png', NULL, 1, '2025-07-31 10:43:49', '2025-08-13 13:33:13'),
(484, 'P00430', NULL, 'NSK FX Plus With ARV Airotor Handpiece', 'nsk-fx-plus-with-arv-airotor-handpiece-P00430', '<p>FX Plus high-speed handpiece is a cutting-edge tool used in modern dental practices, specifically designed to meet the highest standards in the industry. It boasts a power of 30W, providing exceptional performance for various dental procedures. One of the key advancements in this handpiece is the incorporation of ARV (Anti-retraction Valve) technology. This innovative feature plays a crucial role in preventing the reverse flow of debris into the handpiece, thus effectively reducing the risk of cross-contamination. By implementing ARV technology, dental professionals can ensure a safer and more hygienic environment for both themselves and their patients. The precision engineering of the FX Plus handpiece guarantees the strength and durability necessary to withstand rigorous clinical procedures. It is built to withstand the demands of regular use while maintaining optimal performance over time. This reliability ensures that dental practitioners can carry out their procedures with confidence and efficiency.</p><p>The FX Plus handpiece is equipped with a turbine cartridge that offers enhanced smoothness during operation. This feature ensures a seamless experience for both the dentist and the patient, minimizing discomfort and enhancing overall efficiency. Furthermore, the bur retention system in the FX Plus handpiece is specifically designed to securely hold the bur, even under increased torque loads. This ensures stability and reduces the risk of slippage, allowing for precise and accurate dental work. The body of the handpiece is constructed from stainless steel, providing robustness and longevity. Additionally, the ergonomic design of the handpiece ensures a secure grip, allowing for optimal control and maneuverability during procedures. The angle of the handpiece is carefully calibrated to provide excellent direct visibility of the operating site without compromising the dentist\'s comfort or the patient\'s safety.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Speed</strong></td><td>325,000–410,000 RPM</td></tr><tr><td><strong>Body Material</strong></td><td>Stainless Steel</td></tr><tr><td><strong>Bearings</strong></td><td>Ceramic Bearings</td></tr><tr><td><strong>Chuck Mechanism</strong></td><td>Push Button Chuck</td></tr><tr><td><strong>Power (Standard Head)</strong></td><td>30 Watt</td></tr><tr><td><strong>Power (Mini Head)</strong></td><td>27 Watt</td></tr><tr><td><strong>Standard Head Size</strong></td><td>Ø12.1 × H13.3 mm</td></tr><tr><td><strong>Miniature Head Size</strong></td><td>Ø10.6 × H12.4 mm</td></tr></tbody></table></figure>', '<ul><li>1 x NSK FX Plus With ARV Handpiece</li></ul>', NULL, 81, '3', 0.00, 25500.00, 25500.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688b012d2fee3.png', NULL, 1, '2025-07-31 11:22:49', '2025-08-13 13:51:40');
