(485, 'P00431', NULL, 'NSK Pana Air FX Standard Head Chuck Type Airotor Handpiece PAF - SB2', 'nsk-pana-air-fx-standard-head-chuck-type-airotor-handpiece-paf-sb2-P00431', '<p><strong>NSK Pana Air Handpiece FX SB2</strong> is an exceptional dental handpiece that combines high performance, durability, and user-friendly features to meet the demands of dental professionals. &nbsp;This handpiece stands out due to its remarkable rotation speed range of 350,000 to 450,000 min-1, ensuring efficient cutting and drilling for various dental procedures. The high-speed rotation enables precise and accurate work, contributing to excellent treatment outcomes. Equipped with a screw type or wrench chuck, the handpiece securely holds ISO 1797-1 Ø1.59 - 1.60mm standard burs, ensuring reliable bur retention during procedures. The chuck\'s 10.2mm chucking length accommodates different bur sizes, while the maximum bur length of 21mm allows for versatility in dental applications.</p><p>The handpiece features a stainless steel body, guaranteeing durability and resistance to corrosion. Its ergonomic design ensures optimal comfort and control for dental professionals, even during extended use. The comfortable grip minimizes hand and wrist fatigue, facilitating precise and efficient procedures. The handpiece incorporates a single spray system that effectively cools and irrigates the treatment area, preventing overheating and enhancing patient comfort. The inbuilt anti-retraction valve ensures a sterile working environment by preventing backflow and contamination.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Rotation Speed</strong></td><td>350,000 – 450,000 min⁻¹</td></tr><tr><td><strong>Bur Type</strong></td><td>ISO 1797-1 Ø1.59 – 1.60 mm Standard Bur</td></tr><tr><td><strong>Chuck Type</strong></td><td>Screw Type / Wrench</td></tr><tr><td><strong>Chucking Length</strong></td><td>10.2 mm</td></tr><tr><td><strong>Max. Bur Length</strong></td><td>21 mm</td></tr><tr><td><strong>Max. Working Part Diameter</strong></td><td>Ø2 mm</td></tr><tr><td><strong>Drive Air Pressure</strong></td><td>0.20 – 0.25 MPa (2.0 – 2.5 kgf/cm²)</td></tr><tr><td><strong>Air Consumption</strong></td><td>≤55 NL/min (at 0.25 MPa)</td></tr><tr><td><strong>Water Pressure</strong></td><td>0.05 – 0.20 MPa (0.5 – 2.0 kgf/cm²)</td></tr></tbody></table></figure>', '<ul><li>1 x Airotor Handpiece</li></ul>', NULL, 81, '3', 0.00, 14500.00, 14500.00, 4, 4, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688b028f90d8f.png', NULL, 1, '2025-07-31 11:28:43', '2025-08-13 13:37:33'),
(486, 'P00432', NULL, 'NSK Cartridge PAX2 SU03 For Pana Air FX PAF-SU B2 Airotor Handpiece', 'nsk-cartridge-pax2-su03-for-pana-air-fx-paf-su-b2-airotor-handpiece-P00432', '<p><strong>The NSK Cartridge PAX2 SU03</strong> is a premium ceramic bearing cartridge designed for compatibility with NSK airotors FX Series with standard head PAF-SU for both borden two-hole and four-hole connections, as well as QD type connections. This cartridge ensures smooth and efficient operation of the handpiece, providing reliable performance for various dental procedures. The ceramic bearing construction enhances durability and longevity, contributing to extended use without compromising performance. It features a simple installation process, requiring the use of a test bur and the included wrench tool for cap removal. Cleaning and lubricating the head interior with NSK PANA SPRAY Plus/PANA SPRAY ensure optimal functionality. The cartridge is designed for seamless integration into NSK handpieces, delivering precision and comfort during dental treatments.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Bearing Type</strong></td><td>Ceramic Bearing Construction</td></tr><tr><td><strong>Compatibility</strong></td><td>NSK Airotors FX Series</td></tr><tr><td><strong>Connection Types Supported</strong></td><td>FX Series, Borden Two-Hole, Four-Hole, QD Type Connections</td></tr></tbody></table></figure>', '<ul><li>1 x NSK Cartridge PAX2 SU03</li></ul>', NULL, 81, '3', 0.00, 18500.00, 18500.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688b048a3d738.png', NULL, 1, '2025-07-31 11:37:10', '2025-08-13 13:42:09'),
(487, 'P00433', NULL, 'NSK S max Pico B2 Airotor Handpiece (P1218)', 'nsk-s-max-pico-b2-airotor-handpiece-p1218-P00433', '<p><strong>NSK S-Max Pico B2</strong> Handpiece is an exceptional dental instrument renowned for its advanced features and superior performance. With its compact design, it boasts the world\'s smallest head, which is crafted from high-class stainless steel that can withstand autoclaving at 134°C, ensuring optimal sterilization and infection control. One of its remarkable attributes is the interchangeable cartridge with ISB Turbine technology, which provides a cost-effective solution and minimizes downtime. By incorporating the spray holes into the replacement cartridge, it guarantees seamless compatibility between the cartridge and water spray, optimizing functionality and reducing the need for frequent repairs. The handpiece sets new standards with its ceramic bearings, which are not only 25% harder than traditional steel bearings but also remarkably lightweight. This unique combination reduces frictional wear among the ball bearings, resulting in exceptional durability and an extended lifespan of the handpiece, ensuring consistent performance throughout its usage.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Power</strong></td><td>9 W</td></tr><tr><td><strong>Rotation Speed</strong></td><td>380,000 – 450,000 min⁻¹</td></tr><tr><td><strong>Head Size</strong></td><td>Ø8.6 × H9.0 mm</td></tr><tr><td><strong>Water Spray</strong></td><td>Single Spray</td></tr><tr><td><strong>Body Material</strong></td><td>Stainless Steel</td></tr></tbody></table></figure>', '<ul><li>1 x Airotor Handpiece</li></ul>', NULL, 81, '3', 0.00, 1.00, 1.00, 0, 0, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688b081eba7c0.png', NULL, 1, '2025-07-31 11:52:26', '2025-08-13 13:42:48'),
(488, 'P00434', NULL, 'NSK SG20 Implant Contrangle Handpiece', 'nsk-sg20-implant-contrangle-handpiece-P00434', '<p>The<strong> NSK SG20 Implant Contrangle Non-LED Handpiece</strong> is a high-quality surgical instrument designed for precision and durability. It features a gear ratio of 20:1, providing a reliable 20 times reduction in rotational speed, which is ideal for various implant and surgical procedures. The reduction in speed ensures the necessary control and accuracy required during delicate operations.&nbsp;The handpiece is equipped with a water spray system, both externally and internally, to provide effective cooling during use. The Kirschner and Meyer cooling system. Stainless steel, the body of the NSK SG20 Implant Contrangle Handpiece exhibits excellent corrosion resistance and robustness, making it suitable for frequent use in busy clinical settings.When the handpiece is in use, the cutting edges rotate at a reduced speed due to the gear ratio of 20:1. This controlled rotation speed allows for precise control over the cutting process, minimizing the risk of accidental damage and ensuring accurate shaping and preparation of the implant site.</p><p>With a maximum speed of 2,000 min-1 and a maximum torque of 80 Ncm, this handpiece delivers sufficient power and efficiency to handle various surgical tasks effectively.&nbsp;The NSK SG20 features the innovative Push Button Chuck, an auto-chuck mechanism that allows for easy and swift bur insertion and removal without the need for any tools. The bur grip is tensioned during rotation, ensuring a secure and reliable hold of the bur, even under high loads, enhancing safety and efficiency during complex procedures.</p><p>One of the key advantages of this handpiece is its Double Sealing System. This original NSK technology prevents blood and bodily fluids from entering the instrument head, ensuring the longevity and reliability of the handpiece. With this double sealing system, the NSK SG20 Implant Contrangle Handpiece is designed to withstand the challenges of medical environments, offering exceptional durability and performance.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Gear Ratio</strong></td><td>20:1 Reduction</td></tr><tr><td><strong>Water Spray</strong></td><td>External and Internal Cooling (Kirschner and Meyer)</td></tr><tr><td><strong>Body Material</strong></td><td>Stainless Steel</td></tr><tr><td><strong>Max Speed</strong></td><td>2,000 min⁻¹</td></tr><tr><td><strong>Max Torque</strong></td><td>80 Ncm</td></tr><tr><td><strong>Chuck Mechanism</strong></td><td>Push Button Chuck</td></tr><tr><td><strong>Sealing System</strong></td><td>Double Sealing System</td></tr></tbody></table></figure>', '<ul><li>1 x Handpiece</li></ul>', NULL, 81, '3', 0.00, 1.00, 1.00, 0, 0, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688b09634ce15.png', NULL, 1, '2025-07-31 11:57:51', '2025-08-22 17:51:39'),
(489, 'P00435', NULL, 'NSK SGA ES Surgical 20Â° Handpiece', 'nsk-sga-es-surgical-20a-handpiece-P00435', '<p>The NSK SGA ES 20° Angle Handpiece is an exceptional tool designed specifically for microsurgical procedures that require precise access to hard-to-reach areas. Equipped with a 20° angled head, this handpiece allows for enhanced maneuverability and optimal visibility during delicate microsurgical tasks. Its angled design is particularly beneficial for procedures that demand intricate and accurate movements. Featuring a gear ratio of 1:1, the NSK SGS ES Straight Handpiece ensures a direct drive, providing seamless power transmission without any loss of efficiency. This results in enhanced control and optimal performance during surgical procedures. The handpiece is specifically designed to accommodate surgical burs with a diameter of Ø2.35, which is a common size used in microsurgery. This compatibility ensures that users can easily find and utilize appropriate burs for their specific surgical needs. With a maximum speed of 40,000 min-1 (rotations per minute), the NSK SGS ES Straight Handpiece offers a high-speed capability necessary for precise cutting and drilling during microsurgical procedures. One notable feature of this handpiece is the twist chuck mechanism. The twist chuck enables quick and secure attachment and removal of burs, providing convenience and ease of use for the user. This feature ensures efficient workflow and minimizes downtime during surgical procedures.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Head Angle</strong></td><td>20° Angle Handpiece</td></tr><tr><td><strong>Gear Ratio</strong></td><td>1:1 Direct Drive</td></tr><tr><td><strong>Bur Compatibility</strong></td><td>Surgical Burs (Ø2.35 mm)</td></tr><tr><td><strong>Max Speed</strong></td><td>40,000 min⁻¹</td></tr><tr><td><strong>Chuck Mechanism</strong></td><td>Twist Chuck</td></tr></tbody></table></figure>', '<ul><li>1 x&nbsp;Surgical 20° Handpiece</li></ul>', NULL, 81, '3', 0.00, 110000.00, 110000.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688b0ab8de004.png', NULL, 1, '2025-07-31 12:03:32', '2025-08-13 13:44:18'),
(490, 'P00436', NULL, 'NSK SGR2-E Micro Saw Handpiece', 'nsk-sgr2-e-micro-saw-handpiece-P00436', '<p>This surgical handpiece features a <strong>3:1 reduction transmission</strong> with a <strong>reciprocating saw mechanism</strong> delivering up to <strong>12,600 strokes per minute</strong>, making it ideal for precision bone cutting procedures. It operates with a <strong>1.8 mm vertical reciprocating motion</strong> and is equipped with an <strong>external spray nozzle</strong> for effective cooling during use. The handpiece uses a <strong>3:1 speed decreasing transmission</strong> and is compatible with <strong>ISO E-Type connections</strong>, ensuring broad usability across systems. <strong>Manufactured in Japan</strong>, it comes with a <strong>12-month warranty</strong>, ensuring reliability and peace of mind. Please note, the <strong>blade is not included</strong> and must be purchased separately.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Transmission</strong></td><td>Speed Decreasing</td></tr><tr><td><strong>Water Spray</strong></td><td>External</td></tr><tr><td><strong>Fibre-Optics</strong></td><td>No</td></tr><tr><td><strong>Manufacturer</strong></td><td>NSK</td></tr></tbody></table></figure>', NULL, NULL, 81, '3', 0.00, 136650.00, 136650.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688b0bc59009d.png', NULL, 1, '2025-07-31 12:08:01', '2025-08-13 13:49:55'),
(491, 'P00437', NULL, 'Nsk VarioSurg 3 Optic - Piezosurgery Unit', 'nsk-variosurg-3-optic-piezosurgery-unit-P00437', '<p>The<strong> NSK VarioSurg 3</strong> Control Unit, equipped with its specially-made engine, offers various advanced functions for ultrasonic bone surgery. It incorporates cutting-edge features that enhance cutting efficiency, precision, and safety. This intelligent power control system ensures precise and optimal performance during bone dissection. Another important function is the Burst Function, which adds a powerful vibration, often referred to as the \"hammer effect,\" to the vibrating tip. This feature enhances the ability to cut through hard tissue, making it easier and more efficient.</p><p>The system also prioritizes safety by minimizing the risk of damage to soft tissues, even in the event of accidental contact. Furthermore, the cavitation effect of the irrigation solution helps keep the surgical site blood-free, contributing to enhanced precision. The VarioSurg system\'s handpiece is designed with the comfort of the dental professional in mind. It features a comfortable grip, superior ergonomics, and a slim and lightweight body, which minimizes hand fatigue and allows for greater accessibility to difficult oral regions. The integration of twin LEDs at the head of the handpiece ensures outstanding visibility, making treatments safer and more precise. Additionally, the advanced ultrasonics in the handpiece eliminates heat at the operation site, enabling minimally invasive procedures<br><br>The NSK LED handpiece used with the VarioSurg system is specifically designed to be shorter and lighter, achieving a perfect balance. This design improvement makes surgical procedures easier and stress-free, enabling dental professionals to provide more precise and efficient treatment.</p>', '<p>Here is the specification table for the provided details:</p><h3><strong>Control Unit</strong></h3><figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Rated Voltage</strong></td><td>AC230V 50/60Hz</td></tr><tr><td><strong>Drive Frequency</strong></td><td>28 – 32 kHz</td></tr><tr><td><strong>Maximum Output</strong></td><td>25 W</td></tr><tr><td><strong>Power Input</strong></td><td>54 VA</td></tr><tr><td><strong>Dimensions</strong></td><td>W265 × D220 × H103 mm</td></tr><tr><td><strong>Weight</strong></td><td>3 kg</td></tr></tbody></table></figure><h3><strong>Foot Control</strong></h3><figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Model</strong></td><td>FC-78</td></tr><tr><td><strong>Cord Length</strong></td><td>2 m</td></tr><tr><td><strong>Dimensions</strong></td><td>W268 × D230 × H103 mm</td></tr><tr><td><strong>Weight</strong></td><td>1.4 kg</td></tr></tbody></table></figure><h3><strong>Handpiece</strong></h3><figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Model</strong></td><td>VS3-LED-HPSC</td></tr><tr><td><strong>Cord Length</strong></td><td>2 m</td></tr><tr><td><strong>Type of Oscillation</strong></td><td>Piezo Type</td></tr><tr><td><strong>Optic</strong></td><td>White LED</td></tr><tr><td><strong>Consumption Current (LED)</strong></td><td>0.17 A (3.5 V)</td></tr><tr><td><strong>Dimensions</strong></td><td>Ø20 × 129 mm (excluding cord)</td></tr><tr><td><strong>Weight</strong></td><td>70 g (without cord)</td></tr></tbody></table></figure>', '<ul><li>1 x Foot Control</li><li>1 X Control Unit</li><li>1 X AC Power Cord</li><li>1 X LED handpiece with cord (Unshielded 2m)</li><li>5 X Irrigation Tube</li><li>1 X Irrigation Pole</li><li>1 X Handpiece stand</li><li>7 X Tube Holder</li><li>1 X Tip Wrench</li><li>6 X Tip</li><li>1 X Tip Holder</li><li>1 X Sterilization Cassette</li></ul>', NULL, 85, '3', 0.00, 715000.00, 715000.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688b0de9b835a.png', NULL, 1, '2025-07-31 12:17:09', '2025-08-13 13:46:00'),
(492, 'P00438', NULL, 'NSK Volovere i7 E Type Micromotor (230V) Without Handpiece', 'nsk-volovere-i7-e-type-micromotor-230v-without-handpiece-P00438', '<p><strong>NSK Volovere i7 E Type Micromotor (230V) Without Handpiece</strong> is a cutting-edge dental laboratory engine by NSK, designed with precision and efficiency in mind. Its compact dimensions, just 69 mm wide and weighing only 930 g, make it a space-saving solution ideal for even the smallest workspaces. Utilizing microcomputer control, the system ensures precise and smooth operation, constantly monitoring motor motion for optimal performance. The auto-cruise function allows operators to set a speed and control the unit hands-free, reducing foot fatigue during extended tasks. With an overload alarm system, the VOLVERE i7 prioritizes safety by alerting users to potential overloads. The unit boasts a versatile speed range of 1000 to 35000 min and a torque of 4.1 Ncm, offering dental technicians flexibility and control for various procedures. Combining style, essential features, and excellent value for money, the VOLVERE i7 is NSK\'s latest innovation catering to the evolving needs of dental professionals.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Design</strong></td><td>Compact Design</td></tr><tr><td><strong>Width</strong></td><td>69 mm</td></tr><tr><td><strong>Weight</strong></td><td>930 g</td></tr></tbody></table></figure>', '<ul><li>1 x Control unit</li><li>1 x Foot control (FC-76)</li><li>1 x Handpiece Stand&nbsp;</li></ul>', NULL, 80, '3', 0.00, 8500.00, 8500.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688b0f43a39d9.png', NULL, 1, '2025-07-31 12:22:55', '2025-08-13 13:46:49'),
(493, 'P00439', NULL, 'NSK FXP-MU B2', 'nsk-fxp-mu-b2-P00439', '<p>The <strong>NSK FXP-SU B2</strong> is a high-performance dental handpiece designed for durability, precision, and ease of maintenance. It features <strong>ceramic bearings</strong> that ensure smooth operation and extended lifespan by reducing friction and heat generation. The <strong>Clean Head System</strong> is engineered to prevent the entry of oral fluids and contaminants into the head, enhancing hygiene and prolonging the life of internal components. Additionally, the handpiece supports a <strong>simple cartridge change mechanism</strong>, allowing for quick and easy maintenance, minimizing downtime in busy clinical settings. This combination of advanced features makes the FXP-SU B2 a reliable and user-friendly choice for dental professionals.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Head Type</strong></td><td>Miniature Head</td></tr><tr><td><strong>Power</strong></td><td>27 W</td></tr><tr><td><strong>Rotation Speed</strong></td><td>380,000 – 450,000 min⁻¹</td></tr><tr><td><strong>Head Size</strong></td><td>Ø10.6 × H12.4 mm</td></tr><tr><td><strong>Water Spray</strong></td><td>Quattro Spray</td></tr><tr><td><strong>Body Material</strong></td><td>Stainless Steel</td></tr></tbody></table></figure>', NULL, NULL, 81, '3', 0.00, 25500.00, 25500.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688b282f74882.png', NULL, 1, '2025-07-31 12:34:10', '2025-08-13 13:34:32'),
(494, 'P00440', NULL, 'NSK Contra Angles FX22', 'nsk-contra-angles-fx22-P00440', '<p><strong>Integrated Handpieces : Ergonomic : Functional : Reliable</strong></p><p>NSK FX handpiece series – a modernization of the EX series. The traditional NSK simple design technology, functional reliability, durability, and cost effective pricing still remains, but FX has been updated to an integrated design in response to modern demands.</p><p><strong>Clean Head System</strong></p><p>The patented NSK Clean Head System is a special mechanism designed to automatically prevent the entry of oral fluids and other contaminants into the handpiece head prolonging the life of the bearings.&nbsp;</p><p><strong>High Precision Gears</strong></p><p>The high-precision gears run quiet and are supremely durable, which also reduces uncomfortable vibration.</p><p><strong>Push Button Chuck</strong></p><p>Push Button Chuck is NSk\'s original push button auto-chuck mechanism that tensions the bur grip during rotation. It allows one-touch bur insertion and removal without tools. The bur lock mechanism is designed so that bur retention strength increases when high loads are applied to the bur.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Country of Manufacture</strong></td><td>Japan</td></tr><tr><td><strong>Model</strong></td><td>FX22</td></tr><tr><td><strong>Gear Ratio</strong></td><td>1:1 Direct Drive (Non-Optic)</td></tr><tr><td><strong>Application</strong></td><td>General Applications Handpiece</td></tr><tr><td><strong>Water Spray</strong></td><td>External</td></tr><tr><td><strong>Bur Compatibility</strong></td><td>CA burs (Ø2.35 mm)</td></tr><tr><td><strong>Attachment Type</strong></td><td>Latch Type</td></tr><tr><td><strong>Max Speed</strong></td><td>30,000 min⁻¹</td></tr><tr><td><strong>Sterilization</strong></td><td>Autoclavable up to 135°C</td></tr><tr><td><strong>SKU</strong></td><td>NSC-C1129 C</td></tr></tbody></table></figure>', NULL, NULL, 81, '3', 0.00, 1.00, 1.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688b21365fea6.png', NULL, 1, '2025-07-31 13:39:30', '2025-07-31 13:39:30'),
(495, 'P00441', NULL, 'NSK FX205 B2 AIRMOTOR Set', 'nsk-fx205-b2-airmotor-set-P00441', '<p>The <strong>NSK FX205 B2 Air motor</strong> is a versatile and reliable dental handpiece system designed for a wide range of clinical applications. It is compatible with both <strong>Midwest 4-hole</strong> and <strong>Borden 2-hole</strong> connections, ensuring broad compatibility with different dental units. The set includes an <strong>FX205 Air Motor</strong>, a <strong>Straight Handpiece (FX65)</strong>, and a <strong>Contra-angle Handpiece (FX25)</strong>, providing dental professionals with a complete solution for various operative procedures. Built with NSK’s high-quality engineering standards, this set offers smooth performance, durability, and easy maintenance, making it a dependable choice for everyday dental practice needs.</p>', NULL, NULL, NULL, 81, '3', 0.00, 56791.00, 56791.00, 5, 5, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688b27994dad2.png', NULL, 1, '2025-07-31 13:44:48', '2025-08-13 13:28:13'),
(496, 'P00442', NULL, 'NSK Air Clinical Micromotor DynaLED M205LG', 'nsk-air-clinical-micromotor-dynaled-m205lg-P00442', '<p>The <strong>NSK Air Clinical Micromotor DynaLED M205LG</strong> offers exceptional <strong>value for money</strong> by combining advanced performance with versatile compatibility. Designed with an <strong>ISO Type E connection</strong>, it easily integrates with a wide range of handpieces and contra-angles from brands such as <strong>NSK, KaVo®, Sirona®, W&amp;H®, and Bien-Air®</strong>. It is compatible with both <strong>Midwest 4-hole</strong> and <strong>Borden 2/3-hole</strong> connections, making it adaptable to various dental units. The motor supports <strong>optic and non-optic</strong> operation, along with <strong>internal or external water spray</strong> options, and is <strong>autoclavable up to 135°C</strong> for optimal hygiene.</p><p>Featuring an <strong>LED air motor with a built-in micro power generator</strong>, it delivers a bright <strong>25,000 LUX</strong> light output for excellent visibility without the need for separate power supply cables. A <strong>non-retraction valve</strong> is incorporated to enhance infection control and prevent backflow. Its durable design and efficient performance make the DynaLED M205LG a reliable and cost-effective choice for daily clinical use.</p>', '<p>Here’s the specification table based on the provided details:</p><figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Max Speed (M205LG M4)</strong></td><td>22,000 min⁻¹ ± 10%</td></tr><tr><td><strong>Max Speed (M205LG B2)</strong></td><td>25,000 min⁻¹ ± 10%</td></tr><tr><td><strong>Connection Type</strong></td><td>ISO Type E – Compatible with NSK, KaVo®, Sirona®, W&amp;H®, Bien-Air® handpieces</td></tr><tr><td><strong>Unit Compatibility</strong></td><td>Midwest 4-hole / Borden 2/3-hole</td></tr><tr><td><strong>Lighting Option</strong></td><td>Optic and Non-optic</td></tr><tr><td><strong>Water Spray</strong></td><td>Internal or External</td></tr><tr><td><strong>Sterilization</strong></td><td>Autoclavable up to 135°C</td></tr></tbody></table></figure>', NULL, NULL, 81, '3', 0.00, 1.00, 1.00, 4, 4, 77, NULL, 0, 0, NULL, NULL, '2025-07-31-688b276d1bf08.png', NULL, 1, '2025-07-31 13:55:53', '2025-07-31 17:04:51'),
(497, 'P00443', NULL, 'TRIOS 4 Tips Box of 3', 'trios-4-tips-box-of-3-P00443', '<p>Autoclavable TRIOS 4 scanner tips are a step up from regular autoclavable scan tips: they come with a counter and instant-heat technology to you can start scanning without delay.</p><p>As with any other tip, they can be sterilized up to 150 times by autoclave, meaning they are a great match for cases that require sterility.</p>', NULL, NULL, NULL, 83, '3', 0.00, 2.00, 2.00, 3, 3, 110, NULL, 0, 0, NULL, NULL, '2025-08-01-688c5985c5761.png', NULL, 1, '2025-08-01 11:52:01', '2025-08-01 11:56:28'),
(498, 'P00444', NULL, 'Dental Air Compressor : Oil Free 1 H.P.', 'dental-air-compressor-oil-free-1-hp-P00444', '<p>A Bestodent 1 HP air compressor, likely designed for dental use, is an oil-free compressor with specifications including a power of 1 horsepower, a voltage range of 110V~240V, 50Hz/60Hz, and an airflow of 150L/min. It operates at a noise level of 52dB(A) at 40 inches, features an 40L tank (color optional), and a maximum pressure of 8Bar.&nbsp;</p><h4><strong>Key Features</strong></h4><ul><li>Easily operate on 3 battery inverter ( or 2100VA)</li><li>Internally coated tank for protection from rust</li><li>Motor with thermal protection</li></ul>', '<figure class=\"table\"><table><thead><tr><th>Specification</th><th>Details</th></tr></thead><tbody><tr><td>Power</td><td>840 W / 1 H.P.</td></tr><tr><td>Air Container Volume</td><td>40 L</td></tr><tr><td>Noise Level</td><td>55 dB</td></tr><tr><td>Maximum Pressure</td><td>115 PSI</td></tr></tbody></table></figure>', NULL, NULL, 261, '3', 0.00, 42000.00, 42000.00, 3, 3, 33, NULL, 0, 0, NULL, NULL, '2025-08-04-68908b4a1ff6e.png', NULL, 1, '2025-08-04 16:13:26', '2025-08-04 16:13:26'),
(499, 'P00445', NULL, 'Bestodent Delite Dental Chair', 'bestodent-delite-dental-chair-P00445', '<p>A dental chair is used by the dentist to do oral screening, oral surgical procedures easily without any discomfort to both dentist and patient, accompanied by a Doctor’s stool on which the dentist performs the dental procedures. Bestodent deals with a wide range of dental chairs from economical range to premium range according to the choice of dentists.</p>', '<figure class=\"table\"><table><thead><tr><th>Specification</th><th>Details</th></tr></thead><tbody><tr><td>Supply Voltage</td><td>220V, 50Hz / 60Hz</td></tr><tr><td>Air Pressure</td><td>&gt;0.5 MPa</td></tr><tr><td>Water Pressure</td><td>0.2 MPa – 0.4 MPa</td></tr></tbody></table></figure>', '<ul><li>1 x Dental chair</li><li>1 x Dr. Stool</li><li>1 x Ceramic Spitton &amp; Tumbler</li><li>1 x Halogen light</li><li>1 x Instrument Tray</li><li>1 x Foot control</li><li>2 x Threeway Syringe</li><li>1 x X-Ray Viewer</li><li>1 x Saliva Ejector</li><li>Provision for three Airotor &amp; a Micromotor</li></ul>', NULL, 71, '3', 0.00, 275000.00, 275000.00, 3, 3, 33, NULL, 0, 0, NULL, NULL, '2025-08-04-689091b430160.png', NULL, 1, '2025-08-04 16:40:48', '2025-08-04 16:40:48'),
(500, 'P00446', NULL, 'Bestodent Aqua Dental Chair', 'bestodent-aqua-dental-chair-P00446', '<p>The Bestodent Aqua Dental Chair is an electrically operated dental unit designed for efficient patient handling and superior comfort in modern dental practices. It comes with a <strong>12‑month manufacturer/importer warranty</strong>, ensuring peace of mind and long‑term reliability. The chair features <strong>seamless seat upholstery with laminate finish</strong> and <strong>PU‑molded armrests</strong> for durability and patient comfort.</p><p>Equipped with a <strong>ceramic spittoon and tumbler</strong> along with an <strong>auto‑resettable water cup filler</strong>, it ensures hygiene and convenience. The <strong>halogen operating light</strong> offers two intensity settings — high and low — for optimal visibility during procedures. Its <strong>two‑program functionality</strong> allows quick adjustment between Zero and Working positions.</p><p>The <strong>top‑mounted instrument tray</strong> with pneumatic locking system provides easy access to instruments, while the <strong>multifunctional foot control</strong> and <strong>adjustable headrest</strong> enhance operator comfort and patient positioning. The delivery unit includes <strong>two 3‑way syringes</strong>, <strong>provision for three air rotors</strong>, and <strong>one micromotor</strong>, making it versatile for various treatments. Additional features include a <strong>film viewer with white light</strong> and a <strong>saliva ejector with low suction</strong>, ensuring a complete and efficient dental treatment experience.</p>', NULL, '<ul><li>Dental chair Ceramic Spitton &amp; Tumbler Halogen light Instrument Tray.</li><li>Foot control Two Threeway Syringe Provision for three Airotor &amp; a Micromotor X-Ray Viewer Saliva Ejector.</li></ul>', NULL, 71, '3', 0.00, 210000.00, 210000.00, 3, 3, 33, NULL, 0, 0, NULL, NULL, '2025-08-04-6890971e9389a.png', NULL, 1, '2025-08-04 17:03:54', '2025-08-04 17:03:54'),
