(511, 'P00457', NULL, 'AIDITE | AMM-520 Pro', 'aidite-amm-520-pro-P00457', '<p>AMM-520 Pro is a wet and dry integrated multi-functional milling machine, with a stable structure and various fixture combinations, meeting different production needs.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Number of Axes</strong></td><td>5 axes</td></tr><tr><td><strong>Milling Mode</strong></td><td>Wet and dry</td></tr><tr><td><strong>Processing Type</strong></td><td>Crown/bridge, Veneer, Inlay, Custom Abutment, Implant Superstructures (optional CAM module), Implant Bar Clip (optional CAM module), Screw-Retained Bridge (optional CAM module), Complete Denture, Occlusal Splint, Partial Denture Framework</td></tr><tr><td><strong>Millable Material</strong></td><td>Zirconia, PMMA, Glass Ceramic, Premill, PEEK, Titanium Disc, CoCr, Composite Material</td></tr><tr><td><strong>Material Thickness</strong></td><td>10–35 mm (Disc)</td></tr><tr><td><strong>Accessories</strong></td><td>Work Table, Water Cooler, Water Tank</td></tr><tr><td><strong>Repeat Positioning Accuracy</strong></td><td>±5 µm</td></tr><tr><td><strong>Linear Drive System</strong></td><td>Linear Guide and Lead Screw</td></tr><tr><td><strong>Rotary Drive System</strong></td><td>Harmonic Reducer</td></tr><tr><td><strong>Clamping System</strong></td><td>Zero-Point Clamping System</td></tr><tr><td><strong>Control System</strong></td><td>Embedded CNC System and AC Bus Servo Motor</td></tr><tr><td><strong>Machine Size</strong></td><td>590 × 730 × 820 mm</td></tr><tr><td><strong>Machine Weight</strong></td><td>180 kg</td></tr><tr><td><strong>Tool Changer</strong></td><td>18 Detachable Modular Design</td></tr><tr><td><strong>Standard Fixture</strong></td><td>Disc Fixture, C-Type Fixture, Block Fixture</td></tr><tr><td><strong>Processing Time</strong></td><td>Single Crown ≤ 15 min, Premill ≤ 20 min, Glass Ceramic ≤ 20 min, Full Denture ≤ 1.5 h</td></tr><tr><td><strong>Travel</strong></td><td>XYZ Axis: 180 × 110 × 100 mm; A-Axis: ±361°; B-Axis: ±30°</td></tr><tr><td><strong>Spindle</strong></td><td>Power: AC 2500 W; Cooling: Water Cooling; Speed: 60,000 rpm; Chuck Size: Φ6 mm</td></tr><tr><td><strong>Input</strong></td><td>Power Supply: Single-Phase AC 220 V 50/60 Hz; Power: 3 kW 15 A; Air Pressure: 6 Bar</td></tr></tbody></table></figure>', NULL, NULL, 269, '7', 0.00, 4880000.00, 4880000.00, 4, 4, 17, NULL, 0, 0, NULL, NULL, '2025-08-05-6891b9e138d36.png', NULL, 1, '2025-08-04 17:15:25', '2025-08-05 13:45:05'),
(512, 'P00458', NULL, 'Aidite Glass ceramic C14 LT A1', 'aidite-glass-ceramic-c14-lt-a1-P00458', '<p><strong>Dental Glass Ceramic</strong><br>&nbsp;</p><ul><li>Transparency Aesthetics | Excellent Mechanical Property | Instant RestorationCameo Dental Glass Ceramic is a globally popular digital chair side all-ceramic material, which is easy to mill and crystallization process only takes 20 minutes, with the CAD/CAM system of high efficiency, precise production process precisely matched, advanced to achieve instant restoration; superior transparency, presenting a highly bionic aesthetic effect.<br>Product advantages:<br>Excellent mechanical strength:<br>&nbsp;</li><li>The three-point bending strength is increased to 400±60 MPa, allowing CAD/CAM system to design with higher accuracy, reducing the processing difficulty of ultra-thin veneer and other restorations, and improving the strength and safety of materials seated in the mouth.<br>&nbsp;</li><li>Overall fitness, easy to seat:<br>&nbsp;</li><li>The scientific nanos micron crystallization structure provides better edge stability and structural accuracy for milling restoration, effectively simplifies the operation process of repeated seating and polishing and realizes the efficient fitting of the technician\'s processing and clinical seating teeth. Simulates the hardness of natural teeth<br>&nbsp;</li><li>Compared with other types of materials, the hardness of Cameo glass ceramics is closer to that of natural human teeth, which can reduce the excessive wear of the occlusion teeth caused by the hardness difference and maintain the abrasion of the restorations and the surrounding teeth. The clinical experience of instant restoration<br>&nbsp;</li><li>As an all-ceramic material with a shrinkage ratio close to zero, it can provide great convenience for efficient design and digital processing and provide you with ideal and comfortable instant diagnosis and treatment experience combined with the rapid crystallization process. More intuitive transparency aesthetics The product has HT (high transparency) and LT (low transparency). High transparency (HT)<br>&nbsp;</li><li>- good light transparency, restores the colour and texture of natural abutment. Low transparency (LT), optional low light transparency, provides the healing effect of mask and complement.<br>Specifications:<br>Colour: VITA16, bleach white 4 (BL1/BL2/BL3/BL4) Size: 15.5x11x13; 18 x 13 x 15 Transparency: HT (high transparency) and LT (low transparency) Suitable for: a variety of mandrels to choose from, can match a variety of milling machines<br>&nbsp;</li><li>Indications: Veneers, Inlays, Onlays, Anterior crowns, posterior crowns, full crown bridges.</li></ul>', NULL, NULL, NULL, 269, '7', 0.00, 1175.00, 1175.00, 4, 4, 17, NULL, 0, 0, NULL, NULL, '2025-08-05-6891b832a1e5e.png', NULL, 1, '2025-08-04 17:15:25', '2025-08-05 13:37:18'),
