(517, 'P00463', NULL, 'Aidite Glass ceramic C14 LT C2', 'aidite-glass-ceramic-c14-lt-c2-P00463', '<p>The Aidite Glass Ceramic C14 LT C2 sintering program is designed for precise firing and crystallization of glass ceramics to achieve optimal strength and aesthetics. The process begins at an initial temperature of 450 °C, with a 6-minute drying phase. The heating rate is set between 60–90 °C per minute until the temperature reaches 810 °C, which is maintained for 10 minutes. Vacuum application starts at 550 °C and continues until 810 °C. The temperature is then increased at a rate of 30 °C per minute to reach 830–840 °C, which is maintained for 5–10 minutes. During this phase, the vacuum resumes at 810 °C and continues until the peak temperature is achieved. After completion of the sintering process, the furnace cools down to a final temperature of 550 °C, ensuring controlled crystallization and optimal physical properties of the glass ceramic restoration.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Warranty</strong></td><td>1 Year</td></tr><tr><td><strong>After-sale Service</strong></td><td>Online technical support</td></tr><tr><td><strong>Material</strong></td><td>Steel</td></tr><tr><td><strong>Instrument Classification</strong></td><td>Class I</td></tr><tr><td><strong>Safety Standard</strong></td><td>EN 149-2001 + A1-2009</td></tr><tr><td><strong>Place of Origin</strong></td><td>Guangdong, China</td></tr><tr><td><strong>Brand Name</strong></td><td>CHARMING OEM</td></tr><tr><td><strong>Model Number</strong></td><td>LT</td></tr><tr><td><strong>Power Source</strong></td><td>Machinery</td></tr><tr><td><strong>Shelf Life</strong></td><td>1 Year</td></tr><tr><td><strong>Quality Certification</strong></td><td>CE</td></tr><tr><td><strong>Product Name</strong></td><td>Dental CAD CAM Glass Ceramics</td></tr><tr><td><strong>Colors</strong></td><td>Many</td></tr><tr><td><strong>Transmittance</strong></td><td>HT, LT</td></tr><tr><td><strong>Applications</strong></td><td>Veneer, Inlay, Onlay, Crowns</td></tr><tr><td><strong>Initial Temperature</strong></td><td>450 °C</td></tr><tr><td><strong>Final Temperature</strong></td><td>550 °C</td></tr><tr><td><strong>Dry Time</strong></td><td>6 minutes</td></tr></tbody></table></figure>', NULL, NULL, 269, '7', 0.00, 1175.00, 1175.00, 4, 4, 17, NULL, 0, 0, NULL, NULL, '2025-08-05-6891b2ae6548d.png', NULL, 1, '2025-08-04 17:15:25', '2025-08-05 13:13:46'),
(518, 'P00464', NULL, 'Scheu Bioplast Insulating Agent 500 ML', 'scheu-bioplast-insulating-agent-500-ml-P00464', '<p>Scheu Bioplast Insulating Agent 500 ML &nbsp;is an insulation for plaster models when using BIOPLAST® material is a specially formulated insulating agent designed for use during the fabrication of positioners, mouth guards, and similar appliances with BIOPLAST® sheets. It provides a transparent, even film that effectively prevents BIOPLAST® material from adhering to the plaster model while ensuring smooth, residue-free inner surfaces on the appliance. The agent dries quickly without dripping, forming an optimal barrier between the model and thermoplastic sheet.</p>', '<figure class=\"table\"><table><thead><tr><th>Specification</th><th>Details</th></tr></thead><tbody><tr><td>Type</td><td>Plaster Model Insulating Agent</td></tr><tr><td>Category</td><td>Dental Laboratory Consumables</td></tr><tr><td>Appearance</td><td>Transparent liquid</td></tr><tr><td>Application Method</td><td>Direct with applicator bottle &amp; tips</td></tr><tr><td>Drying Time</td><td>Fast-drying, even coating</td></tr><tr><td>Composition</td><td>Sodium water glass &gt;60%1,2,3-Propantriol &lt;20%Distilled water &lt;20%</td></tr></tbody></table></figure>', '<ul><li>1 x Bioplast Insulating Agent 500 ML</li></ul>', NULL, 443, '3', 0.00, 1.00, 1.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-04-68909ef0edd31.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-04 17:37:16'),
(519, 'P00465', NULL, 'BIOCRYL-C-CLEAR 2.0X125MM', 'biocryl-c-clear-20x125mm-P00465', '<p>Break-resistant acrylic material of pure PMMA, monomer-free, without allergenic irritants, bonds to acrylic. Application : Immediate dentures, orthodontic plates and retainers</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Color</strong></td><td>Clear</td></tr><tr><td><strong>Dimension</strong></td><td>2</td></tr><tr><td><strong>Shape</strong></td><td>Round</td></tr><tr><td><strong>Material</strong></td><td>Biocryl‑C</td></tr></tbody></table></figure>', NULL, NULL, 443, '3', 0.00, 1.00, 1.00, 4, 4, 92, NULL, 0, 0, NULL, NULL, '2025-08-04-6890a0af41a72.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-15 13:01:07'),
(520, 'P00466', NULL, 'BIOCRYL-C-CLEAR 2.0X125MM', 'biocryl-c-clear-20x125mm-P00466', '<p>BIOCRYL-C-CLEAR 2.0X125MM</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Dimension</strong></td><td>1</td></tr><tr><td><strong>Shape</strong></td><td>Round</td></tr><tr><td><strong>Material</strong></td><td>Bioplast</td></tr></tbody></table></figure>', NULL, NULL, 443, '3', 0.00, 1.00, 1.00, 4, 4, 92, NULL, 0, 0, NULL, NULL, '2025-08-04-6890a1ed933ff.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-15 13:01:27'),
(521, 'P00467', NULL, 'Scheu Bioplast - 125 x 1.5 mm - Clear Round, 10-Pack', 'scheu-bioplast-125-x-15-mm-clear-round-10-pack-P00467', '<h4>Scheu Bioplast - 125 x 1.5 mm - Clear Round, 10-Pack</h4>', NULL, NULL, NULL, 103, '3', 0.00, 4000.00, 4000.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-04-6890a37b6e0e4.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-04 17:56:39'),
(522, 'P00468', NULL, 'Scheu Bioplast Square 2.0 x 125 mm Clear 10/pk', 'scheu-bioplast-square-20-x-125-mm-clear-10pk-P00468', '<p><strong>Scheu Bioplast Square Clear Sheets</strong> are versatile, durable materials designed for the fabrication of custom dental appliances. With a thickness of 2.0 mm and a diameter of 125 mm, these clear bioplast sheets are ideal for creating mouthguards, retainers, and other orthodontic applications. The bioplast material offers both flexibility and resilience, ensuring comfortable yet durable appliances. These sheets are compatible with thermoforming machines, making it easy for dental professionals to create appliances with a precise, contoured fit. Suitable for a wide range of applications, Scheu Bioplast Square Sheets are an essential resource for any dental practice.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Thickness</strong></td><td>2.0 mm</td></tr><tr><td><strong>Diameter</strong></td><td>125 mm</td></tr><tr><td><strong>Material</strong></td><td>Transparent Bioplast</td></tr></tbody></table></figure>', '<ul><li>Pack of 10</li></ul>', NULL, 443, '3', 0.00, 1.00, 1.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891d1fb5709f.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-22 17:46:08'),
(523, 'P00469', NULL, 'BIOPLAST 2,00x125 mm rd', 'bioplast-200x125-mm-rd-P00469', '<p>BIOPLAST 2,00x125 mm rd</p>', NULL, NULL, NULL, 443, '3', 0.00, 4800.00, 4800.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891d3920de5a.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 15:34:06'),
(524, 'P00470', NULL, 'Bioplast® Bleach 1.0x125mm round (10pcs)', 'bioplast-bleach-10x125mm-round-10pcs-P00470', '<ul><li>Soft pliable rubber like material, best suited for fabrication of bleaching splints.</li><li>Material does not bond to acrylic .</li></ul>', NULL, NULL, NULL, 443, '3', 0.00, 1.00, 1.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891d51c2d5ac.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 15:40:40'),
(525, 'P00471', NULL, 'Scheu Bioplast Xtreme Kit Blue', 'scheu-bioplast-xtreme-kit-blue-P00471', '<p>Bioplast Xtreme Mouthguard Plates are designed for the creation of individual mouthguards with integrated reinforcement in the front tooth area for enhanced protection. Made from BIOPLAST XTREME material, these plates feature a hard, V-shaped reinforcement layer in the anterior region, providing additional protection against impact during contact sports. This unique reinforcement ensures precise positioning and better control over the desired extension of the mouthguard. The soft layer can be used for lamination with BIOPLAST® or for the insertion of counter bites, offering flexibility and comfort for the wearer. These mouthguard plates are ideal for creating colored mouthguards or positioners, combining both aesthetic and functional benefits. The Bioplast Xtreme Kit includes two different degrees of hardness in one pressure-molding blank, thanks to the integrated reinforcement. The V-shaped, harder insert offers variable front tooth protection, effectively absorbing impacts and ensuring optimal protection in high-contact sports.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Hardness Levels</strong></td><td>Two hardness levels in one pressure moulding sheet</td></tr><tr><td><strong>Reinforcement Layer</strong></td><td>V-shaped reinforcement layer for precise front tooth protection</td></tr><tr><td><strong>Impact Absorption</strong></td><td>Elastic impact absorption, distributing force over time</td></tr><tr><td><strong>Customizable Protection</strong></td><td>Customizable protection area for individual needs</td></tr><tr><td><strong>Soft Layer</strong></td><td>Suitable for lamination with BIOPLAST® or counter bite insertion</td></tr><tr><td><strong>Durability</strong></td><td>Durable and elastic material, ideal for contact sports</td></tr><tr><td><strong>Versatility</strong></td><td>Versatile use for colored mouthguards and positioners</td></tr></tbody></table></figure>', '<ul><li><strong>Scheu Bioplast Xtreme 1 kit&nbsp;</strong></li></ul><p><strong>&nbsp; &nbsp; &nbsp;The Set Consist of :</strong></p><ul><li>1 Plate Bioplast Xtreme 5.0 mm</li><li>1 Bag Cetron cleaning Powder</li><li>1 Retainer Box</li><li>1 Bioplast Insulating Agent</li></ul>', NULL, 443, '3', 0.00, 2880.00, 2880.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891d6afeabe2.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 15:53:45'),
(526, 'P00472', NULL, 'Scheu Bioplast Xtreme Kit RED', 'scheu-bioplast-xtreme-kit-red-P00472', '<p>Bioplast Xtreme Mouthguard Plates are designed for the creation of individual mouthguards with integrated reinforcement in the front tooth area for enhanced protection. Made from BIOPLAST XTREME material, these plates feature a hard, V-shaped reinforcement layer in the anterior region, providing additional protection against impact during contact sports. This unique reinforcement ensures precise positioning and better control over the desired extension of the mouthguard. The soft layer can be used for lamination with BIOPLAST® or for the insertion of counter bites, offering flexibility and comfort for the wearer. These mouthguard plates are ideal for creating colored mouthguards or positioners, combining both aesthetic and functional benefits. The Bioplast Xtreme Kit includes two different degrees of hardness in one pressure-molding blank, thanks to the integrated reinforcement. The V-shaped, harder insert offers variable front tooth protection, effectively absorbing impacts and ensuring optimal protection in high-contact sports.<br>&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Hardness Levels</strong></td><td>Two hardness levels in one pressure moulding sheet</td></tr><tr><td><strong>Reinforcement Layer</strong></td><td>V-shaped reinforcement layer for precise front tooth protection</td></tr><tr><td><strong>Impact Absorption</strong></td><td>Elastic impact absorption, distributing force over time</td></tr><tr><td><strong>Customizable Protection</strong></td><td>Customizable protection area for individual needs</td></tr><tr><td><strong>Soft Layer</strong></td><td>Suitable for lamination with BIOPLAST® or counter bite insertion</td></tr><tr><td><strong>Durability</strong></td><td>Durable and elastic material, ideal for contact sports</td></tr><tr><td><strong>Versatility</strong></td><td>Versatile use for colored mouthguards and positioners</td></tr></tbody></table></figure>', '<ul><li><strong>Scheu Bioplast Xtreme 1 kit&nbsp;</strong></li></ul><p><strong>&nbsp; &nbsp; &nbsp;The Set Consist of :</strong></p><ul><li>1 Plate Bioplast Xtreme 5.0 mm</li><li>1 Bag Cetron cleaning Powder</li><li>1 Retainer Box</li></ul>', NULL, 443, '3', 0.00, 2880.00, 2880.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891d7e5e5b07.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 15:52:33'),
(527, 'P00473', NULL, 'BIOPLAST® Color SET', 'bioplast-color-set-P00473', '<p>Soft, pliable rubber like material, does not bond to acrylic. Hardness Shore A: 85.</p><p>Application</p><p>Coloured mouth guards, positioners</p>', NULL, NULL, NULL, 443, '3', 0.00, 1.00, 1.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891d9ec0e884.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 16:01:12'),
(528, 'P00474', NULL, 'BIOSTAR Machine- 230 V', 'biostar-machine-230-v-P00474', '<p>Versatile pressure moulding machine for all applications in dental pressure moulding and orthodontics, equipped with scan technology and 6.0 bar working pressure, adjustable by pressure reducing valve on the unit. The unique thermally controlled infrared heater reaches working temperature in one second. All parameters such as temperature, heating and cooling times are programmed by reading the scanner or entering the corresponding code. The coloured 3.2\" LCD display with a resolution of 320 x 240 pixel leads you through the single working steps of the pressure moulding process, providing further information on scanned material, its indication as well as a library with illustrated application hints for fabrication. Rear port for easy updates. Large model cup facilitates embedding of mounted models. Pellet container ensures optimum dispensing and storing of pellets.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Power</strong></td><td>230 V, 750 W</td></tr><tr><td><strong>Working Pressure</strong></td><td>0.5 – 6.0 bar</td></tr><tr><td><strong>Dimensions (W × H × D)</strong></td><td>520 × 240 × 440 mm</td></tr><tr><td><strong>Weight</strong></td><td>14 kg</td></tr></tbody></table></figure>', NULL, NULL, 443, '3', 0.00, 850000.00, 850000.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891db6b6ddf6.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 16:07:35'),
(529, 'P00475', NULL, 'Scheu Blue Blokker LC Resin', 'scheu-blue-blokker-lc-resin-P00475', '<p><strong>Scheu Blue Blokker LC Resin</strong> is a high-quality, blue-translucent, light-curing material with excellent flow properties, designed for diverse dental and prosthetic applications. It is ideal for blocking out undercuts, sealing and insulating models, creating space maintainers, medical trays, bleaching splints, and aiding in the fabrication of both fixed and removable prostheses. The resin cures efficiently under light in the 380–470 nm wavelength range and burns off completely without leaving any residue, ensuring clean results, particularly in telescope and attachment work. Its smooth consistency allows precise application, even in difficult-to-reach areas, while its translucency provides clear visibility during manipulation.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Type</strong></td><td>Light-curing blocking and insulating resin</td></tr><tr><td><strong>Category</strong></td><td>Laboratory resin material</td></tr><tr><td><strong>Material</strong></td><td>Methacrylate-based, blue-translucent formulation</td></tr><tr><td><strong>Wavelength Range for Curing</strong></td><td>380–470 nm</td></tr><tr><td><strong>Consistency</strong></td><td>Excellent flow and easy handling</td></tr><tr><td><strong>Burn-off Residue</strong></td><td>Complete burnout without residue</td></tr><tr><td><strong>Storage Conditions</strong></td><td>Cool, dry place away from light</td></tr></tbody></table></figure>', '<ul><li>4 x 1.5gm Syringes</li><li>10 x dispensing tips</li></ul>', NULL, 443, '3', 0.00, 1.00, 1.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891dc9fa17b7.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 16:12:43'),
(530, 'P00476', NULL, 'COPYPLAST viscoelastic sheets 0.5x125 mm RD', 'copyplast-viscoelastic-sheets-05x125-mm-rd-P00476', '<p>Duplicates of models, whitening trays, acid-etched trays, brackets transfer matrices, cast crowns, and molds for provisional crowns and bridges.</p>', NULL, NULL, NULL, 443, '3', 0.00, 1760.00, 1760.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891ddff7b937.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 16:18:35'),
(531, 'P00477', NULL, 'COPYPLAST C 1.0x125 mm red', 'copyplast-c-10x125-mm-red-P00477', '<p>High-transparent, visco-elastic material, unbreakable and abrasion resistant, does not bond to acrylic.</p>', NULL, NULL, NULL, 443, '3', 0.00, 2600.00, 2600.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891e2439f482.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 16:36:47'),
(532, 'P00478', NULL, 'Scheu Diamond Cutting Disc with Mandrel', 'scheu-diamond-cutting-disc-with-mandrel-P00478', '<p>Diamond coated on both sides (thickness 0.28 mm) for very precise saw cuts on set-up models and for finishing splints. Mounted on mandrel, Ø 22 mm.</p>', NULL, NULL, NULL, 443, '3', 0.00, 4800.00, 4800.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891e3650c97b.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 16:41:37'),
(533, 'P00479', NULL, 'DURAN 0.5x125 mm RD', 'duran-05x125-mm-rd-P00479', '<p>DURAN 0.5x125 mm rd</p>', NULL, NULL, NULL, 443, '3', 0.00, 2300.00, 2300.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891e4459f6af.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 16:45:21'),
(534, 'P00480', NULL, 'DURAN® + 0.75 x 125 MM RD', 'duran-075-x-125-mm-rd-P00480', '<p>Hard-elastic transparent material, bonds to DURASPLINT® and DURASPLINT® LC. Apply LC primer prior to using DURASPLINT® LC. No pre-drying required.</p><p>Application</p><p>Miniplast splints, occlusal splints, interim and fluorisation splints, X-ray templates, ant-snoring appliances, reinforced anterior section of mouth guards, temporary crowns and bridges.</p>', NULL, NULL, NULL, 443, '3', 0.00, 2600.00, 2600.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891e531361ff.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 16:52:52'),
(535, 'P00481', NULL, 'Scheu Duran - 1.0 x 125mm RD', 'scheu-duran-10-x-125mm-rd-P00481', '<p>Hard-elastic transparent material, bonds to DURASPLINT® and DURASPLINT® LC. Apply LC primer prior to using DURASPLINT® LC. No pre-drying required. Application Miniplast splints, occlusal splints, interim and fluorisation splints, X-ray templates, ant-snoring appliances, reinforced anterior section of mouth guards, temporary crowns and bridges.</p>', NULL, NULL, NULL, 443, '3', 0.00, 2960.00, 2960.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891e6d7987a0.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 17:01:04'),
(536, 'P00482', NULL, 'Scheu Duran - 1.5 x 125mm RD', 'scheu-duran-15-x-125mm-rd-P00482', '<p>Hard-elastic transparent material, bonds to DURASPLINT® and DURASPLINT® LC. Apply LC primer prior to using DURASPLINT® LC. No pre-drying required. Application Miniplast splints, occlusal splints, interim and fluorisation splints, X-ray templates, ant-snoring appliances, reinforced anterior section of mouth guards, temporary crowns and bridges.</p>', NULL, NULL, NULL, 443, '3', 0.00, 3300.00, 3300.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891e93ee1a5b.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 17:06:34'),
(537, 'P00483', NULL, 'DURAN+ 2.0X125 MM RD', 'duran-20x125-mm-rd-P00483', '<p>Duran+ 2.0x125 mm article 3436.1 from Scheu Dental are transparent, hard-elastic vacuum-forming plates with a thickness of 2 mm and a diameter of 125 mm, which are perfectly compatible with DURASPLINT® and DURASPLINT® LC plastics.&nbsp;<br>Before using DURASPLINT® LC, apply LC primer for a perfect bond.&nbsp;<br>A special feature of Duran+ is the integrated insulating film, which eliminates the need for pre-drying.</p><p>Duran+ plates with a thickness of 2 mm are suitable for the production of:<br>anti-snoring splints;<br>templates for implantation (bone preparation and X-ray control).</p>', NULL, NULL, NULL, 443, '3', 0.00, 5000.00, 5000.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891eb78ea63b.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 17:16:04'),
(538, 'P00484', NULL, 'DURAN+ 0.75 x 125 MM RD', 'duran-075-x-125-mm-rd-P00484', '<p>Hard-elastic transparent material, bonds to DURASPLINT® and DURASPLINT® LC. Apply LC primer prior to using DURASPLINT® LC. With integrated insulation foil. No pre-drying required.</p><p>Application</p><p>Miniplast splints, occlusal splints, interim and fluorisation splints, X-ray templates, anti-snoring devices, temporary crowns and bridges.</p>', NULL, NULL, NULL, 443, '3', 0.00, 22900.00, 22900.00, 4, 4, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891ec994ea1b.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-06 10:59:29'),
(539, 'P00485', NULL, 'DURASOFT PD 1.8 x 120 MM RD', 'durasoft-pd-18-x-120-mm-rd-P00485', '<p>Unbreakable, abrasion-resistant, transparent compound material with a hard and soft side. Hard side bonds to acrylic. Already pre-dried and vacuum-sealed for instant use.</p><p><strong>Application</strong></p><p>Minplast splints, bruxism splints, occlusal splints, intra-oral anti-snoring devices</p><p><strong>hard/soft ratio:</strong></p><p>1.2 x 125 mm: 0.7 mm/0.5 mm</p><p>1.8 x 125 mm: 0.9 mm/0.9 mm</p><p>2.5 x 125 mm: 1.6 mm/0.9 mm</p><p>3.0 x 125 mm: 2.1 mm/0.9 mm</p><p>4.0 x 125 mm: 3.1 mm/0.9 mm</p>', NULL, NULL, NULL, 443, '3', 0.00, 1.00, 1.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891eeb657b82.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 17:29:54'),
(540, 'P00486', NULL, 'DURASOFT PD 2.5 x 120 MM RD', 'durasoft-pd-25-x-120-mm-rd-P00486', '<p>Unbreakable, abrasion-resistant, transparent compound material with a hard and soft side. Hard side bonds to acrylic. Already pre-dried and vacuum-sealed for instant use.</p><p><strong>Application</strong></p><p>Minplast splints, bruxism splints, occlusal splints, intra-oral anti-snoring devices</p>', NULL, NULL, NULL, 443, '3', 0.00, 1.00, 1.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-6891f4cf10937.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 17:55:55'),
(541, 'P00487', NULL, 'DURASOFT SEAL CLEAR 0.1X125MM', 'durasoft-seal-clear-01x125mm-P00487', '<p>Pressure moulding material made of thermoplastic polyurethane for use with DURASOFT® pd. Forms a robust inner layer and provides high quality hard-soft splints with excellent resistance against discolouration. Available in clear and blue.</p><p><strong>Application</strong></p><p>Discolouration resistant inner layer for DURASOFT® pd splints. Specifically designed for long-term use splints such as intra-oral anti-snoring devices.</p>', NULL, NULL, NULL, 443, '3', 0.00, 1.00, 1.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-68920b0047ea8.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 19:30:36'),
(542, 'P00488', NULL, 'Scheu Finishing Set', 'scheu-finishing-set-P00488', '<p>Cutting bur, finishing bur, HM carbide bur, HM tricutter fine, BIOPERM trimmer, POLYFIX, OSAMU polisher, DIMO®PRO SLIM, and dressing stone are the eight grinding instruments in the set. The most popular application for it is in pressure molding materials.</p><p>Cutting bur: Hard pressure molding materials, such as hard foils, can be quickly, neatly, and roughly cut with a spiral cutting bur.</p><p>HM Carbide cutter: For fast, clean cutting of both soft and hard foils, use a carbide cutting bur with a triangle shape.</p><p>HM Fine-trim tricutter: A precise triangle cutter for hard foils and splints used in the interdental finishing process.</p><p>Finishing Bur: The square cutting bur is composed of a unique soft alloy that prevents harm to wires and clasps. It is suitable for both soft and hard foils with integrated wire elements.</p><p>BIOPERM trimmer:&nbsp;Color coded as blue, it is used for rough trimming of soft foils and sandwich foils.</p><p>OSAMU polisher: It is used for final polishing of sandwich foils.&nbsp;</p><p>DIMO®PRO SLIM: These are ideal abrasive wheels used for finishing of metal, soft and hard plastics, and pressure-moulding foils.&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Function</strong></td><td>Polishing and finishing</td></tr><tr><td><strong>Used For</strong></td><td>Acrylic, Metal, Hard and Soft Plastic Materials</td></tr><tr><td><strong>Material Used</strong></td><td>Carbide Burs</td></tr><tr><td><strong>Colour Coding</strong></td><td>Yes</td></tr><tr><td><strong>Shank</strong></td><td>HP (104)</td></tr></tbody></table></figure>', '<p><strong>Scheu Finishing Set - 3378</strong></p><ul><li>1&nbsp;x Cutting Bur (white)&nbsp;</li><li>1&nbsp;x Carbide Cutter (Yellow)&nbsp;</li><li>1&nbsp;x Tricutter (Green)&nbsp;</li><li>1&nbsp;x Trimmer (Blue)&nbsp;</li><li>1&nbsp;x Finishing Bur (Red)&nbsp;</li><li>1&nbsp;x Finishing Bur (Brown)</li><li>1 x Polisher (Grey) &nbsp;</li><li>1&nbsp;x DIMO Pro&nbsp;Slim</li></ul>', NULL, 443, '3', 0.00, 1.00, 1.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-68920c7f8cbf7.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 19:36:59'),
(543, 'P00489', NULL, 'Scheu Heating Support', 'scheu-heating-support-P00489', '<p>SCHEU-DENTAL Heating Support for use with SCHEU Minstar S® and Biostar® can be attached directly to the heater when fabricating positioners and mouthguards, providing the optimum distance between model and heater when heating the occlusal surfaces, and for compound of the upper and lower splint.</p><p>Measurements – 190mm W x 160mm H x 70mm D</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Feature</strong></td><td>Can be attached to the heater</td></tr><tr><td><strong>Dimensions</strong></td><td>190 × 160 × 70 mm</td></tr></tbody></table></figure>', NULL, NULL, 443, '3', 0.00, 1.00, 1.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-68920dfb3f79c.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 19:43:19'),
(544, 'P00490', NULL, 'IMPRELON-S- 0.75X125MM RD PD', 'imprelon-s-075x125mm-rd-pd-P00490', '<p>Extremely break and abrasion resistant material. New formulation! Already pre-dried and vacuum sealed for instant use. Application : Miniplast splints, retention splints</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Color</strong></td><td>Clear</td></tr><tr><td><strong>Dimension</strong></td><td>0.75</td></tr><tr><td><strong>Shape</strong></td><td>Round</td></tr><tr><td><strong>Material</strong></td><td>Imprelon S</td></tr></tbody></table></figure>', NULL, NULL, 443, '3', 0.00, 1.00, 1.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-68920eb555666.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 19:46:25'),
(545, 'P00491', NULL, 'ISOFOLAN foil 0.10x125 MM RD', 'isofolan-foil-010x125-mm-rd-P00491', '<p>ISOFOLAN foil 0.10x125 mm RD</p>', NULL, NULL, NULL, 443, '3', 0.00, 1.00, 1.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-68920fd746865.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 19:51:15'),
(546, 'P00492', NULL, 'MINISTAR S 230V', 'ministar-s-230v-P00492', '<p>The compact pressure moulding unit MINISTAR S® equipped with scanning technology: scanner reads the coded material, allowing programming of all important parameters such as heating time, temperature and cooling time. In other words: precise pressure moulding results are reached in record time thanks to the extremely fast, patented heater and working pressure of 4.0 bar, adjustable via pressure regulator. New generation equipped with user-friendly membrane keypad and large display. All operating parameters are monitored and indicated on the display.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Power</strong></td><td>230/115/100 V, 750 W</td></tr><tr><td><strong>Working Pressure</strong></td><td>0.5 – 4.0 bar</td></tr><tr><td><strong>Dimensions (W × H × D)</strong></td><td>500 × 210 × 400 mm</td></tr><tr><td><strong>Weight</strong></td><td>9 kg</td></tr></tbody></table></figure>', NULL, NULL, 443, '3', 0.00, 500000.00, 500000.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-689210b759879.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 19:54:59'),
(547, 'P00493', NULL, 'SD Foil Scissors B', 'sd-foil-scissors-b-P00493', '<p>SD foil scissors B are robust and durable for cutting splints or&nbsp;inserting cuts into splints after pressurising.</p>', NULL, NULL, NULL, 420, '3', 0.00, 19500.00, 19500.00, 5, 5, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-689211be54076.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-05 19:59:22'),
(548, 'P00494', NULL, 'SCHEU SIL KITT', 'scheu-sil-kitt-P00494', '<p>Permanently plastic silicone, used specifically for blocking-out undercuts in pressure moulded splints, anti-snoring and orthodontic appliances.</p>', NULL, NULL, NULL, 443, '3', 0.00, 1.00, 1.00, 4, 4, 92, NULL, 0, 0, NULL, NULL, '2025-08-05-68921254d432f.png', NULL, 1, '2025-08-04 17:28:21', '2025-08-17 11:33:43'),
