(616, 'P00562', NULL, 'AUTO SPIN UNIVERSAL IMPRESSION HOLDER (18600700)', 'auto-spin-universal-impression-holder-18600700-P00562', '<p>Dimensionally stable, stainless steel impression holder.</p>', '<figure class=\"table\"><table><tbody><tr><td>Model</td><td>AUTO SPIN universal impression holder</td></tr><tr><td>Item Number</td><td>18600700</td></tr><tr><td>Model Base</td><td>Plastic</td></tr><tr><td>Compatibility&nbsp;</td><td>for ex. Giroform system</td></tr></tbody></table></figure>', NULL, NULL, 443, '4', 0.00, 1.00, 1.00, 6, 6, 86, NULL, 0, 0, NULL, NULL, '2025-08-13-689c7d6979a9a.png', NULL, 1, '2025-08-05 12:32:44', '2025-08-13 17:41:25'),
