(627, 'P00573', NULL, 'Cutter Tapered, Cross-Cut, Fine (18060001)', 'cutter-tapered-cross-cut-fine-18060001-P00573', '<p>The Renfert Tapered Cutter with a fine cross-cut design is ideal for <strong>precise, controlled trimming</strong> of dental model materials. Its tapered profile allows access to tight spaces while delivering smooth, detailed finishes.</p><p><strong>Tapered shape</strong> for improved access in narrow or angled areas</p><p><strong>Fine cross-cut design</strong> for clean, accurate material removal</p><p>Suitable for <strong>plaster, acrylics, and other dental lab materials</strong></p><p>Provides <strong>smooth operation with minimal vibration</strong></p><p><strong>Long-lasting carbide cutting edges</strong> ensure durability</p><p>Compatible with <strong>Renfert and similar milling/trimming units</strong></p>', NULL, NULL, NULL, 443, '4', 0.00, 1.00, 1.00, 6, 6, 86, NULL, 0, 0, 0, 0, '2025-08-19-68a3fdd3e72a1.png', NULL, 1, '2025-08-05 12:32:44', '2025-08-19 10:15:11'),
(628, 'P00574', NULL, 'Renfert Tapered Cutter 6-Bladed Coarse-Cut (18060002)', 'renfert-tapered-cutter-6-bladed-coarse-cut-18060002-P00574', '<p>The Renfert Tapered Cutter with 6 blades and a coarse-cut design is engineered for <strong>fast, aggressive material removal</strong> in dental lab applications. Its tapered shape offers excellent control for detailed contouring and shaping.</p><p><strong>Tapered profile</strong> for precision trimming in tight or angled areas</p><p><strong>6-blade coarse-cut design</strong> ensures rapid material reduction</p><p>Suitable for <strong>plaster, acrylics, and other dental lab materials</strong></p><p>Balanced build for <strong>smooth, low-vibration operation</strong></p><p><strong>Durable carbide edges</strong> for extended service life</p><p>Compatible with <strong>Renfert and similar milling/trimming units</strong></p>', NULL, NULL, NULL, 443, '4', 0.00, 1.00, 1.00, 6, 6, 86, NULL, 0, 0, 0, 0, '2025-08-19-68a404a7a09a1.png', NULL, 1, '2025-08-05 12:32:44', '2025-08-19 10:44:19'),
(629, 'P00575', NULL, 'Renfert Cylindrical Round Head Cutter Cross-Cut (18060003)', 'renfert-cylindrical-round-head-cutter-cross-cut-18060003-P00575', '<p>The Renfert Cylindrical Round Head Cutter with Cross-Cut design is ideal for <strong>efficient trimming and contouring</strong> of dental model materials. Its precise geometry ensures smooth material removal and consistent results.</p><p><strong>Cylindrical shape with rounded head</strong> for versatile trimming angles</p><p><strong>Cross-cut design</strong> for faster material reduction and reduced clogging</p><p>Suitable for <strong>plaster, acrylics, and similar dental lab materials</strong></p><p>Balanced construction for <strong>low vibration</strong> and stable operation</p><p><strong>Durable carbide cutting edges</strong> for long-lasting performance</p><p>Designed for use with <strong>compatible Renfert milling and trimming units</strong></p>', NULL, NULL, NULL, 443, '4', 0.00, 1.00, 1.00, 6, 6, 86, NULL, 0, 0, 0, 0, '2025-08-19-68a4051d846a7.png', NULL, 1, '2025-08-05 12:32:44', '2025-08-19 10:46:17'),
