(683, 'P00629', NULL, 'Twister Vacuum mixing unit', 'twister-vacuum-mixing-unit-P00629', '<p>High speed vacuum mixing unit with diaphragm pump for the vacuum and base mixing functions.</p><p>&nbsp;</p><h3>Advantages</h3><ul><li>Reliable processing of large amounts due to high speed.</li><li>Easy and fast entry of the mixing parameters using a large, highly luminous display.</li><li>Reduction of bubbles due to vacuum which can be regulated from 70% to 100%.</li></ul>', '<figure class=\"table\"><table><thead><tr><th>&nbsp;</th><th><strong>Twister, 220-240 V</strong></th><th><strong>Twister, 100-120 V</strong></th></tr></thead><tbody><tr><th><strong>Item number</strong></th><td>18260000</td><td>18261000</td></tr><tr><th><strong>Permissible mains voltage</strong></th><td>100 - 240 V</td><td>100 - 240 V</td></tr><tr><th><strong>Permissible mains frequency</strong></th><td>50 - 60 Hz</td><td>50 - 60 Hz</td></tr><tr><th><strong>Vacuum build-up</strong></th><td>Membrane pump</td><td>Membrane pump</td></tr></tbody></table></figure>', NULL, NULL, 123, '4', 0.00, 1.00, 1.00, 6, 6, 86, NULL, 0, 0, NULL, NULL, '2025-08-07-689492a23f066.png', NULL, 1, '2025-08-05 12:32:44', '2025-08-07 17:33:50'),
(684, 'P00630', NULL, 'Waxlectric light II Electric wax knife', 'waxlectric-light-ii-electric-wax-knife-P00630', '<p>Waxlectric light II, which can be operated with two handpieces simultaneously, is the introductory device for efficient wax-up technology.</p><h3>Advantages</h3><ul><li>Fast heat-up rate and low heat transfer to the handle thanks to the heating element integrated in the tip.</li><li>Less contraction in the pattern, as the wax is neither overheated nor burned.</li><li>Separately adjustable temperature.</li></ul>', '<figure class=\"table\"><table><thead><tr><th>&nbsp;</th><th><strong>Waxlectric light II, 220-240 V</strong></th><th><strong>Waxlectric light II, 100-120 V</strong></th></tr></thead><tbody><tr><th><strong>Item number</strong></th><td>21510000</td><td>21511000</td></tr><tr><th><strong>Permissible mains voltage</strong></th><td>100 - 240 V</td><td>100 - 240 V</td></tr><tr><th><strong>Permissible mains frequency</strong></th><td>50 - 60 Hz</td><td>50 - 60 Hz</td></tr><tr><th><strong>Temperature range</strong></th><td>50 - 200 °C<br>122 - 392 °F</td><td>50 - 200 °C<br>122 - 392 °F</td></tr><tr><th><strong>Number of handpieces</strong></th><td>2</td><td>2</td></tr></tbody></table></figure>', NULL, NULL, 369, '4', 0.00, 1.00, 1.00, 6, 6, 86, NULL, 0, 0, NULL, NULL, '2025-08-07-689490f73ae19.png', NULL, 1, '2025-08-05 12:32:44', '2025-08-07 17:27:17'),
