(710, 'P00656', NULL, 'Being Foshan LED Airotor 401P-B2', 'being-foshan-led-airotor-401p-b2-P00656', '<p><strong>Being Foshan LED Airotor 401P-B2</strong> the dental handpiece operates at an air pressure range of 180-250 KPa (1.8-2.5 kgf/cm2) and consumes a minimum of 1.5 liters of gas per minute. It produces noise levels of up to 70dB during operation. The rotation range of the handpiece is between 380,000 and 450,000 rotations per minute (rpm).To maintain optimal performance and cooling, the handpiece requires a cooling water pressure of 0.2MPa. The maximum length of the non-rotation part of the handpiece is 13.14mm, while the diameter of the handpiece head is approximately 11.2mm.t is autoclavable at temperatures up to a maximum of 134°C after high-temperature sterilization and disinfection. The handpiece is designed to withstand at least 250 cycles of high-temperature sterilization and disinfection.</p><ul><li>Push Button type , easy bur changing</li><li>Offers better eyeshot and angle, improving the efficiency</li><li>High density cartridge , with high cutting efficiency but less vibration and noise</li><li>Newly-designed handle, comfortable to hold and easy to clean</li><li>Autoclavable handpiece</li></ul>', '<figure class=\"table\"><table><tbody><tr><td><strong>AIR PRESSURE</strong></td><td>180-250 KPa (1.8-2.5 kgf / cm2)</td></tr><tr><td><strong>GAS CONSUMPTION</strong></td><td>≥1.5L/min.</td></tr><tr><td><strong>NOISE</strong></td><td>≤70dB</td></tr><tr><td><strong>ROTATION RANGE</strong></td><td>380,000- 450,000rpm</td></tr><tr><td><strong>COOLING WATER PRESSURE</strong></td><td>0.2MPa</td></tr><tr><td><strong>MAX. LENGTH OF NON-ROTATION PART</strong></td><td>13.14mm</td></tr><tr><td><strong>HANDPIECE HEAD DIAMETER</strong></td><td>ø11.2mm</td></tr><tr><td><strong>COMPATIBLE DIAMOND BUR</strong></td><td>ISO1797-1 Type 3 ø1.59-1.6mm</td></tr><tr><td><strong>COMPATIBLE DIAMOND BUR LENGTH</strong></td><td>21mm-23mm</td></tr><tr><td><strong>HANDPIECE CONNECT METHOD</strong></td><td>ISO 9168, YY/T 0514</td></tr><tr><td><strong>TORQUE PARAMETER</strong></td><td>≥0.016Nm</td></tr></tbody></table></figure>', '<ul><li>1 x Airotor Handpiece</li></ul>', NULL, 81, '4', 0.00, 1.00, 1.00, 7, 7, 32, NULL, 0, 0, NULL, NULL, '2025-08-07-68947b25eb8f2.png', NULL, 1, '2025-08-05 12:47:03', '2025-08-07 15:53:37'),
(711, 'P00657', NULL, 'Being Foshan 45 Degree Airotor 1P45-B2', 'being-foshan-45-degree-airotor-1p45-b2-P00657', '<p><strong>Being Foshan 45 Degree Non-LED Airotor 1P45-B2</strong> is designed to enhance user comfort and improve procedural efficiency. Its specialized 45-degree angled head ensures superior visibility and maneuverability, making it ideal for accessing difficult-to-reach areas during dental procedures. The ergonomic design reduces hand fatigue, allowing for precise and efficient work. Additionally, the 45-degree airotor helps ensuring patient safety. Crafted for optimal performance, it operates with high-speed rotation for smooth cutting efficiency.This airotor is a reliable tool for dental professionals seeking precision, comfort, and safety in their clinical practice</p><p>FEATURES</p><ul><li>Enhances user comfort and reduces hand fatigue.</li><li>Provides superior visibility and maneuverability.</li><li>Ensures patient safety during procedures.</li><li>Delivers smooth and efficient cutting performance.</li><li>Made for long-lasting reliability in dental practice.</li></ul>', '<figure class=\"table\"><table><tbody><tr><td><strong>AIR PRESSURE</strong></td><td>180-250 KPa (1.8-2.5 kgf / cm2)</td></tr><tr><td><strong>GAS CONSUMPTION</strong></td><td>≥1.5L/min.</td></tr><tr><td><strong>NOISE</strong></td><td>≤70dB</td></tr><tr><td><strong>ROTATION RANGE</strong></td><td>380,000- 450,000rpm</td></tr><tr><td><strong>COOLING WATER PRESSURE</strong></td><td>0.2MPa</td></tr><tr><td><strong>MAX. LENGTH OF NON-ROTATION PART</strong></td><td>13.14mm</td></tr><tr><td><strong>HANDPIECE HEAD DIAMETER</strong></td><td>ø11.2mm</td></tr><tr><td><strong>COMPATIBLE DIAMOND BUR</strong></td><td>ISO1797-1 Type 3 ø1.59-1.6mm</td></tr><tr><td><strong>COMPATIBLE DIAMOND BUR LENGTH</strong></td><td>21mm-23mm</td></tr><tr><td><strong>HANDPIECE CONNECT METHOD</strong></td><td>ISO 9168, YY/T 0514</td></tr><tr><td><strong>TORQUE PARAMETER</strong></td><td>≥0.016Nm</td></tr></tbody></table></figure>', '<ul><li>1 x Airotor Handpiece</li></ul>', NULL, 81, '4', 0.00, 1.00, 1.00, 7, 7, 32, NULL, 0, 0, NULL, NULL, '2025-08-07-6894817314142.png', 'handpiece.pdf', 1, '2025-08-05 12:47:03', '2025-08-07 16:20:31'),
(712, 'P00658', NULL, 'Being Airotor Handpiece Super Torque Head 403-B2', 'being-airotor-handpiece-super-torque-head-403-b2-P00658', '<p>Being Foshan Air-rotor Handpieces are an excellent range of handpieces. Precision engineered to offer the power and reliability required to perform clinical procedures. The new Ceramic turbine cartridge delivers increased smoothness, while the bur retention system has been engineered to securely retain the bur under increased torque loads. The titanium body of the airotor is comfortable in the hand and is angulated at the optimum degree for excellent direct visibility of the operating site, without compromise.</p><p>The high-speed handpiece is a precision device for the removal of tooth tissue efficiently and rapidly with no pressure, heat or vibration and cut the tooth-like butter. The mechanical instrument used to perform a variety of common dental procedures, including removing the decay, polishing fillings, performing cosmetic dentistry, and altering prostheses.</p><p><strong>Features:</strong></p><ul><li>This is a high speed wrench type torque head handpiece.</li><li>Type: Being LOTUS 403</li><li>Modern clipper-built designation, streamline structure, with elegant and attractive appearance.</li><li>Fastidiously request for designation, technology and materials.</li><li>Comfortable handle, slide-proof, easy to clean.</li><li>No vibration while revolving, after a steady operation.</li><li>Convenient to maintain, easy changing cartridge.</li><li>Autoclavable, suitable for disinfection of high temperature at 135 ℃, conform to modern clinical requirement.</li><li>Magnificent quality</li><li>High Torque</li><li>Light Weight Air-rotors</li><li>Works best at Optimum Speed</li><li>Made up of high quality Stainless Steel</li><li>Easy to use Bur-Chuck Type</li><li>Single Spray System</li><li>2 Hole Connection</li></ul>', '<figure class=\"table\"><table><tbody><tr><td>DESCRIPTION</td><td>Super Torque high-speed handpiece, Wrench type, Single spray system</td></tr><tr><td>AIR PRESSURE</td><td>250-300 KPa (2.45-2.8 kgf / cm2)</td></tr><tr><td>WATER PRESSURE</td><td>198Kpa (2 kg)</td></tr><tr><td>ROTATION SPEED</td><td>350,000 rpm</td></tr><tr><td>HEAD HIGHT</td><td>12.21 mm</td></tr><tr><td>HEAD DIAMETRE</td><td>Φ12.9 mm</td></tr><tr><td>CHUCK TYPE</td><td>Wrench</td></tr><tr><td>BUR APPLICABLE</td><td>φ1.59mm~φ1.6mm×21mm~23mm (diameter×length)</td></tr><tr><td>NOISE</td><td>≤70dB</td></tr></tbody></table></figure>', '<p>Package Contains</p><ul><li>Dental handpiece x 1</li><li>Spanner x 1</li><li>Bur key x 1</li><li>Operation manual x 1</li><li>Package box x 1</li></ul>', NULL, 81, '4', 0.00, 1.00, 1.00, 7, 7, 32, NULL, 0, 0, NULL, NULL, '2025-08-07-6894801ea8e4e.png', 'handpiece.pdf', 1, '2025-08-05 12:47:03', '2025-08-07 16:14:50'),
(713, 'P00659', NULL, 'ROSE 201CA CONTRA ANGLE HANDPC', 'rose-201ca-contra-angle-handpc-P00659', '<p>BEING FOSHAN CONTRA HANDPIECE is a E-type low speed handpiece with wrench type. It&nbsp;is designed to facilitate more user-comfortability for the professional and a significant reduction in procedural times for their patients.<br>With the innovative technique, those hard to reach and hard to see places are more easily accessible, thus streamlining and shortening procedures, making it possible to achieve results with greater accuracy and precision.</p><p><strong>INDICATION</strong><br>&nbsp;</p><ul><li>For Cavity Preparation.</li><li>In Post &amp;Core.</li><li>In Polishing.</li></ul><p><strong>COMPOSITION</strong></p><ul><li>Made up of an Aluminum body.</li></ul><p><strong>ADVANTAGES</strong></p><ul><li>Suitable for any E-type headpiece accords with ISO standard.</li><li>Simple technology with integrated design.</li><li>High Durability.</li><li>Functionally reliable.</li><li>Aluminum body.</li><li>Latch type.</li><li>Suitable for both steam and chemical autoclave.</li><li>Made of high quality.</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Air Pressure</strong></td><td>245392 KPa (2.54.0 kgf/cm²)</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Water Pressure</strong></td><td>198 KPa (2 kg)</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Rotation Speed</strong></td><td>22,000~27,000 rpm</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Bur Applicable</strong></td><td>2.334~2.355 mm</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Noise Level</strong></td><td>≤70 dB</td></tr></tbody></table></figure>', NULL, NULL, 81, '4', 0.00, 1.00, 1.00, 7, 7, 32, NULL, 0, 0, NULL, NULL, '2025-08-07-68943849221ca.png', NULL, 1, '2025-08-05 12:47:03', '2025-08-07 11:08:21');
