(714, 'P00660', NULL, 'ROSE CLINIC 2 WITHOUT SCREEN', 'rose-clinic-2-without-screen-P00660', '<h3>Quality and finish</h3><ul><li>The parts are <strong>made of high quality steel and coated with a resin</strong> to avoid scratches and the rigours of daily use.</li><li><strong>The rotors are wear-resistant</strong>, compatible with the Kavo system, increasing their service life.</li><li>The <strong>non-return valve</strong> reduces cross-contamination.</li></ul><h3>Simple cleaning</h3><ul><li>For <strong>internal cleaning</strong>, first remove deposits on the nozzles with the spray debris remover, and then apply the products intended for this purpose via the connection port (do not immerse the instrument in a disinfectant or ultrasonic bath).</li><li>For <strong>external cleaning</strong>, use the same cleaning agent and a soft cloth or brush to clean the <strong>outside</strong> of the turbine.</li><li>For <strong>disinfection</strong>, use a disinfectant that is designed for this purpose, apply with a cloth or soft bristle brush (do not immerse the instrument in a disinfectant or ultrasonic bath).</li><li>For <strong>lubrication</strong>, lubricate the piece before and after each use with a lubricant directed through the connection port.</li><li>For <strong>sterilisation</strong>, place the piece in a sterilisation bag and autoclave at 134°C (do not sterilise any instrument that has not been previously cleaned and lubricated).</li></ul><h3>Ease of polishing</h3><p>The use of NEXO pieces is <strong>simple and intuitive</strong>, connections to the hoses of the dental unit are quick and easy, as is the connection to the drills or rotary instruments via the push button.</p><h3>Ergonomics</h3><ul><li>The NEXO pieces are very ergonomic for the dentist, firstly <strong>because of their design and grip</strong>, which facilitate manipulation inside the mouth, and secondly <strong>because of their weight</strong>, as they are very light.</li><li>In use they are <strong>very stable</strong> and their vibration is low.</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Transmission Ratio</strong></td><td>16:1, 1:1, 1:5</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Speed</strong></td><td>2,000 to 40,000 rpm</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Noise Level</strong></td><td>&lt;60 dB</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Torque</strong></td><td>3.4 Ncm</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Irrigation</strong></td><td>Internal</td></tr></tbody></table></figure>', NULL, NULL, 80, '4', 0.00, 1.00, 1.00, 7, 7, 32, NULL, 0, 0, NULL, NULL, '2025-08-07-68943774b94de.png', NULL, 0, '2025-08-05 12:47:03', '2025-08-07 15:23:24'),
(715, 'P00661', NULL, 'STRAIGHT HANDPC 201SH', 'straight-handpc-201sh-P00661', '<p>Being Foshan Straight Handpiece is a low speed dental handpiece used in dental procedures. The straight handpiece by Being Foshan is an E Type slow speed handpiece. The handpiece offers a low noise level which is lesser than 70dB. The slow speed handpiece rpm ranges between 22,000 to 27,000 rpm.</p><p><br><strong>Features of straight handpiece.</strong></p><ul><li>Slow speed handpiece</li><li>Made up of Stainless steel</li><li>Offers good handling convenience<br>&nbsp;</li><li>Offers precision and reliability</li><li>Autoclavable</li></ul><p><strong>INDICATIONS</strong></p><ul><li>For trimmimg dentures in Prosthodontics Dental Clinics<br>&nbsp;</li><li>In minor Oral surgeries for tooth / bone cutting<br>&nbsp;</li><li>In Private Dental Hospitals</li><li>External cooling system</li><li>Compact design</li><li>Reliable</li><li>Easy to use</li><li>Light weight</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Air Pressure</strong></td><td>245392 KPa (2.54.0 kgf/cm²)</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Water Pressure</strong></td><td>198 KPa (2 kg)</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Rotation Speed</strong></td><td>22,000~27,000 rpm</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Bur Applicable</strong></td><td>Φ2.334~2.355 mm</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><strong>Noise Level</strong></td><td>≤70 dB</td></tr></tbody></table></figure>', NULL, NULL, 81, '4', 0.00, 1.00, 1.00, 7, 7, 32, NULL, 0, 0, NULL, NULL, '2025-08-07-689433f09f49f.png', 'handpiece.pdf', 1, '2025-08-05 12:47:03', '2025-08-07 10:50:56'),
