(1437, 'P00897', NULL, 'Biolight M70C Finger Pulse Oximeter blue', 'biolight-m70c-finger-pulse-oximeter-blue-P00897', '<p>The&nbsp;Biolight M70C finger pulse oximeter<strong>&nbsp;</strong>enables a <strong>quick and simple testing of the oxygen saturation level</strong> (SpO2) and <strong>pulse rate</strong> of adults. The <strong>low weight</strong> and <strong>compact dimensions</strong> make this fingertip pulse oximeter excellent for equipping emergency kits and doctor bags.</p>', NULL, NULL, NULL, 31, '3', 0.00, 1.00, 1.00, 6, 6, 125, NULL, 0, 0, NULL, NULL, '2025-08-18-68a301c3a6c99.png', NULL, 1, '2025-08-10 11:55:18', '2025-08-18 16:19:43'),
(1438, 'P00898', NULL, 'Capri Bite Registration & Impression Trays 50PCS/BOX', 'capri-bite-registration-impression-trays-50pcsbox-P00898', '<p><strong>Bite Registration Trays</strong> are essential dental tools designed to capture accurate occlusal relationships during prosthetic and restorative procedures. Crafted for precision, these trays provide a stable and secure platform for impression materials, ensuring reliable bite registrations. Their ergonomic design allows for easy placement in the patient’s mouth, reducing discomfort and ensuring accurate alignment of the upper and lower arches.</p><p>Made from durable materials, they are lightweight, easy to handle, and suitable for single-use applications, ensuring hygiene and convenience. These trays are ideal for use in various dental scenarios, including crown and bridgework, orthodontic treatments, and full-mouth restorations, making them a versatile and indispensable asset for dental professionals.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Specification</strong></th><th><strong>Details</strong></th></tr></thead><tbody><tr><td><strong>Material</strong></td><td>Durable, lightweight construction for stability</td></tr><tr><td><strong>Design</strong></td><td>Ergonomic shape for easy intraoral placement</td></tr><tr><td><strong>Compatibility</strong></td><td>Suitable for various impression materials</td></tr><tr><td><strong>Hygiene</strong></td><td>Single-use design ensures infection control</td></tr><tr><td><strong>Applications</strong></td><td>Ideal for crown, bridge, and orthodontic procedures</td></tr><tr><td><strong>Accuracy</strong></td><td>Ensures precise occlusal relationship capture</td></tr></tbody></table></figure>', '<p><strong>Capri Bite Registration Trays Assorted 50/pk:</strong></p><ul><li>50 Piece per Pack<strong> (Posterior-36 , Anterior-9 , Quadrant -5)</strong></li></ul>', '<ul><li>Warranty is not applicable for this product&nbsp;</li></ul>', 52, '3', 0.00, 1.00, 1.00, 6, 6, 119, NULL, 0, 0, 0, 0, '2025-08-20-68a561e0a0336.png', NULL, 1, '2025-08-10 11:55:18', '2025-08-20 11:34:20'),
