(1510, 'P00966', NULL, 'Tri-Hawk Talon 12 Metal and Crown Cutting Bur', 'tri-hawk-talon-12-metal-and-crown-cutting-bur-P00966', '<p>The Talon 12 bur is unlike any other for removal of old crowns, bridges and amalgam, or prepping titanium abutments.</p><p>Unleash unparalleled cutting power with the Tri-Hawk Talon 12, the only metal and crown cutting bur featuring a revolutionary hyperbolic shape and uniquely positioned blades on both the top and sides. This innovative design allows the Talon 12 to cut with unmatched speed and precision, whether you\'re working vertically or horizontally.</p><p>The Talon 12 is the #1 choice for demanding restorative procedures and is widely recognised as Tri-Hawk\'s most popular bur worldwide. Whether removing old crowns, bridges, amalgam, or prepping titanium abutments, the Talon 12 delivers the aggressive cutting action you need.</p><p>We invite you to test the Talon 12 and discover why it’s the preferred choice of dental professionals around the globe. Elevate your practice with the fastest-cutting, most efficient bur you’ve ever used.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Feature</strong></th><th><strong>Specification</strong></th></tr></thead><tbody><tr><td>Product Name</td><td>Talon 12 Bur</td></tr><tr><td>Cutting Speed</td><td>High-speed, unmatched rapid efficiency</td></tr><tr><td>Cutting Capability</td><td>Metal, crowns, and other restorative materials</td></tr><tr><td>Cutting Direction</td><td>Multi-directional; effective from any angle</td></tr><tr><td>Blade Engagement</td><td>Blades remain engaged at all times</td></tr><tr><td>Performance Consistency</td><td>Maintains same speed and effectiveness from start to finish</td></tr><tr><td>Ideal Use</td><td>Tough restorative procedures</td></tr></tbody></table></figure>', NULL, NULL, 102, '3', 0.00, 1.00, 1.00, 6, 6, 117, NULL, 0, 0, NULL, NULL, '2025-08-18-68a304eb45d1c.png', NULL, 1, '2025-08-10 12:07:21', '2025-08-19 16:14:05'),
