(1619, 'P01074', NULL, 'AIZ MICRO LIGATURE CUTTER', 'aiz-micro-ligature-cutter-P01074', '<p>The AIZ Micro Ligature Cutter (3000/110) is a dental instrument designed for precision and accuracy in cutting orthodontic ligatures and wires. This instrument is commonly used in orthodontics, a field of dentistry that focuses on aligning and correcting teeth and jaws. The Tungsten carbide inserted tips ensures precision cutting of ligature wire and elastics. Maximum Cutting Capacity: soft wire up to .012\".</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Type</strong></th><th><strong>Ligature Wire Cutter Plier</strong></th></tr></thead><tbody><tr><td><strong>Category</strong></td><td>Orthodontic</td></tr><tr><td><strong>Material</strong></td><td>Stainless Steel</td></tr><tr><td><strong>Disposable / Reusable</strong></td><td>Reusable</td></tr><tr><td><strong>Sterile / Non-Sterile</strong></td><td>Non-Sterile</td></tr><tr><td><strong>Autoclavable</strong></td><td>Yes</td></tr></tbody></table></figure>', '<ul><li>1 x Micro Ligature Cutter</li></ul>', NULL, 390, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-15-689ec1f2d6fce.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
(1620, 'P01075', NULL, 'AIZ MINISOTA RETRACTOR 14cm', 'aiz-minisota-retractor-14cm-P01075', '<p>Used to lift and protect the tissue. One end holds the cheek back and the other keeps the tongue away from the surgical area, a multipurpose retractor. Minnesota Retractor Used to protect&nbsp;the tissue when performing surgical extractions while operating with the high-speed drill. One end holds the cheek back and the other keeps the tongue away from the surgical area, a multipurpose retractor.<br>&nbsp;</p><ul><li>It helps protect the mucosa during incisions.<br>&nbsp;</li><li>The overall length of the retractor is 140mm<br>&nbsp;</li></ul><p><strong>INDICATION:</strong><br>&nbsp;</p><ul><li>Used to hold mucoperiosteal flaps, cheeks, lips, and tongue away from the surgical area.</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Type</strong></th><th><strong>Cheek and Tissue Retractor</strong></th></tr></thead><tbody><tr><td><strong>Category</strong></td><td>Oral Surgery</td></tr><tr><td><strong>Material</strong></td><td>Stainless Steel</td></tr><tr><td><strong>Disposable / Reusable</strong></td><td>Reusable</td></tr></tbody></table></figure>', '<p>1 x Minnesota Retractor</p>', NULL, 47, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-15-689ebfe898ef5.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
(1621, 'P01076', NULL, 'AIZ MOUTH MIRROR HANDLE SINGLE ENDED #2', 'aiz-mouth-mirror-handle-single-ended-2-P01076', '<p>The AIZ Mouth Mirror Handle #2 &nbsp;is a dental instrument used in oral examinations and procedures. It is specifically designed to hold and manipulate mouth mirror heads for improved visibility and access to the oral cavity. The MH2 handle features a comfortable grip that allows for precise control during dental examinations. It is made from high-quality stainless steel, ensuring durability and resistance to corrosion. The handle is compatible with various mouth mirror heads, allowing for easy interchangeability. The GDC Mouth Mirror Handle #2 is an essential tool in dental practices, facilitating accurate observations of oral conditions and assisting in various dental procedures.</p><p><strong>Head</strong></p><ul><li>The Head is usually round.</li></ul><p><strong>Uses</strong> :</p><ul><li>Indirect Vision</li><li>Retraction</li><li>Reflection</li><li>Indirect Illumination</li><li>Types of Mouth Mirror: Front Surface</li><li>Plane Mirror</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Type</strong></th><th><strong>Diagnostic Instrument</strong></th></tr></thead><tbody><tr><td><strong>Category</strong></td><td>Diagnostic Instrument</td></tr><tr><td><strong>Material</strong></td><td>Stainless Steel</td></tr><tr><td><strong>Disposable / Reusable</strong></td><td>Reusable</td></tr><tr><td><strong>Sterile / Non-Sterile</strong></td><td>Non-Sterile</td></tr><tr><td><strong>Latex / Latex-Free</strong></td><td>Latex-Free</td></tr></tbody></table></figure>', '<ul><li>1 x Mouth Mirror Handle</li></ul>', NULL, 334, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-15-689ebd602dc5b.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
(1622, 'P01077', NULL, 'AIZ MOUTH MIRROR HANDLE SINGLE ENDED #1', 'aiz-mouth-mirror-handle-single-ended-1-P01077', '<p>The AIZ Mouth Mirror Handle #1 is a dental instrument used in oral examinations and procedures. It is specifically designed to hold and manipulate mouth mirror heads for improved visibility and access to the oral cavity. The MH2 handle features a comfortable grip that allows for precise control during dental examinations. It is made from high-quality stainless steel, ensuring durability and resistance to corrosion. The handle is compatible with various mouth mirror heads, allowing for easy interchangeability. The GDC Mouth Mirror Handle #2 is an essential tool in dental practices, facilitating accurate observations of oral conditions and assisting in various dental procedures.</p><p><strong>Head</strong></p><ul><li>The Head is usually round.</li></ul><p><strong>Uses</strong> :</p><ul><li>Indirect Vision</li><li>Retraction</li><li>Reflection</li><li>Indirect Illumination</li><li>Types of Mouth Mirror: Front Surface</li><li>Plane Mirror</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Type</strong></th><th><strong>Diagnostic Instrument</strong></th></tr></thead><tbody><tr><td><strong>Category</strong></td><td>Diagnostic Instrument</td></tr><tr><td><strong>Material</strong></td><td>Stainless Steel</td></tr><tr><td><strong>Disposable / Reusable</strong></td><td>Reusable</td></tr><tr><td><strong>Sterile / Non-Sterile</strong></td><td>Non-Sterile</td></tr><tr><td><strong>Latex / Latex-Free</strong></td><td>Latex-Free</td></tr></tbody></table></figure>', '<ul><li>1 x Mouth Mirror Handle</li></ul>', NULL, 334, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-15-689ebc91d4cbc.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
