(1624, 'P01079', NULL, 'AIZ MTA CARRIER 1.2 mm', 'aiz-mta-carrier-12-mm-P01079', '<p>E-MTA Carrier has been designed to dispense MTA at the designated site of operation, with ease of handling</p><p>Carrier is a peculiar design made up of a surgical stainless alloy which will facilitate the use of MTA in surgical procedures like retro seal &amp; treatment of perforation or stripping.</p><p><br>Available in diameter of 0.8mm and 1.2mm</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Feature</strong></th><th><strong>Description</strong></th></tr></thead><tbody><tr><td><strong>Material</strong></td><td>Stainless Steel</td></tr><tr><td><strong>Strength</strong></td><td>High</td></tr><tr><td><strong>Sterilization</strong></td><td>Autoclavable</td></tr><tr><td><strong>Design</strong></td><td>Curved design for easy access and better placement</td></tr></tbody></table></figure>', '<ul><li>1 x E-MTA Carrier&nbsp;</li></ul>', NULL, 506, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-13-689c62e485453.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
(1625, 'P01080', NULL, 'AIZ NABERS PROBE', 'aiz-nabers-probe-P01080', '<p>The AIZ Double End Probes Nabers Color Coded #1 (Pq2n) is a dental instrument commonly used by dentists and dental professionals for periodontal examinations and measurements. It is designed to assess the depth of periodontal pockets and evaluate the overall condition of the gums and supporting structures around the teeth.</p><p><strong>Indications:</strong></p><ul><li><strong>Periodontal assessment:</strong> The probe is used to evaluate the depth of periodontal pockets, which helps in diagnosing and monitoring periodontal disease. By measuring the pocket depth, dentists can determine the severity of gum disease and track any changes in the condition over time.</li><li><strong>Gingival health evaluation:</strong> The probe assists in assessing the health of the gums and the presence of inflammation or bleeding. It aids in identifying areas of gingival recession, which is the loss of gum tissue around the teeth.</li><li><strong>Periodontal treatment planning:</strong> The measurements obtained using the probe guide dentists in developing an appropriate treatment plan for patients with gum disease. The information helps determine the extent of treatment required, such as scaling and root planing, gum surgery, or other periodontal interventions.</li><li><strong>Monitoring periodontal maintenance:</strong> After initial periodontal therapy, regular measurements using the probe are performed to monitor the response to treatment and the effectiveness of maintenance care. The probe helps identify any recurrence or progression of gum disease.</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Type</strong></th><th>Periodontal Probe</th></tr></thead><tbody><tr><td><strong>Category</strong></td><td>Periodontal</td></tr><tr><td><strong>Material</strong></td><td>Stainless Steel</td></tr><tr><td><strong>Disposable / Reusable</strong></td><td>Reusable</td></tr><tr><td><strong>Sterile / Non-Sterile</strong></td><td>Non-Sterile</td></tr></tbody></table></figure>', '<ul><li>1 x Nabers Probe</li></ul>', NULL, 437, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-13-689c1ed2c6818.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
