(1627, 'P01082', NULL, 'AIZ PERIO PROBE CP-15', 'aiz-perio-probe-cp-15-P01082', '<p>Single-ended, color-coded probe. ergonomic, Satin Steel™handle. University of North Carolina.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Brand</strong></th><th>AIZ &amp; CO.</th></tr></thead><tbody><tr><td><strong>Color Coded</strong></td><td>Yes</td></tr><tr><td><strong>Composition</strong></td><td>Stainless Steel</td></tr><tr><td><strong>End</strong></td><td>Single End</td></tr><tr><td><strong>Handle</strong></td><td>#6 Satin Steel</td></tr><tr><td><strong>Item</strong></td><td>Probe</td></tr><tr><td><strong>Item Type</strong></td><td>Periodontal</td></tr><tr><td><strong>Numeric Size</strong></td><td>CP-15 UNC</td></tr><tr><td><strong>Quantity</strong></td><td>Each</td></tr></tbody></table></figure>', '<ul><li>1 x Probe</li></ul>', NULL, 437, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-13-689c17bcf1ef7.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
(1628, 'P01083', NULL, 'AIZ PERIOTOMES P1', 'aiz-periotomes-p1-P01083', '<p>PERIOTOMES<br>Thin sharp blades used to facilitate the removal of teeth with minimal damage to the surrounding<br>alveolar bone by severing the periodontal ligament. May be used wherever an extraction is indicated, but are particularly important when considering the placement of a dental implant.&nbsp;<br>&nbsp;</p>', NULL, NULL, NULL, 438, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-13-689c141aaf0a8.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
