(1636, 'P01091', NULL, 'AIZ RIBBOND ARCH PLIER', 'aiz-ribbond-arch-plier-P01091', '<p>AIZ Ribbon Arch Plier is a versatile tool designed for adjusting torque and bending offsets in rectangular archwires, following the classic tweed style. It excels in tasks such as de-torquing the ends of archwires and forming precise 90-degree bands. Crafted from surgical-grade stainless steel, it offers exceptional durability and resistance to corrosion. The plier features specially designed joints that ensure smooth handle rotation for maximum precision during adjustments. It is heat sterilizable up to 180°C, making it suitable for repeated autoclave cycles without compromising performance. Ideal for orthodontic professionals, Koden Ribbon Arch Plier combines reliability with ease of use, supporting accurate dental procedures and maintaining high standards of clinical hygiene.</p>', '<figure class=\"table\"><table><thead><tr><th>Specification</th><th>Detail</th></tr></thead></table></figure><figure class=\"table\"><table><tbody><tr><td>Material</td><td>Surgical grade stainless steel</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Functionality</td><td>Adjusts torque in rectangular archwires, bends offsets, and forms 90° bands</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Temperature Resistance</td><td>Heat sterilizable up to 180°C</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Corrosion Resistance</td><td>High resistance to corrosion</td></tr></tbody></table></figure>', '<ul><li>1 AIZ Ribbon Arch Plier</li></ul>', NULL, 373, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-12-689b1620d8722.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
(1637, 'P01092', NULL, 'AIZ RUBBER DAM PUNCH AINSWORTH 17CM', 'aiz-rubber-dam-punch-ainsworth-17cm-P01092', '<p>The AIZ Rubber Dam Punch - Ainsworth (17cm) (Rdpa) is a vital dental tool used to prepare rubber dams for procedures. By squeezing the handles together, the plunger swiftly creates precisely sized holes in the rubber dam material. This versatile design allows for the creation of various hole sizes, catering to the specific requirements of different dental treatments. Crafted with quality materials and measuring 17cm in size, the Rdpa offers optimal reach and control during procedures. The Ainsworth design, known for its reliability, ensures that dental professionals can efficiently and accurately perforate rubber dams. This ergonomic tool, compatible with standard sterilization protocols, plays a crucial role in maintaining a dry and isolated operative field, contributing to the success of dental treatments.</p>', '<figure class=\"table\"><table><thead><tr><th>Specification</th><th>Detail</th></tr></thead><tbody><tr><td>Type</td><td>Rubber Dam Punch</td></tr><tr><td>Material</td><td>Stainless Steel</td></tr><tr><td>Size</td><td>17 cm</td></tr><tr><td>Reusable / Disposable</td><td>Reusable</td></tr><tr><td>Sterile / Non-Sterile</td><td>Non-Sterile</td></tr><tr><td>Rust Prevention Procedure</td><td>Passivation</td></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', '<ul><li>1 x Rubber Dam Punch</li></ul>', NULL, 172, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-12-689b0f1a85f53.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
(1638, 'P01093', NULL, 'AIZ SINUS LIFTING INSTRUMENT', 'aiz-sinus-lifting-instrument-P01093', '<p>The AIZ Sinus Lifting Instrument Set of 8 in Pouch is a dental tool kit designed for the purpose of performing sinus lift procedures in dentistry. This set includes eight specialized instruments that are specifically designed to aid in the lifting of the sinus membrane during the procedure. The set comes in a convenient pouch, which makes it easy to store and transport the instruments. Each instrument is made of high-quality stainless steel, which ensures its durability and longevity.</p>', '<figure class=\"table\"><table><thead><tr><th>Specification</th><th>Detail</th></tr></thead></table></figure><figure class=\"table\"><table><tbody><tr><td>Type</td><td>Sinus Lifting</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Category</td><td>Implantology, Surgical Instruments</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Material</td><td>Stainless Steel</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Disposable / Reusable</td><td>Reusable</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Sterile / Non-Sterile</td><td>Non-Sterile</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Latex / Latex-Free</td><td>Latex-Free</td></tr></tbody></table></figure>', '<ul><li>1 x&nbsp;Sinus Lifting Instrument # 1 (</li><li>1 x&nbsp;Sinus Lifting Instrument # 2&nbsp;</li><li>1 x&nbsp;Sinus Lifting Instrument # 3&nbsp;</li><li>1 x&nbsp;Sinus Lifting Instrument # 4&nbsp;</li><li>1 x&nbsp;Sinus Lifting Instrument # 5&nbsp;</li><li>1 x&nbsp;Sinus Lifting Instrument # 6&nbsp;</li><li>1 x&nbsp;Sinus Lifting Instrument # 8&nbsp;</li></ul>', NULL, 465, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-12-689af32b62cf0.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
