(1646, 'P01101', NULL, 'AIZ V BENDING PLIER', 'aiz-v-bending-plier-P01101', '<p>Places V Bend in archwire, are ideal for putting a precise v bend or v notch on archwires.&nbsp; This prevents sliding and can prevent wires from disengaging from the buccal tube and is also useful in shortening wires.Most V bend stop pliers work on round, square, and rectangular nickel titanium wires.&nbsp;</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead></table></figure><figure class=\"table\"><table><tbody><tr><td>Instrument Name</td><td>V Bending Plier</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Type</td><td>Ortho Plier</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Category</td><td>Orthodontics</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Material</td><td>Stainless Steel</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Disposable / Reusable</td><td>Reusable</td></tr></tbody></table></figure>', '<p>1 x V Bending Plier</p>', NULL, 409, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-11-6899a1f929a1c.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
(1647, 'P01102', NULL, 'AIZ WAX KNIFE', 'aiz-wax-knife-P01102', '<p>AIZ WAX KNIFE is used to carve wax patterns, generally a blunt blade of varying size and shape, which can be heated for softening the wax while fashioning the pattern.</p><p><strong>Wax knives </strong>A Dental Wax Knife instrument is used during preclinical prosthodontic procedures like fabrication of rims, teeth setting and late stages of removable partial denture construction to eliminate or block out areas of undesirable undercuts with wax on the cast before the framework is made. It is also used during block-out procedures and in the construction of surveyed restorations.</p><p>A Hand instruments used by dentists during different dental treatments, presentations or demonstrations within the laboratories are used for carry or mix the wax and softening the base while teeth settings. These are wide bladed and of various shapes and sizes.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead></table></figure><figure class=\"table\"><table><tbody><tr><td>Instrument Name</td><td>Wax Knife</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Type</td><td>Dental Wax Carver</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Category</td><td>Prosthodontics</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Material</td><td>Stainless Steel</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Disposable / Reusable</td><td>Reusable</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Sterile / Non-Sterile</td><td>Non-Sterile</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Latex / Latex-Free</td><td>Latex-Free</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Total Length</td><td>18 cm</td></tr></tbody></table></figure>', '<ul><li>1 x Wax Knife</li></ul>', NULL, 369, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-11-6899a0c0b4c14.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
(1648, 'P01103', NULL, 'AIZ WEINGART WIRE BENDING PLIER', 'aiz-weingart-wire-bending-plier-P01103', '<p>AIZ WEINGART WIRE BENDING PLIER &nbsp;is designed for making precise rotational adjustments to orthodontic wires, ensuring accurate tooth movement and alignment in male brackets. It is crafted from high-quality stainless steel for exceptional durability, corrosion resistance, and easy sterilization. The ergonomic handle design reduces hand fatigue, making it suitable for prolonged use during orthodontic procedures. Its smooth jaws securely grip wires without causing distortion, facilitating controlled torque applications. This versatile tool is compatible with various orthodontic wire types, including stainless steel and nickel-titanium. It is autoclavable for proper sterilization, ensuring safe clinical use. The instrument allows for precise customization of torque adjustments, aligning with the patient’s treatment plan, while contributing to patient comfort and overall procedural efficiency.</p><p>&nbsp;</p><ul><li><strong>High-Quality Material:</strong> Made of premium stainless steel, ensuring durability, corrosion resistance, and easy sterilization</li><li><strong>Torquing Functionality:</strong> Designed for precise torque application to orthodontic wires for accurate tooth adjustments</li><li><strong>Ergonomic Design:</strong> Features comfortable handles to reduce hand fatigue during prolonged use</li><li><strong>Smooth Jaws:</strong> Securely grips wires without causing damage or distortion during adjustments</li><li><strong>Autoclavable:</strong> Fully sterilizable for safe and hygienic use in clinical settings</li><li><strong>Versatile Use:</strong> Suitable for working with various wire materials, including stainless steel and nickel-titanium</li><li><strong>Enhanced Precision:</strong> Allows for controlled rotational adjustments for brackets and wires</li><li><strong>Lightweight Design:</strong> Reduces operator strain and enhances ease of handling</li><li><strong>Long-Lasting:</strong> Engineered to maintain performance even after repeated sterilization and use</li></ul>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead></table></figure><figure class=\"table\"><table><tbody><tr><td>Type</td><td>Instrument</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Category</td><td>Orthodontics</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Material</td><td>Stainless Steel</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Disposable / Reusable</td><td>Reusable</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Autoclavable</td><td>Yes</td></tr></tbody></table></figure>', '<p>1 x Orthodontics Wire Bending Pliers Torquing Plier</p>', NULL, 403, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-11-68999d277041a.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
(1649, 'P01104', NULL, 'AIZ WILLIAM PROBE', 'aiz-william-probe-P01104', '<h3>Indication</h3><ul><li>To evaluate periodontal pouch depths, accessory levels, anatomy configurations as well as gingival bleeding</li></ul><h3>Features</h3><ul><li>&nbsp;Light weight</li><li>&nbsp;Sharp working tip</li><li>&nbsp;Premium Quality Imported Stainless Steel</li><li>&nbsp;Non-Corrosive</li><li>&nbsp;Autoclavable</li></ul>', NULL, '<ul><li>1 x Williams Probe</li></ul>', NULL, 330, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-11-68998dbc51b4f.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
(1650, 'P01105', NULL, 'AIZ WIRE TWISTER  WT', 'aiz-wire-twister-wt-P01105', '<p>Wire twisting forceps are made up of high-quality stainless steel. It is used by surgeons for holding &amp;&nbsp; twisting wires&nbsp;during surgeries. These forceps have ring handles that provide a comfortable grip it.</p>', '<figure class=\"table\"><table><thead><tr><th><strong>Parameter</strong></th><th><strong>Specification</strong></th></tr></thead></table></figure><figure class=\"table\"><table><tbody><tr><td>Name</td><td>AIZ Wire Twister</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Type</td><td>Surgical Instrument</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Category</td><td>Oral Surgery</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Material</td><td>Stainless Steel</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td>Disposable / Reusable</td><td>Reusable</td></tr></tbody></table></figure>', '<ul><li>1 x AIZ Wire Twister</li></ul>', NULL, 418, '3', 0.00, 1.00, 1.00, 6, 6, 116, NULL, 0, 0, NULL, NULL, '2025-08-11-68997a5bd1277.png', NULL, 1, '2025-08-10 12:24:44', '2025-08-20 15:17:43'),
(1651, 'P01106', NULL, 'Woodpecker TFRK Terauchi File Removal Kit', 'woodpecker-tfrk-terauchi-file-removal-kit-P01106', '<p><strong>Woodpecker TFRK Terauchi File Removal Kit</strong></p><p>The Woodpecker TFRK Terauchi File Removal Kit is a specialized dental instrument designed for the removal of broken or separated endodontic files from within the root canals of teeth. This kit is a valuable tool in endodontics, where maintaining the integrity of the root canal during treatment is crucial.</p><p><strong>TFRK-Gutta-Percha Removal Hand Instrument (TFRK-GPR)</strong></p><ul><li>Made of stainless steel, 4% taper</li><li>Can be pre-curved to fit the canal curvature</li><li>With delta cones (max. diameter: 0.35mm) on both end</li><li>Used for the removal of filling material remnants and for the removal of necrotic pulp tissues or debris in a narrow space. Smaller-sized pyramidal tips can make it very easy to scrape gutta-percha root fillings from the canal wall.</li></ul><p><strong>TFRK-Micro-Explorer (TFRK-ME)</strong></p><p>Made of stainless steel, a sharp 0.1 mm-tip-diameter explorer, double-ended, 6% taper, smooth-surfaced. The TFRK-ME has extremely fine spear-shaped tips with a smooth surface for by passing ledged canals and exploring the canal for broken files or other impediments. This instrument can be bent to meet the canal curvature so that the TFRK tips can be precurved the same way as it is before use. When there is a ledge formed coronal to the separated file in the canal, the TFRK-ME can be used to locate the original canal and the ledge can be reduced by using it with several push-pull strokes.</p><p><strong>TFRK-Micro-Trephine bur (TFRK-MT)</strong></p><p>The inner diameter of the MT is ∅0.5mm whereas the outer diameter of the MT is 0.8 mm.<br>TFRK-MT can be used when the canal curvature is &lt;15°&nbsp;and the coronal diameter of the broken file is 0.45 mm. The inner depth of the MT is 1 mm to expose a 1 mm portion of the broken file. Spin the MT at 600 rpm counterclockwise in a short in/out motion to expose the coronal 1 mm portion of the broken file after the canal enlargement with the MGG #3 rotating at 2500 rpm to the broken file. If the canal curvature is &gt; 15°, a size # 60/.02 taper flexible NiTi rotary file should be used to enlarge the canal to the broken&nbsp;file.</p><p><strong>Modified Gates Glidden Drill #3 (MGG #3)</strong></p><p>The pilot tip of the Gate Glidden Drill #3 is cut off so that the root canal to the broken file can be enlarged&nbsp;to at least 0.45 mm as the tip diameter of the MGG #3 is 0.45 mm. It is used at 2500 rpm clockwise with a brushing motion against the outer wall to create a funnel shape.</p><p><strong>Martensitic-phased NiTi Rotary Instrument K-Endo (K6 N60 2% L25)</strong></p><p>60%, 2% taper, NiTi file in the martensitic phase at 37°C If&nbsp;the coronal diameter of the broken file is &gt;0.45 mm or the canal curvature is &gt; 15°, use this rotary instrument&nbsp;to enlarge the canal to the broken file at 500 rpm counterclockwise.</p><p><strong>Broken File Removal Tips (E87, E88, E89) TFRK-Katana Vertical (TFRK-Katana V or E88)TFRK- KatanaHorizontal (TFRK-Katana H or E89)</strong></p><p>TFRK-Katana V/H is designed with an extremely thin sword-shaped tip to create a 90-degree<br>semicircular ditch on the inner wall of the broken file. They can be pre-curved to be adapted to the canal curvature. Activate ultrasonics with the flat surface directed to the broken file from the inner wall of the canal. <strong>Feature:</strong> Create a 90°semicircular grooved space.</p><p><strong>TFRK-Straight (TFRK-S or E87)</strong></p><p>TFRK-S is characterized by an extremely sharp cone-shaped tip: 0.1 mm diameter tip with 1% taper that&nbsp;can be pre-curved to be adapted to the canal curvature.</p><ul><li><strong>Feature 1:</strong> Extend the grooved space to a 180°semicircular ditch until the broken<br>file is seen dancing after the 90° semicircular space created on the inner wall with the Katana V/H.</li><li><strong>Feature 2: </strong>Remove the broken File</li><li><strong>Feature 3:</strong> Create a thin space between the canal wall and gutta-percha root fillings. for the introduction of the TFRK-GPR</li><li><strong>Feature 4:</strong>&nbsp;Remove necrotic pulp tissues and debris from an isthmus or a thin space.</li></ul><p><strong>TFRK-Loop (TFRK-L: Yoshi Loop)</strong></p><p>Used to retrieve the broken file after loosening it in preparation with ultrasonics when the broken file is longer than 4.5 mm or the broken file did not come out with ultrasonics in 10 seconds removal attempts. The loop size is adjusted to the diameter of the broken file with an endodontic explorer and bent to 45 degrees to facilitate the placement of the loop over the broken file. The loop cannula is replaceable. The damaged loop can be quickly and easily replaced with a new loop.&nbsp;There are two sizes of the loop wire: 0.12 mm and 0.08 mm, suitable for different clinical situations with&nbsp;varying root canal diameters and resistance.<br>The maximum diameter of the microtube holding the loop is 0.5 mm and it has a 23 mm length. The microtube&nbsp;can be pre-curved to facilitate its placement into the root canal.</p><p><strong>Brownie Polishing Point (TFRK-P)</strong></p><p>A silicone rubber-based tool used with a straight handpiece. It is designed for sharpening<br>ultrasonic tips to the desired shape and can also be used for polishing to enhance sharpness.</p>', '<figure class=\"table\"><table><thead><tr><th>Model / Code</th><th>Material</th><th>Dimensions</th></tr></thead><tbody><tr><td><strong>TFRK-GPR</strong></td><td>Stainless Steel</td><td>Both side tips size 30 mm</td></tr><tr><td><strong>TFRK-ME</strong></td><td>Stainless Steel</td><td>Both side tips size 30 mm</td></tr><tr><td><strong>TFRK-MT</strong></td><td>Stainless Steel</td><td>Inner diameter: ∅0.5 mm, Outer diameter: 0.8 mm, Length: 25.8 mm</td></tr><tr><td><strong>K-Endo (K6 N60 2% L25)</strong></td><td>Stainless Steel</td><td>Diameter: ∅0.6 mm, Length: 25 mm</td></tr><tr><td><strong>MGG #3</strong></td><td>Stainless Steel</td><td>Diameter: ∅0.9 mm</td></tr><tr><td><strong>TFRK-Katana V (E88)</strong></td><td>Stainless Steel</td><td>Diameters: ∅0.3 mm, ∅0.1 mm, Length: 25.3 mm</td></tr><tr><td><strong>TFRK-Katana H (E89)</strong></td><td>Stainless Steel</td><td>Diameters: ∅0.3 mm, ∅0.1 mm, Length: 25.3 mm</td></tr><tr><td><strong>TFRK-Straight (E87)</strong></td><td>Stainless Steel</td><td>Diameter: ∅0.1 mm, Length: 25.3 mm</td></tr><tr><td><strong>TFRK-Loop</strong></td><td>Stainless Steel</td><td>Diameter: ∅0.5 mm, Length: 123 mm</td></tr><tr><td><strong>TFRK-P</strong></td><td>Stainless Steel</td><td>Diameter: ∅5 mm, Length: 16 mm</td></tr></tbody></table></figure>', '<ul><li>1 x Dental Explorer TFRK-GPR</li><li>1 x Dental Explorer TFRK-ME</li><li>1 x Endo File Remover TFRK-L</li><li>1 x Ultrasonic Scaler Tip (Endodontics) E87</li><li>1 x Ultrasonic Scaler Tip (Endodontics) E88</li><li>1 x Ultrasonic Scaler Tip (Endodontics) E89</li><li>1 x Polishing Rod TFRK-P</li><li>1 x Gate Drill #3</li><li>1 x Trephine TFRK-MT</li><li>1 x K Endo K6 N60 2% L25</li><li>1 x Autoclavable Cassette</li><li>1 x Instruction Manual</li></ul>', '<ul><li>Warranty is not applicable for this product</li></ul>', 215, '3', 0.00, 1.00, 1.00, 3, 3, 105, NULL, 0, 0, NULL, NULL, '2025-08-12-689b112101ce2.png', NULL, 1, '2025-08-12 15:47:09', '2025-08-20 15:17:43'),
(1652, 'P01107', NULL, 'Woodpecker Super Pen Dental Anesthesia Device', 'woodpecker-super-pen-dental-anesthesia-device-P01107', '<p>Building on the success of the Star Pen, Woodpecker’s <i><strong>Super Pen Dental Anesthesia Device</strong></i> takes clinical performance and patient comfort to the next level—now with PDL injection mode! Its patented, dual-pressure detection technology and AI algorithm identifies tissue density 3X more accurately to maintain a precise delivery pressure, automatically switching to PDL mode when needed. Higher efficiency, brushless motor increases service life 10X while reducing noise level to virtually zero.</p><ul><li>Slim, lightweight, cordless handpiece weighs only 3 oz.—the exact same weight as a standard manual anesthetic syringe!</li><li>Programmable high, low, and PDL injection speeds with dynamic feedback.</li><li>Provides injection accuracy to 0.02ml with real-time, on-board LCD display of percentage injected, speed mode, plunger status, and battery level.</li><li>Self-aspirating feature programmable for automatic, one-button manual control, or OFF.</li><li>Switchable, built-in music reduces patient anxiety.</li><li>Audible prompts make programming easy.</li></ul><p>Advance the plunger with one-hand, one-button control for significantly reduced hand fatigue. Switch between the three user-programmed plunger speeds with a single touch. Press auto-reset button for full plunger retraction and quick anesthetic cartridge removal.</p><p>Suitable for all anesthesia techniques including infiltration, block, palatal, and PDL. Works with all standard 1.8cc anesthetic cartridges and standard US dental needles. Transparent plastic cartridge holders are steam autoclavable to 273°F. Handpiece may be surface disinfected. One year warranty. Complete with pastel blue handpiece, eight cartridge holders, and 5V DC cordless recharging base.</p>', NULL, NULL, NULL, 504, '3', 0.00, 48000.00, 48000.00, 2, 2, 105, NULL, 0, 0, NULL, NULL, '2025-08-12-689b20846c3b5.png', NULL, 1, '2025-08-12 16:52:48', '2025-08-20 15:17:43');
